-- Struktur untuk view `v2_histori_sempro`
--
DROP TABLE IF EXISTS `v2_histori_sempro`;

CREATE ALGORITHM=UNDEFINED DEFINER=`tugasakhir`@`%` SQL SECURITY DEFINER VIEW `v2_histori_sempro`  AS  select `hs`.`nim` AS `nim`,`m`.`nama` AS `nama`,`e`.`nama` AS `tahap_lulus`,`hs`.`hasil` AS `keputusan` from ((`v2_mahasiswa` `m` join `v2_hasil_sempro` `hs` on((`hs`.`nim` = `m`.`nim`))) join `v2_event` `e` on((`e`.`id` = `hs`.`id_event`))) ;

