-- Struktur untuk view `v2_rekap_lulus_sempro`
--
DROP TABLE IF EXISTS `v2_rekap_lulus_sempro`;

CREATE ALGORITHM=UNDEFINED DEFINER=`tugasakhir`@`%` SQL SECURITY DEFINER VIEW `v2_rekap_lulus_sempro`  AS  select `hs`.`nim` AS `nim`,`m`.`nama` AS `nama`,`hs`.`hasil` AS `hasil`,`e`.`nama` AS `tahap_terkahir_sempro` from ((`v2_hasil_sempro` `hs` join `v2_mahasiswa` `m` on((`hs`.`nim` = `m`.`nim`))) join `v2_event` `e` on((`hs`.`id_event` = `e`.`id`))) where ((`e`.`kategori` = 'seminar_proposal') and (`hs`.`hasil` like 'Diterima%')) ;

