--
-- Struktur untuk view `v2_rekap_pendaftaran_sempro`
--
DROP TABLE IF EXISTS `v2_rekap_pendaftaran_sempro`;

CREATE ALGORITHM=UNDEFINED DEFINER=`tugasakhir`@`%` SQL SECURITY DEFINER VIEW `v2_rekap_pendaftaran_sempro`  AS  select `e`.`id` AS `id_event`,`e`.`nama` AS `keterangan`,`m`.`nim` AS `nim`,`m`.`nama` AS `nama_mahasiswa`,`d`.`nama` AS `nama_dosen_pembimbing_1`,`m`.`kode_prodi` AS `kode_prodi`,`p`.`id` AS `id_proposal`,`p`.`judul_proposal` AS `judul_proposal_awal`,`p`.`nama_grup_riset` AS `grup_riset_awal`,if(isnull(`rv`.`id_verifikasi`),'Belum diverifikasi','Sudah diverifikasi') AS `status_verifikasi`,`rv`.`saran_revisi` AS `saran_revisi_dari_grup_riset`,`ps`.`judul` AS `judul_direvisi`,`ps`.`grup_riset` AS `grup_riset_direvisi`,`ps`.`file_activity_control` AS `file_activity_control`,`ps`.`file_persetujuan_maju` AS `file_persetujuan_maju`,`ps`.`file_proposal_revisi` AS `file_proposal_revisi` from (((((`v2_mahasiswa` `m` join `v2_proposal` `p` on((`m`.`nim` = `p`.`nim_pengusul`))) left join `v2_rekap_verifikasi` `rv` on((`m`.`nim` = `rv`.`nim`))) join `v2_pendaftaran_sempro` `ps` on((`p`.`id` = `ps`.`id_proposal`))) join `v2_dosen` `d` on((`p`.`id_dosen_pembimbing_1` = `d`.`id`))) join `v2_event` `e` on((`ps`.`id_event` = `e`.`id`))) ;

