--
-- Struktur untuk view `v2_rekap_verifikasi`
--
DROP TABLE IF EXISTS `v2_rekap_verifikasi`;

CREATE ALGORITHM=UNDEFINED DEFINER=`tugasakhir`@`%` SQL SECURITY DEFINER VIEW `v2_rekap_verifikasi`  AS  select `m`.`nim` AS `nim`,`m`.`nama` AS `nama`,`d`.`nama` AS `dosen_pembimbing_1`,`p`.`judul_proposal` AS `judul_proposal`,`p`.`nama_grup_riset` AS `nama_grup_riset`,`v`.`id` AS `id_verifikasi`,`v`.`saran_revisi` AS `saran_revisi` from (((`v2_mahasiswa` `m` join `v2_proposal` `p` on((`m`.`nim` = `p`.`nim_pengusul`))) join `v2_verifikasi_proposal` `v` on((`p`.`nim_pengusul` = `v`.`nim_pengusul`))) join `v2_dosen` `d` on((`p`.`id_dosen_pembimbing_1` = `d`.`id`))) ;

