--
-- Struktur untuk view `v_total_moderator`
--
DROP TABLE IF EXISTS `v_total_moderator`;

CREATE ALGORITHM=UNDEFINED DEFINER=`tugasakhir`@`%` SQL SECURITY DEFINER VIEW `v_total_moderator`  AS  (select `ujian`.`nama_ujian` AS `nama_ujian`,`ujian`.`tanggal_pelaksanaan` AS `tanggal_pelaksanaan`,`ujian`.`moderator` AS `nama_dosen`,count(0) AS `jumlah_moderator` from `ujian` where (`ujian`.`status_ujian` <> '-') group by `ujian`.`moderator`,`ujian`.`nama_ujian`,`ujian`.`tanggal_pelaksanaan`) ;

