INSERT INTO `v2_pendaftaran_proposal` (`nama_mahasiswa`, `nim`, `email`, `nomor_ponsel`, `nomor_ponsel_orang_tua`, `judul_proposal`, `nama_pembimbing_1`, `nama_grup_riset`, `deskripsi_singkat`, `literatur_utama`, `literatur_penunjang`, `form_kesediaan_membimbing`, `catatan_khusus`, `draft_proposal`, `revisi_draft_proposal_1`, `revisi_draft_proposal_2`, `id`) VALUES
('Adhika Kurnia Febrianto', '141723017', 'sidhika99@gmail.com', '085853656141', '085853656141', 'Sistem Analisis Permintan Darah di Palang Merah Indonesia Unit Tranfusi Darah Kabupaten Bojonegoro', 'Kolonel Lek Dr. Arwin Datumaya Wahyudi Sumari', 'INFORMATION SYSTEM', 'Palang Merah Indonesia (PMI) adalah sebuah organisasi perhimpunan nasional di Indonesia yang bergerak di bidang sosial kemanusiaan. PMI berperan sebagai penyedia jasa kebutuhan darah, membuat PMI dituntut memnuhi kebutuhan pasien. Penelitian ini mengamati persediaan darah di PMI Unit Transfusi Darah (UTD) Kabupaten Bojonegoro. Karena sifat darah yang perishable, maka produk darah memiliki batas umur masing-masing. Sehingga dibutuhkan suatu sistem pengendalian persediaan untu menghindari kerusakan darah. Tujuan dari penelitian ini adalah memberikan analisis peramalan persediaan untuk periode kedepan. Peramalan dilakukan untuk jangka panjang dengan menggunakan metode dengan tingkat error terkecil.', 'Support Vector Regression', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1FWWs2l86RKx714EivDX8Braa5l37iJ09', '', '', '', '', 1),
('NIKO RIZKY', '1431140137', 'XSIRHAAN@GMAIL.COM', '081331993754', '081233183222', 'Aplikasi Pengenalan Plat Nomor Kendaraan Bermotor dengan Metode Deep Learning', 'Dwi Puspitasari, S.Kom., M.Kom.', 'COMPUTER VISION', 'Pengenalan Plat Nomor dengan metode deep learning dan pengolahan citra sehingga menghasilkan output yaitu Nomor kendaraan berdasarkan citra yang didapat oleh kamera', 'Deep Learning', 'Tenserflow atau yang lain', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1z4GhDWvSkBR5dIO_vx6FCY19wLSOpYG8', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1vn6UwaOAes9DA0HLAG6DKKwKdLNZydSQ', '', '', 2),
('Ricky yulian adi pratama', '1541180038', 'ricky.ghifary1122@gmail.com', '082211297101', '085204941195', 'SISTEM INFORMASI PREDIKSI TINGKAT KRIMINALITAS DENGAN MENGGUNAKAN METODE WINTERS EXPONENTIAL SMOTHING ', 'Kolonel Lek Dr. Arwin Datumaya Wahyudi Sumari', 'INFORMATION SYSTEM', 'Selama ini di Polres Kabupaten Probolinggo bertugas menyelanggarakan tugas pokok Polri dalam rangka memelihara\nkeamanan dan ketertiban masyarakat, menegakkan hukum, serta memberikan perlindungan, mengayomi\nkepada masyarakat. Dari permasalahan yang terjadi khusunya dalam tindakan kriminalitas masyarakat yang ada di wilayah Probolinggo dan agar tidak terjadi kenaikan tindakan kriminal diwilayah Probolinggo di awal bulan maka\ndiperlakukan pembenahan sistem peramalan yang nantinya dapat meramalkan hasil tindakan kriminal untuk\nbulan mendatang. Metode Exponential Smoothing itu menjadi tiga, yaitu Single , Double, dan Triple\n(Winters). Metode Single Exponential Smoothing sangat tepat di gunakan ketika pola datanya mempunyai\nsifat musiman, metode Double Exponential Smoothing sangat efektif digunakan ketika pola data bersifat\ndata trend (kenaikan) dan Triple Exponential Smoothing (Winters) sangat tepat digunakan ketika pola data\nbersifat musiman dan trend (kenaikan). Karena tingkat kriminalitas tersebut bersifat musiman (per-bulan)\ndan trend (kenaikan), maka metode yang tepat untuk meramalkan tingkat kriminalitas di Probolinggo yakni\nmenggunakan metode Winters Exponential Smoothing.', 'Winter Exponential Smothing', 'Simple Moving Average', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1PK4Ru4QRaWdAREJ_xQJ3DdYjqVEpxSEd', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1YgF0Gm1cArH8FwKxJnZxRmtzSs5q6KzW', '', '', 3),
('Ayu Maulina Diyah', '1541180052', 'ayumaulinna17@gmail.com', '085794551512', '085549014929', 'IMPLEMENTASI METODE FUZZY TIME SERIES PADA SISTEM PERAMALAN KEPADATAN JALAN RAYA KOTA MALANG KHUSUSNYA JL. SOEKARNO HATTA \n', 'Erfan Rohadi, ST., M.Eng., Ph.D.', 'INFORMATION SYSTEM', 'Meramalkan kepadatan kendaran di Jl. Soekarno Hatta Malang. Dan dari hasil prediksi ini akan ditentukan langkah - langkah yang tepat untuk menekan laju pertumbuhan jumlah kendaraan.', 'FUZZY TIME SERIES ', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1vuS33pmhYIG-mWFI2rBoPJeiEXR2kCkO', 'Untuk sementara kalimat judul skripsi belum di fix kan oleh pembimbing', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1TzRJ0G9T9wjDQUFdr2N2GPGup8Tb8ewm', '', '', 4),
('Jayanti Ayu Saktifa Sari', '1541180229', 'jayantiayuss@gmail.com', '08970424307', '081249303548', 'SISTEM PAKAR PENDETEKSI KERUSAKAN PADA KAMERA DSLR (DIGITAL SINGLE LENS REFLEX) DENGAN MENGGUNAKAN METODE CASE BASED REASONING DAN CERTAINTY FACTOR  ', 'Erfan Rohadi, ST., M.Eng., Ph.D.', 'SISTEM CERDAS', 'Membuat sebuah Sistem Pakar yang dapat mendeteksi kerusakan kamera DSLR (Digital Single Lens Reflex) dengan cara pengguna memasukkan gejala-gejala kerusakan yang muncul pada kameranya, lalu sistem akan memproses hingga mengeluarkan output berupa nama kerusakannya yang dialami dan solusi penanganannya.', 'Case Based Reasoning', 'Certainty Factor', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1hyBLEu24UKSY0b4VbQmb5sNcqtF1ROpL', 'Penulisan Judul masih belum fix, masih perlu konfirmasi dari Bapak Erfan selaku pembimbing. Karena beliau masih tugas ke luar kota, saya disuruh menunggu untuk bertemu beliau kembali insyaAllah pada hari Senin, 02 Desember 2019', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1jgf_LlRVt8H20ObOu5mEFR0Mwsa17IPw', '', '', 5),
('Asdhak Fillah Yoga Reksa', '1641720001', 'asdhakfillah@gmail.com', '082226848400', '081390451661', 'Rekomendasi Pemilihan Lahan Baru Untuk Instalasi PDAM di Kabupaten Grobogan', 'Dwi Puspitasari, S.Kom., M.Kom.', 'INFORMATION SYSTEM', 'Untuk mengurangi kekeringan pada kemarau panjang PDAM Kabupaten Grobogan. Untuk membuka lahan baru pdam memerlukan keputusan mana lahan yg terbaik untuk di buat instalasi baru. Keputusan tersebut di pilih berdasarkan kriteria yang sudah di tentukan oleh PDAM', 'Weight Agregated Sum Product Assessment (WASPAS)', 'Fuzzy', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1LclbhVSSNq1mttGBVStO7991D7gK1-G8', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1t0X3Z8-Rt98ugo27TDoFbLankc6moWHa', '', '', 6),
('RIZKA PURMAYA SARI', '1641720002', 'rizkapurmayas@gmail.com', '082141461727', '082142393084', 'IMPLEMENTASI METODE LINEAR DISCRIMINANT ANALYSIS UNTUK DETEKSI KEMATANGAN PADA BUAH STOROBERI MENGGUNAKAN EKSTRAKSI FITUR GRAY LEVEL CO-OCCURRENCE MATRIX DAN EKSTRAKSI WARNA HSV', 'Ulla Delfana Rosiani, ST., MT.', 'COMPUTER VISION', 'membuat aplikasi yang bisa membantu para pengusaha stroberi atau petani stroberi dalam mensortir buah secara efektif dan efisien. Dimana dizaman yang sudah modern ini masih banyak perkebunan terutama buah stroberi yang memetik pasca panen dan mensortir buah masih mmenggunakan tenaga manusia. sehingga buah yang di sortir sesuai dengan yang dibutuhkan oleh pembeli. ', 'Algortima Linear Discriminant Analysis (LDA)', 'Ekstrasksi fitur warna menggunakan HSV, dan ekstraksi tektur GLCM', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=17Z7FenbmMrQBdqcs2uUcFUiF75mKnOS2', 'judul di form kesediaan membing masih kurang tepat', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1oaw0wBS4g_dXObx7LMm-B9B4dfpR1d_6', '', '', 7),
('Faradella Widya Putri', '1641720003', 'faradellawidya@gmail.com', '081217193905', '08125261621', 'Prediksi Permintaan Kebutuhan Cabai di Kota Batu Menggunakan Metode Extreme Learning Machine', 'Ekojono, ST., M.Kom.', 'INFORMATION SYSTEM', 'Sistem ini dibuat karena kebutuhan cabai terus meningkat setiap harinya. Hal ini juga diikuti dengan meningkatnya jumlah penduduk dan semakin berkembangnya industri makanan yang berbahan baku cabai, maka diperkirakan laju permintaan kebutuhan komoditas cabai akan terus mengalami peningkatan. Akan tetapi jumlah ketersediaan dengan jumlah permintaan cabai tidak selalu seimbang. Hal ini disebabkan karena tidak stabilnya jumlah cabai yang diproduksi dan jumlah permintaan konsumen yang berfluktuatif sehingga dapat memberikan dampak pada ketidakstabilan harga cabai.\nDengan adanya sistem untuk memprediksi permintaan kebutuhan cabai di Kota Batu menggunakan metode Extreme Learning Machine ini diharapkan dapat membantu pihak perusahaan atau instansi terkait agar dapat menentukan langkah-langkah apa yang dapat dilakukan selanjutnya untuk menjaga kestabilan harga cabai dengan seimbangnya antara permintaan kebutuhan dengan produksi.', 'Extreme Learning Machine', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1-MU3YNeN1qQu8k3GK9ZEGMVHp5wnGNo0', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1QsWJy6JbkA1QxPrNgSW__60MeG-VER64', '', '', 8),
('Faisal Apriliawan', '1641720004', 'faisal0apriliawan@gmail.com', '081336062171', '081252920066', 'Sistem Pendukung Keputusan Penempatan Siswa PKL Menggunakan Metode Moora dan Simple Additive Weighting (studi kasus : SMK Negeri 5 Malang)', 'Eka Larasati Amalia, S.ST., MT.', 'INFORMATION SYSTEM', 'membuat sistem pendukung keputusan untuk menempatkan siswa smkn 5 malang pada tempat pkl ', 'moora', 'simple additive weighting', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=15YB5T14gio4luYPztVEiCXfr9tbOPa8l', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1iXE73dt9aDhNQNBf33CAA5_u4U5gOgZB', '', '', 9),
('Endar Gayuh Muktitama', '1641720005', 'endargayuhmuktitama@gmail.com', '082132138509', '081234220560', 'Perancangan Aplikasi Mobile Penentuan Jalur Tol dan Tarif Menggunakan Metode BFS', 'Rosa Andrie Asmara, ST., MT., Dr. Eng.', 'SISTEM CERDAS', 'Dengan semakin berkembangnya pembangunan infrastruktur jalan tol,tentunya akan semakin banyak juga beberapa rute yang lebih cepat ataupun lebih tepat untu di lewati dalam studi kasus tertentu,dan juga nilai kumulatif total tarif juga akan menjadi masalah jika tidak bisa di prediksi dari awal,maka dengan adanya permasalahan tersebut perancangan aplikasi mobile penentuan rute tol dan tarif sangat amat di perlukan guna untuk memberikan kemudahan di penggunaaan fasilitas infrastruktur jalan tol', 'BFS ( Breadth first search )', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1SjlPEX__1XFjCgSwf95kfrM6BXJLauRl', '', '', '', '', 10),
('Kris Widyo Febyanti', '1641720006', 'kwf2102@gmail.com', '081335008202', '081330048182', 'Implementasi Algoritma Extreme Learning Machine Untuk Identifikasi Komponen GUI pada Prototype Aplikasi Mobile', 'Ulla Delfana Rosiani, ST., MT.', 'COMPUTER VISION', 'Para developer pemula seringkali kebingungan untuk membuat sebuah desain tampilan dari aplikasi yang akan dibuatnya atau code seperti apa yang harus diketikan untuk membuat tampilan aplikasi dari sebuah citra prototipe yang dijadikan referensinya. Oleh karena itu peneliti akan membuat sebuah sistem yang dapat membantu proses identifikasi komponen yang terdapat dalam citra (gambar screenshot, gambar prototipe) tampilan halaman aplikasi Android Mobile. Dengan keluaran sistem berupa kode program. Uji coba dari penelitian sebelumnya untuk mengidentifikasi komponen yang terdapat dalam citra (gambar screenshot, gambar prototipe) tampilan halaman aplikasi Android Mobile yang menggunakan metode Convolutional Neural Network (CNN) menunjukan hasil akurasi sebesar 85,32% (Astiningrum, et al., 2019). Penulis mencoba menggunakan metode Extreme Learning Machine (ELM) karena metode ini berhasil melakukan pengenalan objek citra digital dengan rata-rata tingkat akurasi lebih baik dari pada metode CNN (Fikriya, et al., 2017).  Dengan adanya aplikasi ini diharapkan dapat membantu pengguna dalam menentukan komponena yang akan digunakan untuk membuat desain tampilan suatu aplikasi.', 'Algoritma extreme machine learning (ELM)', 'Canny Edge Detection ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1xQ6wrueHKPoxwKmEHpGCNj36Fq4sBK1s', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1zUs5C_2v4IybYovj0agl0GJR9u0LpKHP', '', '', 11),
('fathur romadhon', '1641720007', 'madhonsan@gmail.com', '085707242939', '085707242939', 'identifikasi jalan aspal berlubang', 'Putra Prima A., ST., M.Kom.', 'COMPUTER VISION', 'pendeteksi jalan berlubang dengan citra digital', 'GLCM dan KNN', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1WhLnBgIi3AdbKL-UBy_G653Jr3zXM6w1', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1ZYhBZLupxoqkUhLSQddXk_J59Ua07Ar7', '', '', 12),
('Anggara Mahendra Putra', '1641720008', 'anggaramahendra00@gmail.com', '082334227407', '+6285733340250', 'Management API Gateway pada arsitektur microservices menggunakan Server Side Load Balancing', 'Luqman Affandi, S.Kom., MMSI', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Penyeimbang beban di terapkan pada arsitektur microservices', 'Round Robin', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Sfed4Gddy7ZHWZfFwom9hbWL7WXjULMu', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1t91qGNmGseZzsQruvbEU8qYnJpS1egay', '', '', 13),
('Mochamad Feriyal Indra Rukmana', '1641720011', 'cferiyal@gmail.com', '081232258537', '082257092748', 'Implementasi Face Recognition pad smart untuk membuka kunci rumah', 'Cahya Rahmad, ST., M.Kom., Dr. Eng.', 'COMPUTER VISION', 'Teknologi sebuah sistem pengaman untuk masuk ke sebuah rumah telah banyak dikembangkan seperti menggunakan kartu, password. Metode tersebut masih memiliki kekurangan seperti keterbatasan manusia dalam mengingat benda dan mengingat kombinasi angka yang menyebabkan tidak dapat diaksesnya pintu tersebut. Sistem keamanan rumah konvensional dinilai kurang efektif dan efisien. Hal tersebut disebabkan karena pengguna diharuskan memasukan kunci terlebih dahulu kemudian memutar kunci kearah tertentu sehingga pintu dapat dibuka. Oleh karena itu alangkah baiknya jika sistem pengenalan wajah dapat di gunakan untuk sistem keamanan rumah. Sistem keamanan rumah menggunakan wajah memiliki kelebihan seperti wajah tidak dapat di duplikasi, wajah manusia berbeda-beda dan lebih efisien karena pemilik rumah hanya perlu mengarahkan wajah ke kamera untuk membuka pintu. Oleh karena itu penulis membuat sistem pengenalan wajah sebagai sistem kendali buka tutup pintu ruangan. Penggunaan wajah sebagai kunci untuk masuk ke dalam rumah diharapkan dapat meningkatkan tingkat keamanan menjadi lebih tinggi dikarenakan wajah tidak dapat diduplikasi dan berpindah tangan. [1] Sistem keamanan yang digunakan pada sistem ini menggunakan teknologi biometrika pengenalan wajah yaitu dengan menggunakan ciri â€“ ciri fisik manusia yang memiliki karakteristik berbeda â€“ beda yang selalu melekat pada manusia. Pada pengaplikasiannya, sistem keamanan menggunakan pengenalan wajah dilakukan dengan bantuan sebuah kamera atau webcam untuk menangkap wajah seseorang yang kemudian akan dibandingkan dengan wajah yang sebelumnya telah disimpan di dalam database tertentu. ', 'Metode Fisherface', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1hf_pEJf63o8C3zRznZM5X8ed2ItpWyPg', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1rAEo8kDo79COVM7m2rk048pY9ntsGsBI', '', '', 14),
('Ahmad Alfian Bastami', '1641720012', 'ahmadalfianbastami@gmail.com', '081325371051', '082333031389', 'Klasifikasi Mutu Kelapa Berdasarkan Warna dan Tekstur Untuk Produksi Wingko yang Berkualitas Menggunakan Metode SVM ( Support Vector Machine ) (Studi Kasus Putra Agung Wingko )', 'Kolonel Lek Dr. Arwin Datumaya Wahyudi Sumari', 'COMPUTER VISION', 'Salah satu tempat produksi wingko di Babat yakni Putra Agung Wingko. Dalam waktu satu hari produksi dapat menghasilkan 700 produk wingko, salah satu proses yang menentukan kualitas wingko yakni dengan pemilihan kelapa, menurut hasil wawancara dengan pemilik Putra Agung Wingko salah satu tempat produksi wingko di Babat para pekerja kurang memperhatikan kualitas kelapa karena harus memenuhi target produksi wingko setiap harinya. Selain itu pada proses pemilihan kelapa masih manual. Dengan demikian wingko yang dihasilkan kurang berkualitas dan membuat banyak kerugian. Oleh karena itu, akan membangun sebuah aplikasi yang dapat memilih kelapa yang baik dan kelapa yang kurang baik berdasarkan warna daging kelapa dan juga tekstur dari daging kelapa tersebut. Dengan adanya aplikasi ini dapat membantu tidak hanya untuk mencapai target produksi tetapi juga untuk meningkatkan mutu wingko, dan aplikasi dapat ini mempermudah para pekerja dalam melakukan proses pemilihan. Akan tetapi pada aplikasi ini pemeriksaan dilakukan secara statis tidak dinamis. Aplikasi yang dibuat ini menampilkan 2 kelas mutu kelapa yang pertama mutu baik dan yang kedua mutu kurang baik. Dalam pengklasifikasian mutu dari daging kelapa menggunakan metode SVM ( Support Vector Machine ).   ', 'SVM (Support Vector Machine)', 'HSV (hue, saturation, value), GLCM (Gray Level Co- Occurrence Matrix)', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1oyBmZIavuFePGscmfBhKL65wr51b-Fx4', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1hnIWl2XsnKppwg7XkxjtUVhYcgCDIl62', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1ovvIr0kOU2vAXsN0kXZNOJrHr53vMLxZ', '', 15),
