('Ikhsan Efendi', '1641720015', 'ikhsanefendi67@gmail.com', '0895631866158', '081703088467', 'IMPLEMENTASI MONITORING AIR BERSIH PADA AQUARIUM IKAN KOI DENGAN NODEMCU ESP8266 MENGGUNAKAN METODE FUZZY', 'Dwi Puspitasari, S.Kom., M.Kom.', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Melakukan pemantauan air jernih yang ada di akuarium ikan koi menggunakan sistem informasi yang bertujuan untuk memberikan kualitas air yang baik untuk ikan koi', 'Fuzzy', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1OeshPL8LkUTb04VigWdDDMH0_AznU627', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Jk3HjISpJQ1RJlbd1Tlx_Z740tnaGLbP', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1IrQASFnxFLxep2UaQ9uqKWr-9pWCvkIJ', '', 17),
('HANIFAH FANIDYA UTARI', '1641720016', 'fanidya001@gmail.com', '081330209235', '081355566654', 'SISTEM MONITORING KINERJA PANEL SURYA UNTUK IRIGASI SAWAH DENGAN METODE FUZZY', 'Yuri Ariyanto, S.Kom., M.Kom.', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Penelitian ini membahas pemanfaatan panel surya untuk pemenuhan kebutuhan irigasi sawah secara efisien. Panel surya mampu mengubah panas matahari menjadi listrik sehingga dapat menjadi energi alternatif pada area tidak terjangkau listrik PLN, yakni sawah pertanian. Teknologi panel surya bermanfaat untuk irigasi sawah pertanian secara efisien menggantikan penggunaan pompa air gen set yang memerlukan biaya tambahan untuk BBM. \nNamun penerapan panel surya memerlukan sistem pendukung agar pengoperasiannya berjalan secara efektif. Penelitian ini memadukan sistem solar tracker yang membuat panel surya mengikuti gerak matahari otomatis untuk mengoptimalkan kinerja panel surya menangkap radiasi matahari. Sistem monitoring daya panel surya melalui parameter arus dan tegangan, dan sistem kontrol irigasi sawah sesuai pola irigasi padi. Ketiga sistem tersebut terintegrasi dalam sistem monitoring kinerja panel surya untuk irigasi dengan metode fuzzy.\nAlgoritma fuzzy untuk memperhitungkan durasi pengairan yang diperlukan sesuai pola tanam, melalui parameter daya panel surya, kelembapan tanah dan ketinggian air untuk mengontrol pompa air. Perancangan sistem berbasis mikrokontroler Arduino Uno dihubungkan ke aplikasi melalui modul Wi-Fi ESP8266. Komunikasi pengiriman data menggunakan metode UDP dan data terkirim tersimpan pada database. Pengambilan data penelitian dilakukan dengan membuat skema prototipe untuk solar tracker, solar panel sebagai catu daya pompa, pompa air , dan miniatur sawah serta sumber air.', 'Fuzzy', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=19UOmCY4Rcnz3KgGjcNQMykjUIQtOQ8p9', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=18NDjkTkHxtl3u1E-p1Q6ryeMG13yjlka', 'https: