('Pu\'ita Purnama Sari', '1641720017', 'puita.sari@gmail.com', '081330071967', '085330490822', 'Identifikasi kualitas terung ungu berdasarkan warna dan tekstur menggunakan metode jaringan syaraf tiruan', 'Mungki Astiningrum, ST., M.Kom.', 'COMPUTER VISION', 'Skripsi yang akan saya kerjakan nantinya adalah pengidentifikasian kualitas terung ungu berdasarkan warna dan tekstur, menggunakan metode pengklasifikasian backpropagation, dengn inputan gambar, dan menghasilkan penjelasan apakah layak untuk dikonsumsi', 'Backpropagation', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1ioYOZdYeUMKNLHIXIkYteuujL7geIwA8', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1y-jox5_GszpMUhCKYcghWcyKyRaMeLNy', '', '', 19),
('Bella Rizqia', '1641720018', 'bellarizqia98@gmail.com', '085748220225', '085708042564', 'Pengenalan Alat Indra Dengan Pendekatan Mix Reality (Studi Kasus Museum Tubuh)', 'Hendra Pradibta, SE., M.Sc.', 'MULTIMEDIA AND GAME', 'Pengenalan Alat Indra di Museum Tubuh Bagong dengan Pendeketan mix Reality menjadi momen yang tepat untuk meningkatkan ketertarikan pengunjung dalam mengeksplorasi benda yang ada di museum karena bersifat interaktif. Penggunaan aplikasi ini untuk mengamati pengalaman dan kebutuhan pengguna saat mencobanya. Aplikasi ini akan memunculkan gambaran atau visualisasi alat indra manusia secara 3D, pengunjung akan di perlihatkan macam alat indra manusia sebagai sarana informasi. Pada tahap akhir, akan ada kuis atau semacam evaluasi atas informasi yang sudah diberikan untuk mengetahui apakah aplikasi berhasil memberikan informasi alat indra dengan baik atau belum.', 'Metode Fisher Yates', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1rEMmlsUfagEBO-Gby1WhGBRZ88Y7M3Jx', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1RdHnywyUOB6iAohN7RWp62BLGW0JHPoh', '', '', 20),
('Muhammad Ainur Ilmy', '1641720019', 'polinema1641720019@gmail.com', '081336431552', '081333589119', 'Perancangan Sistem Prediksi Kepadatan Lalu Lintas Menggunakan Metode Double Exponential Smoothing Berbasis IoT', 'Rosa Andrie Asmara, ST., MT., Dr. Eng.', 'COMPUTER VISION', 'Raspberry Pi akan Di instal modul kamera dan merekam kepadatan jalan berupa video secara realtime, video akan di olah menjadi informasi berupa jumlah kendaraan/detik, data akan di kirimkan ke website untuk di analisis menggunakan metode Double Exponential Smoothing dan di tampilkan berupa grafik line. ', 'Double Exponential Smoothing ', 'Haar Cascade Classifier menggunakan opencv', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1CKHIHEV7YPUfujif-9XyYBvkqooXJyei', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1W77-q_p8KiLTZnveWYTLkdhW36SpYcUh', '', '', 21),
