('Moh. Berlian Nusantara', '1641720031', 'moh.berliannusantara@outlook.com', '082264919849', '085236756141', 'Implementasi Deep Learning Untuk Sistem Mengemudi Otonom Dengan Menggunakan Artifitial Neural Network Dan Object Detection', 'Cahya Rahmad, ST., M.Kom., Dr. Eng.', 'COMPUTER VISION', 'mengimplementasikan kecerdasan buatan ke dalam sistem mobil tanpa awak atau autonomous driving dengan melakukan analisa terhadap obyek seperti rambu-rambu lalu lintas atau benda disekitarnya', 'artifitial neural network', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1U08e2EJviG2BeKhCaAZMOokZfGAOmnU-', '', '', '', '', 33),
('Malia Elisiana', '1641720032', 'maliaielsi5@gmail.com', '085257142466', '085259559115', 'Identifikasi "Acne Vulgaris" Berdasarkan Fitur Warna dan Tekstur Menggunakan Klasifikasi JST Backpropagation', 'Ulla Delfana Rosiani, ST., MT.', 'COMPUTER VISION', 'Skripsi saya tentang identifikasi acne vulgaris, Acne Vulgaris adalah penyakit kulit kronis umum yang melibatkan penyumbatan dan atau peradangan pada folikel rambut dan kelenjar minyak yang menyertainya. Acne vulgaris memiliki bermacam-macam jenis, kadangkala orang-orang susah untuk membedakan apakah acne vulgaris yang muncul merupakan jenis a, b atau c. Kebanyakan orang juga tidak tahu apakah acne vulgaris yang dimilikinya masih dalam kondisi ringan atau sudah meradang. Untuk itu sistem ini dibuat agar acne vulgaris dapat dideteksi apakah termasuk kedalam jenis a atau jenis b, sehingga orang-orang pun mengetahui jenis acne vulgaris yang mereka punya dan dapat diketahui bagaimana cara penanganan yang tepat untuk setiap jenisnya.', 'JST Backpropagation', 'Ruang Warna HSV & Metode GLCM', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1t-gb3F1SZIsPM8To1eQ3mtGxxle5hZpW', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1coup8DZWLSkyHJK360Ggu3qmfMStULg8', '', '', 34),
('Dikky Awan Nugroho', '1641720034', 'awandikky@gmail.com', '08883429237', '081359491516', 'Pengolahan Citra Digital Desain Sablon Untuk Menentukan Estiamsi Harga di Percetakan', 'Rawansyah., Drs., M.Pd.', 'COMPUTER VISION', 'Penelitian ini bertujuan untuk memebuat sebuah aplikasi yang dapat memberikan dukungan untuk memberikan estimasi harga berdasarkan desain  yang telah dibuat sebelumnya. dalam penelitian ini, penulis melibatkan beberapa narasumber berupa percetakan spanduk dan banner yang telah berdiri. data yang didapatkan akan menjadi referensi penelitian untuk mendapatkan akurasi yang diinginkan.', 'CNN', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1wU7fOa3Yzfr19wbAtKqQlCLEi5hOdkq6', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1t9lFcALQON3PMy8OUuGnq62i83CSNsAM', '', '', 35),
