('Fajar Lukman Darwinata', '1641720038', 'fajarlukman8@gmail.com', '0895395101763', '085100460884', 'Klasifikasi jenis kayu berdasarkan serat dan tekstur menggunakan metode gray level dan K - Means', 'Cahya Rahmad, ST., M.Kom., Dr. Eng.', 'COMPUTER VISION', 'Jadi skripsi saya bertujuan untuk mengklasifikasi jenis kayu beradasarkan serat dan teksture bagian dalam kayu, penelitian ini juga bertujuan untuk mengetahui kualitas kayu jangka panjang berdasarkan seratnya', 'Gray Level', 'gabor filter', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1kkalw7UfyCYwkU0wkj154Y87H7FKX2GC', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1NWjzl6-AUC-TqeILqRzfIn65JzaD6o2W', '', '', 38),
