('Siti Yulianah', '1641720041', 'sitiyulianah38@gmail.com', '089687087981', '081231917801', 'CERTAINTY FACTOR UNTUK SISTEM PAKAR DIAGNOSA HAMA DAN PENYAKIT PADA BUNGA KRISAN', 'Rudy Ariyanto, ST., M.Cs.', 'SISTEM CERDAS', 'aplikasi ini digunakan untuk menentukan jenis penyakit dan hama pada bunga krisan berdasarkan gejala yang sudah ada sehingga memberikan solusi yang tepat dan terbaik', 'certainty factor', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1xF4daG9QnhjKifEyF16RVPI6g22jbW2l', 'Kurang tanda tangan pembimbing, karena pembimbing masih tugas ke luar kota.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1X3kaXWtU2GH8SxyV2RS5TI6fyYjsaAwt', '', '', 40),
('Kholifatul Mahmudah', '1641720042', 'kholifatul.viiie14@gmail.com', '082139380830', '081230409578', 'Implementasi Metode Support Vector Machine untuk Diagnosis Fault Transformator Daya', 'Ekojono, ST., M.Kom.', 'SISTEM CERDAS', 'Sistem yang dapat menghasilkan kesimpulan suatu tranformator daya memiliki potensi kegagalan (diagnosa) secara cepat, tepat dan efisien dengan cara menghitung persentase gas yang terlarut pada transformator daya yaitu CH4, C2H4, dan C2H2. Hasil diagnosa tersebut dibagi menjadi 7 kelas berdasarkan Duval Triangle, diantaranya yaitu : Partial Discharge (PD), Discharge of Low Energy (D1), Discharge of High Energy (D2), Combination of Thermal Fault and Discharges (DT), Thermal Faults of Temperature T < 300ï‚°C (T1), Thermal Faults 300ï‚°C<T<700ï‚°C (T2), Thermal Faults T>700ï‚°C (T3). Klasifikasi untuk hasil diagnosa transformator daya menggunakan metode Support Vector Machine.', 'Support Vector Machine', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1QSIlLrvNc7owcKOxoGI6F5H2bNijeU9I', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1E9plT1ws2-8P2mco0AJOVAIXFlf4toKx', '', '', 41),
('Clara Nadya Putri Lyani', '1641720043', 'claranadya123@gmail.com', '089531026477', '085103356395', 'Implementasi Fuzzy Time Series Ruey Chyn Tsaur Untuk Mengukur Potensi Penjualan Produk di UD.Rama Jaya Water Heather', 'Indra Dharma Wijaya, ST., M.MT.', 'INFORMATION SYSTEM', 'Melakukan sebuah penelitian yang betujuan untuk membentuk sebuah sistem pengukuran dan potensi penjualan yang tepat, guna menentukan persediaan barang dan penjualan yang ada sesuai dengan permintaan yang akan datang.Serta melakukan pengukuran keakuratan hasil potensi penjualan produk menggunakan fuzzy time series Ruey Chyn Tsaur,yang diharapkan dari hasil pengukuran potensi penjualan tersebut UD.Rama Jaya Water Heather dapat menentukan keputusan terkait persediaan barang, rencana  produksi, cash flow dan investasi aktiva.', 'Fuzzy Time Series Ruey Chyn Tsaur', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1t_AIE3ngb6xpIQRFGEFRrMlln8lENn6U', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1RuiucjJwUnlF1oKenEdYv8KCcWOUiT2W', '', '', 42),
('Yudha Pradana Putra', '1641720044', 'yudhapradana102@gmail.com', '081803876644', '081945777022', 'Evaluasi K-Means Clustering Pada Preprocessing Sistem Temu Kembali Informasi', 'Faisal Rahutomo, ST., M.Kom., Dr.Eng.', 'SISTEM CERDAS', 'Melakukan pengujian efektifitas dan efisiensi tambahan pada tahap preprocessing pada sistem temu kembali. yaitu, mengklasterkan informasi yang ada terlebih dahulu menggunakan metode K-means. kemudian melakukan pencocokan query dengan dokumen disederhanakan kepada pencocokan query dengan centroid klaster. kemudian dilakukan pengujian menggunakan recall, precision dan f-score', 'K-Means', 'TF-IDF, Cosine Similarity ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1wJlhKMTxXvnW9EWVdj10ZIoZG-hRxq36', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1L1mpl0Mj0PI6d01X4Sk9xhhVtl6npnPx', '', '', 43),
('Adinda Dwi Larasati', '1641720046', 'larasatidwidinda@gmail.com', '083834282968', '083848487282', 'Implementasi Deep Learning Untuk Deteksi Ekspresi Emosi Pada Twitter', 'Faisal Rahutomo, ST., M.Kom., Dr.Eng.', 'SISTEM CERDAS', 'Menguji metode SS-BED untuk deteksi emosi pada twitter. Metode SS-BED merupakan gabungan\ndari dua layer. Layer pertama mengombinasikan metode deep learning LSTM dengan SSWE dan layer kedua LSTM dengan GloVe. \nHarapannya dengan mengombinasikan metode deep learning dengan fitur word embedding ini bisa mengetahui mendeteksi emosi di twitter yang lebih akurat', 'Long Short Term Memory (LSTM)', 'Sentiment-specific Word Embedding (SSWE) dan Global Vector (GloVe)', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Zhg-eek07L-3vZ8D5Z7ixcKLK2DquXNq', 'Judul yang ada di form bimbingan direvisi oleh pembimbing. Jadi judul di form dan draft proposal berbeda (sudah kesepakatan dengan pembimbing)', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1z1qGRjODjUPFL2zIxbkS6Kaj6M4gkIsB', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1RRu4RcHlMbfjuJs87inyaJ187M1V5wk9', '', 44),
('Alindya Kirana Putri', '1641720047', 'alindyakiranap@gmail.com', '081282174755', '081218377999', 'Sistem Informasi Prediksi Stok dan Utilitas Gudang', 'Pramana Yoga Saputra, S.Kom., MMT.', 'INFORMATION SYSTEM', 'PT. Keramik XYZ merupakan salah satu perusahaan industri keramik, yang mana mereka memproduksi 2 macam keramik yaitu, keramik lantai dan keramik dinding. Pada keramik dinding terdapat beberapa masalah yaitu menurunnya minat di pasar pada tipe keramik dinding ini sehingga mengalami penumpukkan keramik pada gudang. Maka dari itu diperlukan aplikasi yang mana dapat untuk memprepdiksi stok keramik dinding di gudang untuk ke depannya apa saja tipe yang paling diminati agar tidak mengalami kelebihan produksi. Dan setelah memprediksi stok keramik dinding , diperlukan juga untuk memprediksi utilitas dari gudang tempat menyimpan stok keramik dinding agar gudang tersebut tidak mengalami kelebihan maupun kekurangan stok di gudang. Jadi perlu diperhitungkan juga untuk penempatan stok keramik dindingnya. Untuk memprediksi stok keramik ditunjang menggunakan Metode Markov Chain sedangkan untuk memprediksi utilitas gudang menggunakan Metode Class Based Storage Policy.', 'Metode Markov Chain', 'Metode Class Based Storage Policy', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1_hjKzk9tBClVEwrfhSPwyz4w7QuDU7xV', 'Sudah ada tanda tangan pembimbing', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=15VMSiUzkNrJ7Eo7PNTpaFG1RHCQNYyyu', '', '', 45),
('Refly Ilham Syabana', '1641720048', 'darkside988@gmail.com', '08985125736', '082231231758', 'Penerapan Metode Design Thinking  pada Perancangan User Interface Aplikasi Kotakku', 'Pramana Yoga Saputra, S.Kom., MMT.', 'INFORMATION SYSTEM', 'Sistem Informasi Kotakku ini adalah sebuah marketplace katering yang akan mempermudah user untuk mencari informasi tentang katering baik dari segi harga, jarak dan lain-lain yang nantinya akan dikemas menggunakan sebuah metode user experience Design Thinking dan pengujiannya menggunakan metode System Usability Scale, dimana permasalahan ini diambil dari sebuah komunitas dan keluarga yang rata-rata susah dalam mencari sebuah katering untuk acara baik untuk aqiqah, pernikahan dan lain-lain.', 'System Usability Scale', 'Desgin Thinking', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1DuWalmkQyTkmSi1UNvPtWVzRNhlBZrL3', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1cFhzSpoV9U08AQ41xM6E-FEILWB82jl7', '', '', 46),
('Nabila Nurfajrina', '1641720049', 'nabilafajrina9898@gmail.com', '087779134257', '085233921809', 'Impelementasi association analys untuk peningkatan tingkat risiko kredit kendaraan bermotor', 'Faisal Rahutomo, ST., M.Kom., Dr.Eng.', 'SISTEM CERDAS', 'Analisa untuk tingkat risiko kredit bermotor', 'SVM', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1q8W_DD0cF4GRTnuzNWsy3SlGOPotBtxq', '', '', '', '', 47),
('Maulana Zinedin Zidane', '1641720051', 'maulanazinedinzidane@gmail.com', '081914866697', '082332402018', 'PENERAPAN ALGORITMA APRIORI UNTUK MENENTUKAN LOKASI BARANG DI GUDANG\n( STUDI KASUS : PG KEBON AGUNG MALANG)\n', 'Kolonel Lek Dr. Arwin Datumaya Wahyudi Sumari', 'INFORMATION SYSTEM', 'Gudang merupakan bagian yang penting dari suatu proses produksi, dikarenakan gudang merupakan tempat penyimpanan material produksi. Manajemen gudang sangat diperlukan agar aliran rantai pasok dapat berjalan dengan baik. Tata letak juga memegang peranan penting dan memiliki banyak dampak strategis bagi perusahaan. Tata letak mempengaruhi perusahaan dari segi kapasitas, aliran material, fleksibilitas, biaya, kualitas lingkungan kerja, dan lain sebagainya. Kemudahan dalam mengambil dan meletakan barang merupakan suatu yang sangat  penting  dalam  tata  letak  gudang  dalam  sebuah  perusahaan  agar  tidak  ada kesalahan  dalam  pengambilan  dan  peletakan  produk-produk  yang  disimpan  oleh perusahaan didalam gudang. (Benedictus Rahardjo,2017)\nPG Kebon Agung sendiri merupakan perusahaan yang bergerak di bidang industri gula, PG. Kebon Agung Malang memiliki bagian-bagian tersendiri pada setiap bidang termasuk bagian Gudang, di gudang PG. Kebon Agung terdapat banyak rak dengan berbagai barang untuk kebutuhan pabrik. Pada bagian gudang belum tersedia sistem yang dapat digunakan untuk melakukan penentuan lokasi barang di gudang, sehingga penataan barang di gudang masih belum optimal. Dengan permasalahan tersebut diperlukan sistem untuk melakukan penataan barang di gudang, sehingga penataan  barang setiap rak akan lebih efisien. Untuk penataannya sendiri berdasarkan frekuensi barang yang sering di ambil atau barang keluar sehingga barang yang sering di ambil akan berada di rak paling depan. Di dalam sistem juga akan menampilkan denah gudang, sehingga memudahkan pegawai gudang dalam melakukan penataan barang dan pencarian barang.\n', 'Algoritma Apriori', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1qiZfVjy6gfR3Vbcr4rLp2j5UzdCWD2n1', '', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1BhinJS5WsOqHHBh3uvkKZ_ySwLxfpdeA', '', 48),
('Dita Novia Pradini', '1641720052', 'ditanovia40@gmail.com', '082234834874', '081259764406', 'SISTEM PERAMALAN DAN PEMANTAUAN JUMLAH  PRODUKSI IKAN BERBASIS WEB DENGAN METODE Autoregressive Integrated Moving Average(ARIMA)\n(STUDI KASUS DINAS PERIKANAN KAB.MALANG )', 'Mungki Astiningrum, ST., M.Kom.', 'INFORMATION SYSTEM', 'Meramalan jumlah produksi ikan kabupaten malang  setiap bulanya, disini terdapat dua pengguna yaitu admin dengan user, user hanya bisa melihat permalan jumlah produksi ikan setiap bulanya n dan juga tampilan data jumlah produksi setiap bulanya. tujuanya dari peramlan ini untuk menimalisisr terjadinya overproduksi diKabupaten Malang.', 'ARIMA', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1NIcb4NzZ7FGMyQXeB-EEuGRplmvyN_h1', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1T_xCtG2dOJjp2KVM_c0CtxmPX8SVqOIi', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1O8b06R6hv7b1Qe5WRpesIsj5-z1FmKJ3', '', 49);
INSERT INTO `v2_pendaftaran_proposal` (`nama_mahasiswa`, `nim`, `email`, `nomor_ponsel`, `nomor_ponsel_orang_tua`, `judul_proposal`, `nama_pembimbing_1`, `nama_grup_riset`, `deskripsi_singkat`, `literatur_utama`, `literatur_penunjang`, `form_kesediaan_membimbing`, `catatan_khusus`, `draft_proposal`, `revisi_draft_proposal_1`, `revisi_draft_proposal_2`, `id`) VALUES
('M. Nindra Zaka', '1641720053', 'mnindrazaka@gmail.com', '085335473895', '085221241686', 'Implementasi instant update pada hybrid mobile development menggunakan dynamic loading bundle', 'Putra Prima A., ST., M.Kom.', 'INFORMATION SYSTEM', 'setiap kali ada perubahan pada aplikasi android, seperti perbaikan atau penambahan fitur, maka pihak playstore akan melakukan proses peninjauan ulang terhadap APK yang telah diupload, hal ini membutuhkan waktu berhari - hari hingga berminggu - minggu, sehingga perubahan tersebut tidak dapat langsung diterima oleh pengguna aplikasi\n\ndisini saya akan membuat platform yang dapat melakukan perubahan pada aplikasi android yang dibangun menggunakan hybrid mobile development, tanpa harus melalui proses peninjauan ulang pada playstore, sehingga apabila ada perubahan, maka pada saat itu juga pengguna dapat menerima perubahan tersebut', 'dynamic loading bundle', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1bZCAaApacNOqFHWlUxcJph9GDgzCvZ5x', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1YphNHabJ2aNbeMS2cm7FS7ISv8A3NVF4', '', '', 50),
('Putri Indah Mawarni', '1641720054', 'putri.pi1188@gmail.com', '081347567087', '0857769977878', 'Klasifikasi Mutu Telur Burung Puyuh Berdasarkan Tekstur dan Warna Menggunakan Metode K-Means Clustering (Studi Kasus NS Quail Farm)', 'Kolonel Lek Dr. Arwin Datumaya Wahyudi Sumari', 'COMPUTER VISION', 'Salah satu peternakan yang melakukan ternak burung puyuh ini adalah NS Quail Farm. Burung Puyuh yang diternakkan pada NS Quail Farm yakni Blaster. Produktifitas Burung puyuh cukup tinggi dalam per tahun satu burung puyuh dapat menghasilkan 250-300 butir telur, Burung Puyuh dapat menghasilkan setidaknya satu butir telur dalam waktu satu hari. Pada umumnya burung telur puyuh ini berwarna putih dengan memiliki bintik-bintik berwarna hitam pada cangkang telurnya. Panen telur burung puyuh dilakukan setiap hari pada waktu pagi atau sore hari. Telur-telur yang sudah di ambil kemudian di seleksi, seleksi dilakukan dengan cara memisahkan telur dengan kualitas yang baik dan jelek. Menurut hasil wawancara dengan salah satu pegawai di peternakan NS Quail Farm, kualitas telur burung puyuh dapat dilihat bedasarkan tekstur pola pada kulit telur burung puyuh dan juga warna pada kulit telur burung puyuh. Pada proses pemilihan telur dapat meningkatkan tingkat kualitas produksi pada peternakan NS Quail Farm. Penilaian kualitas yang dilakukan pada peternakan NS Quail Farm masih dilakukan dari prespektif para pekerja. Selain membutuhkan waktu yang cukup lama dalam proses pemilihan telur burung puyuh ini, penilaian para pekerja dalam melakukan pemilihan telur dengan kualitas yang baik berbeda-beda antara pekerja yang satu dan pekerja lainnya. Dari permasalahan tersebut dilakukan peneliti akan membuat suatu aplikasi yang dapat memngelompokkan mutu dari telur burung puyuh yang dilihat dari tekstur dan juga warna telur burung puyuh. ', 'K-Means Clustering', 'Threshold Otsu', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1n4r80Zk_BLFdL5LFOA6Npfjv1nf9-QB_', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1ak0Vzu1BKaJhnmRxa4rtcEJKLZHwphQf', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1T1froMONcQQt9ufy-uK9Q4OV8MMgoXs3', '', 51),
('Dikta Afif Rahman Prasetyo ', '1641720055', 'afifdikta@gmail.com', '082140676967', '081330050368', 'Sentiment Analysis Terhadap Object Wisata Alam Kota Malang Di Instagram Dan Facebook Menggunakan Metode Naive Bayes Dan Support Vector Machine.', 'Gunawan Budi Prasetyo, ST., MMT., Ph.D.', 'INFORMATION SYSTEM', 'Membuat sistem informasi sebuah objek wisata yang di ambil dari sebuah komentar instagram dan facebook dari komentar tersebut data di ambil lalu akan di urutkan berdasarkan ulasan positif', 'Naive Bayes Dan Support Vector Machine', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=15n3qlRmqOu4u86ojjhHkbQeeNJCNHPVf', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1qziDnFulc1fgh15KQIQEkLfvfZj_Mt1i', '', '', 52),
('Angelita Justien Jumadi', '1641720056', 'angelita.lmj15@gmai.com', '082232155621', '085230854095', 'Penerapan Metode Cosine Similarity Pada Aplikasi Ujian Online Essay Otomatis', 'Eka Larasati Amalia, S.ST., MT.', 'SISTEM CERDAS', 'Dalam skripsi yang penulis akan susun nantinya, akan membuat sistem penilaian ujian essai otomatis yang dimaksudkan agar memperoleh hasil penilaian yang objektif tanpa ada tambahan faktor eksternal yang sifatnya mungkin kurang adil bagi sebagian orang. Dimana dalam penyusunannya, penulis menggunakan Metode Cosine Similarity.', 'Cosine Similarity', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1ykV_XAFSM2lFeOawLVNmkWzYY7kfVfd8', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1TiSGw8ru2OZ_T5QO0X2WZFs-nmpt_UFE', '', '', 53),
('Adam Kurnia', '1641720058', 'adam.shufflers1@gmail.com', '089650494347', '081232673020', 'SISTEM PENDUKUNG KEPUTUSAN BERBASIS ONTOLOGI UNTUK PEMILIHAN PEMAIN YANG TEPAT SESUAI ROLE PADA TIM PUBG MOBILE MENGGUNAKAN METODE ANP DAN BORDA', 'Gunawan Budi Prasetyo, ST., MMT., Ph.D.', 'SISTEM CERDAS', 'Awalnya saya melihat permasalahan yang ada disekitar saya yaitu ketika tim Esport di kota Malang akan membuat tim baru dan mereka kesulitan mencari pemain dengan kriteria yang sesuai, dari sini saya ingin mewujudkan pembuatan sistem pendukung keputusan untuk pemilihan pemain mereka agar sesuai dengan kriteria yang diinginkan.', 'Analytic Network Process', 'Borda', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1piFZAhSfotYQp8CmyLzSuT0XPIFXcVMF', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1YJ_J9SEDHyk11hXdaItxi-WGSucvyAh0', '', '', 54),
('Aulia Adistanti', '1641720059', 'auliadstanti@gmail.com', '081331449685', '081231831777', 'Sistem Pakar Diagnosa Awal Penyakit  Kucing Berbasis Ontologi dengan Metode Dampster-Shafer', 'Gunawan Budi Prasetyo, ST., MMT., Ph.D.', 'SISTEM CERDAS', 'sistem pakar ini dapat membantu pemilik/pemelihara kucing mendiagnosa awal penyakit  kucing dengan melihat gejala - gejala yg terjadi pada kucing tersebut. Sistem pakar ini dibuat dikarenakan banyak pemilik kucing yg tidak tahu gejala awal yg terjadi jika kucing tersebut sakit dan mereka baru menyadari kucing mereka sakit saat terjadi perubahan yg signifikan pada kucing tersebut dan juga alasan lain dikarenakan minimnya klinik hewan yang buka operasional secara 24 jam, selain itu sistem pakar ini dibuat agar dapat mengetahui dan memahami jenis penyakit kulit pada kucing yang mereka pelihara.', 'Dempster-Shafer', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1LPuT9AClClY8ceBKBjaoGB6IL1JCcyJn', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1iPw1lc5AwPDmCqny5Aw1gGnTfvCt3EcF', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1VS96t_v4VPqLdl6_nWhB3JdT8Gx02V1g', '', 55),
('Youngky Pratama Atmadinata', '1641720060', 'youngkyatmadinata93@gmail.com', '082142222802', '081335303789', 'Sistem Pendukung Keputusan Prioritas Pembangunan Daerah Dengan Metode AHP dan PROMETHEE (Studi Kasus di Kec.Semanding Kabupaten Tuban)', 'Rawansyah., Drs., M.Pd.', 'INFORMATION SYSTEM', 'Mencari prioritas pembangunan daerah di setiap nama desa/tempat/daerah yang ada di kecamatan semanding kabupaten tuban, nantinya setiap desa/tempat/daerah akan di cari mana yang di dahuluin untuk di bangun fasilitas umum ataupun perbaikan fasilitas, untuk pemerataan pembangunan di setiap daerah', 'AHP dan PROMETHEE', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=176sEYNzGyVgPUkZSC9Ph_MRDKws7PyLK', '', '', '', '', 56),
('Agustin Setyo Rini', '1641720064', 'agustinsetya38@gmail.com', '081232275604', '08125282512', 'Implementasi Metode Case-based Reasoning Untuk Sistem Pakar Diagnosa Penyakit Pada Organ Genitalia Wanita', 'Indra Dharma Wijaya, ST., M.MT.', 'SISTEM CERDAS', 'Membantu memberi informasi bagi wanita yang memiliki masalah atau merasakan gejala kurang nyaman pada area genitalia. Karena tidak jarang wanita malu untuk berkonsultasi secara langsung dengan dokter.', 'Case-based Reasoning', 'K-Nearest Neighbor', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1fmmswInkq0Dun5UgxtsCzQHFe8IgQtqt', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=12eqb0T4CE14d7X6zttIlQgx-y6NIq50l', '', '', 57),
('Trisna Virliana Ramadhanti', '1641720065', 'TrisnaRamadhanti@gmail.com', '081214124925', '085232994859', 'Implementasi Business Intelligence pada Data PDDikti untuk Menganalisa Pengembangan Program Studi', 'Faisal Rahutomo, ST., M.Kom., Dr.Eng.', 'SISTEM CERDAS', 'Memanfaatkan data PDDikti suatu Universitas dalam analisa Pengembangan Program Studi ', 'Metode Support Vector Machine dengan Sequential Minimal Optimization ', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1MMMKZLh3Y5SKqZLAZ119KZaPJ0gR1lLd', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1CSpX8qGvFAyD6frreAOQv-lGNKGaTHVE', '', '', 58),
('Siti Kholifah', '1641720067', 'skholifah215@gmail.com', '+6285331729316', '  +6285331729316', 'Sistem Supply Chain Management untuk Penentuan Produksi dan Promosi Menggunakan Metode Backpropagation dan WASPAS pada PT. Tiga Serangkai Pustaka Mandiri', 'Eka Larasati Amalia, S.ST., MT.', 'INFORMATION SYSTEM', 'meramalkan penentuan penyiapan bahan baku produksi agar barang tidak out of stok dan menentukan promosi', 'Backpropagation Neural Network', 'WASPAS (Weighted Aggregated Sum Product Assesment)', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1hI8SB1iOATuF1XHs4YK-znl7uZdlLFRF', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1gMvC8zRkywYSS_fXeXFLyDmjUWn1Ffj5', '', '', 59),
('Fahmi Hasan Abrori', '1641720069', 'fahmihasan97@gmail.com', '089510831221', '082242023639', 'SISTEM INFORMASI GEOGRAFIS BERBASIS WEB UNTUK PEMETAAN LAHAN DAN PRODUKSI APEL MENGGUNAKAN METODE K-MEANS DI KOTA BATU ', 'Rudy Ariyanto, ST., M.Cs.', 'INFORMATION SYSTEM', 'Sistem Informasi Geografi (SIG) pemetaan lahan dan klasterisasi produksi apel digunakan untuk penyampaian informasi yang tepat dalam memberikan data lokasi pemetaan lahan perkebunan buah apel dan klasterisasi produsksi apel di Kota Batu. Sistem ini dapat memudahkan seorang investor untuk membeli lahan perkebunan atau berkerjasama dengan pemilik kebun apel setelah melihat kondisi jumlah produksi (klaster) setiap kebun dan juga memudahkan Dinas Pertanian dalam mengelola keberadaan persebaran lahan perkebunan apel di Kota Batu', 'K-MEANS', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1WvIB5ttFJjcM4o1w8THG6cyx8UOr0bll', 'Kurang tanda tangan pembimbing, karena pembimbing masih tugas ke luar kota.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Dt9pAIl0RAgyLkCfqcqLLvkf4rqqolwe', '', '', 60),
('Kevin Rahardian Nanlohy', '1641720070', 'kevinrahar@gmail.com', '08125975093', '082232381302', 'SISTEM PERAMALAN KEBUTUHAN PEGAWAI KATERING BERDASARKAN JUMLAH PESANAN MENGGUNAKAN METODE FUZZY TIME SERIES\n( STUDI KASUS KATERING DEWI SRI REJEKI )', 'Kolonel Lek Dr. Arwin Datumaya Wahyudi Sumari', 'INFORMATION SYSTEM', 'Katering merupakan usaha kuliner penyediaan makanan, usaha katering ini biasanya di butuhkan ketika ada acara seperti hajatan, pernikahan, sunatan, reuni dan lain sebagainya. Katering menjadi pilihan banyak orang karena dengan katering, tidak perlu repot-repot lagi memasak untuk para tamu undangan ataupun untuk komsumsi pribadi. Padatnya kesibukan masyarakat Indonesia membuat kurangnya waktu untuk melakukan pemasakan dalam jumlah besar dan disaat waktu yang mendesak, dan ketatnya persaingan dibidang katering yang semakin meluas (Irwana Dewi, 2019) \nSeiring  besarnya dan bertambahnya konsumen pemilik bisnis membuat inovasi baru yang belum pernah ada sebelumnya,sehingga bisnis catering tidak hanya melayani penyediaan makanan untuk acara pesta melainkan juga melayani untuk rumahan,perusahaan juga fokus dalam penyediaan jenis makanannya.(Wulan Ayodya 2008). \nDalam usaha katering beberapa di antaranya memulai dari rumah berkembang terus hingga mengalami peningkatan .peningkatan usaha memerlukan kerja yang meningkat pula, dalam kerja operasional katering pemilik usaha dibantu oleh beberapa tenaga kerja bergantung pada skala kateringnya. Dalam mengelola usaha Katering (Wulan Ayodya 2016)\nTidak ada hitungan baku untuk menentukan jumlah karyawan membuat usaha katering kebingungan untuk menentukan pegawai sesuai kebutuhan pesanan  . Oleh karena itu, peneliti akan membuat sebuah aplikasi yang digunakan untuk meramalkan pegawai berdasarkan jumlah pesanan\nBerdasarkan uraian diatas, Penelitian ini mengambil judul â€œSistem Peramalan Kebutuhan pegawai Katering berdasarkan jumlah pesanan menggunakan metode Fuzzy Time Seriesâ€sehingga dapat memudahkan dalam menentukan pegawai katering sesuai jumlah pesanan.', 'Fuzzy Time Series', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1geS_s-VKfl5xLnf27ghazlG4lGHTuN9G', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1WgocCk7XRsFUVADkeHa1Q8KlYXlw6dXk', '', '', 61),
('Nadhifa Tiara Putri', '1641720071', 'nadhifatiaraputri@gmail.com', '082241268089', '081232619199', 'Analisis Sentimen Opini Masyarakat Terhadap Pembangunan Infrastruktur Kota Malang Melalui Twitter Dengan Menggunakan Metode Support Vector Machine', 'Indra Dharma Wijaya, ST., M.MT.', 'SISTEM CERDAS', 'Melakukan analisa sentimen tentang opini masyarakat terhadap pembangunan infrastruktur yang ada di Kota Malang melalui media sosial twitter yang diharapkan dari hasil sentimen tersebut dapat memberi masukan kepada pemerintah mengenai pembangunan infrastruktur yag ada di Kota Malang, apakah lebih cenderung mengarah ke positif atau negatif.', 'Support Vector Machine', 'TF-IDF', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1vMZpnxsLAAhKKFpNE-LZB9c67I2YBf6S', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1FqcwtoIJBNf2OqXBFv2_o5u4h-ykmMfZ', '', '', 62),
('beby novia putri lovenida', '1641720073', 'bebyrpl@gmail.com', '081999312896', '085736613703', 'implementasi rule based analysis sentiment pada twitter untuk laynan ojek online', 'Dwi Puspitasari, S.Kom., M.Kom.', 'SISTEM CERDAS', 'analysis sentiment pada twitter gojek dan grab untuk di ketahui bersentiment positif negatif atau netral, tujuan nya untuk mengetahui kepuaasan pelanggan dari ojek online tersebut. media yang digunakan berupa sosial media twitter, di karenakan banyak nya\nOpini yang disampaikan pelanggan melalui akun resmi twitter Gojek yakni @gojekindonesia dan Grab yakni @GrabId bisa dijadikan alat ukur kepuasan pelanggan terhadap layanan ojek online di kedua penyedia layanan ojek online tersebut dengan menganalisis twitter mereka.\n', 'rule based', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1HWTucT4Mbd8v01x60TWqGZ-gHA6udduY', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Sq_KwJJgItAHCF-a9ZBTBPMpXWy077XS', '', '', 63),
('Wildan Almubarok', '1641720075', 'wildanal2@gmail.com', '081333495201', '085706012522', 'Implementasi Media Pembelajaran Pengenalan Hewan Nusantara Mengguanakan Virtual Realty dan Leap Motion Controller', 'Dimas Wahyu Wibowo, ST., MT.', 'MULTIMEDIA AND GAME', 'Virtual reality adalah teknologi yang dapat berinteraksi dengan suatu lingkungan yang disimulasikan oleh komputer. Secara teknisnya, virtual reality digunakan untuk menggambarkan lingkungan tiga dimensi yang dihasilkan oleh komputer dan dapat berinteraksi dengan seseorang. Namun saat ini harga untuk VR Headset sendiri masih dijual dengan cukup mahal, dengan harga berkisar 7 Jutaan, Dengan permasalahan yang ada diatas, ada salah satu perangkat yakni Leap Motion Controller, perangkat controller ini dapat mendukung kacamata VR biasa menjadi seperti VR Headset dengan biaya yang lebih terjangkau dengan harga sekitar 2,3 jutaan. \nPenggunaan teknologi Virtual Reality dengan Leap Motion Controller, membuat pengguna dapat melakukan interaksi dengan dunia virtual seolah-olah tangan pengguna merupakan bagian di dalamnya, dan tanpa perlu menggunakan sarung tangan capture melainkan hanya dengan tangan kosong. Untuk mewujudkan bentuk interaksi teknologi ini, penulis memutuskan untuk mengeimplementasikannya kedalam permainan game. ', 'algoritma fisher yates shuffle', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1zHzW7xmXeAHhJxGMzAWgYVY_UnrrzVtZ', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1tskuy0l5zh_AJDzqoRWdAl3t-AVR2i_F', '', '', 64),
('Mokhammad Zainul Fadli', '1641720076', 'mzfadlii@gmail.com', '085954654678', '085749614400', 'Rancang dan Bangun Sistem Absensi  Menggunakan Smart Card  RFID Berbasis Website (Studi Kasus : Kelas JTI Politeknik Negeri Malang) ', 'Yuri Ariyanto, S.Kom., M.Kom.', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Membuat sistem absensi kehadiran mahasiswa menggunakan smart card untuk membantu meningkatkan kedisiplinan mahasiswa.', 'encryption', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1ct7wx27uUI9RDeieErjk8A93mAUSbngp', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1207RQ4zC3xK2v6ay5Rrw-UGkBgmcS1mP', '', '', 65),
('Welsi Eldayosa', '1641720077', 'welsi22579@gmail.com', '087805801788', '081347414513', 'Identifikasi kualitas daun bayam dengan fitur tekstur dan warna dengan metode K-Means', 'Mungki Astiningrum, ST., M.Kom.', 'COMPUTER VISION', 'aplikasi untuk menentukan kualitas sayur bayam dilihat dari kulitas tekstur dan warnanya. sampel diambil dari daun sayur bayam yang di foto, nantinya di olah dengan citra digital sehingga bisa diketahui kualitas sayur bayamnya dengan melihat tekstur dan warna dengan metode YUV(warna) dan K-Means(tekstur).', 'YUV(warna), K-Means(tekstur)', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1EQqBXemVQBettOT_99mbBFAOIRwXwx3r', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Qo9aSk7w2CwZcx4bBTXkyCwnTWlzY3iH', '', '', 66),
('Atika Nur Almira', '1641720078', 'atikanuralmira33@gmail.com', '082331077597', '08125239048', 'PENERAPAN METODE PROFILE MATCHING UNTUK SELEKSI PEMAIN INTI FUTSAL ( STUDI KASUS SMA NEGERI 3 KEDIRI )', 'Rawansyah., Drs., M.Pd.', 'INFORMATION SYSTEM', 'Dalam perkembangan teknologi saat ini tidak bisa dipungkiri bahwa teknologi merupakan salah satu alat pendukung dalam melakukan pekerjaan. Saat ini perkembangan teknologi mulai diterapkan pada berbagai bidang dan salah satu manfaat dari teknologi ini adalah untuk membantu dalam melakukan pengambilan keputusan, pengambilan keputusan merupakan proses pemilihan alternative tindakan yang bertujuan untuk mencapai tujuan tertentu, dengan melakukan pengumpulan data yang diubah menjadi informasi serta ditambah dengan kriteria-kriteria  yang  perlu  dipertimbangkan dalam sebuah pengambilan keputusan. \n\nBerdasarkan permasalahan di SMA Negeri 3 Kediri yang mana pemilihan pemain inti masih dengan cara manual berdasarkan penilaian kriteria-kriteria yang sudah ditentukan oleh pembimbing ektrakulikuler. Sehingga dibutuhkan sebuah metode yang tepat untuk seleksi pemilihan pemain inti futsal. Ada banyak metode yang bisa dipakai dalam mengambil keputusan, salah satu metode yang dapat dipakai yaitu metode Profile Matching. Konsep metode Profile Matching yaitu metode pengambilan keputusan dengan mengasumsikan bahwa terdapat tingkat variable predictor yang ideal yang harus dipenuhi oleh subyek yang diteliti, bukannya tingkat minimal yang harus dipenuhi atau dilewati (Kusrini, 2007).  Metode Profile Matching sangat cocok digunakan dalam upaya manajemen SDM (Sumber Daya Manusia), karena dalam proses metode Profile Matching secara garis besar merupakan proses membandingkan antara kemampuan individu ke dalam kompetensi yang harus dicapai dalam suatu jabatan/posisi. Dari perbandingan tersebut dapat diketahui perbedaan kompetensinya, sehingga akan mendapatkan alternatif yang baik. Dengan demikian, metode ini dapat menyelesaikan masalah yang terjadi pada SMA Negeri 3 Kediri dalam menerima dan menempatkan posisi pemain inti dalam ektrakulikuler futsal', 'profile matching', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1QkVC2ZE9AinuWcFAYEg8ztYmonxvGzCD', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1MVmF81WzbSe2Qe9dmnfxYCzDhiGQVUBB', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=11dU-RspCpAkQ2MHaco4fT3X4FUNY7mNm', '', 67),
('Nita Rahmawati Komalasari', '1641720079', 'nitarahma456@gmail.com', '08557934840', '082173999499', 'Pengembangan Sistem Pakar Diagnosis Penyakit Kelinci Dengan Metode Case Based Reasoning', 'Luqman Affandi, S.Kom., MMSI', 'SISTEM CERDAS', 'Dalam skripsi ini saya mengambil group riset yaitu Sistem Cerdas yang berjudul Pengembangan Sistem Pakar Diagnosis Penyakit Kelinci Dengan Metode Case-Based Reasoning. Dalam sistem pakar ini diharapkan aplikasi dapat membantu peternak kelinci dan pemilik kelinci dalam mmendiagnosis penyakit dan mendapatkan penanganan pertama saat kelinci terserang penyakit. Sistem ini digunakan oleh peternak dan pemilik kelinci. Sedangkan pakar yang diambil yaitu dokter hewan. dalam judul ini sebelumnya skripsi sudah pernah ada, namun disini saya kembangkan lagi  dengan metode yang lain. metode yang saya gunakan ini bekerja dengan cara mengklasifikasikan penyakit dengan banyak pola kemiripan gejala yang sudah ada.', 'Case Based Reasoning', 'K-Nearst Neighbor', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1KS4-eGga4X0mmN52Ds5gRB2FbfKBkLiI', '', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1F-b4hh7yzCQRIfAcZTuNDjxOR0ymPSSI', '', 68),
('Fany Ervansyah', '1641720080', 'fanyervansyah.9c@gmail.com', '082132430802', '081336955544', 'Implementasi GraphQL Untuk Mengatasi Under-fetching pada Pengembangan Sistem Informasi Pelacakan Alumni Politeknik Negeri Malang', 'Putra Prima A., ST., M.Kom.', 'INFORMATION SYSTEM', 'Saya ingin mengimplementasikan GraphQL pada Sistem Informasi Pelacakan Alumni di Politeknik Negeri Malang yang akan saya bangun untuk mengatasi under-fetching yang menjadi masalah pada performa di metode REST API.', 'GraphQL', 'REST API', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=106tCXSY_RNyEV5l-KxLdcRU_tcxamTQM', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1ZVQa-pnISsPo0T_A7ECPUW_93_oWDJTb', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1bXpBCKGccVtKtmBPvNa_ZiwUrbgJSNTW', '', 69),
('Desvin Renata Paksi Ade P', '1641720083', 'desvinpratama@gmail.com', '082233993660', '08123387393', 'Pengenalan Hama Kutu Batang Pada Tanaman Apel (studi kasus dusun gerdu Tulungrejo kecamatan Bumiaji kota batu)', 'Dhebys Suryani, S.Kom., MT', 'SISTEM CERDAS', 'Citra digital adalah citra yang dapat diolah oleh komputer. Yang disimpan dalam memori komputer hanyalah angka-angka yang menunjukkan besar intensitas pada masing-masing piksel. Disini saya mengambil studi kasus yang terdapat di dusun gerdu, desa Tulungrejo kecamatan Bumiaji kota batu, permasalahan sebagian kebun apel terkena hama kutu batang atau kutu sisik, menyerang sebagian batang apel ditandai dengan jamur pada batang dan bintik merah, tujuan sistem yang saya buat adalah untuk mengidentifikasi hama yang menyerang tanaman apel menggunakan foto atau citra berdasarkan warna pada batang apel agar dapat mengetahui khususnya tanaman apel ini terserang hama atau tidak.', 'KNN (K-Nearest Neighbor)', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Iho2dvbsSgPimmUOcpESDNE22pKBBq6a', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1z4dH2XipW8dBU30BrD_3qAtqFoM2gcWZ', '', '', 70),
('Muhammad Hafidz Ilham Priambudi', '1641720085', 'mhafidzilham@gmail.com', '081233440581', '081233009987', 'Metode Deseasonalized dan Double Exponential Smoothing Untuk Menganalisis Peramalan Jumlah Pengunjung Tempat Fitness', 'Eka Larasati Amalia, S.ST., MT.', 'INFORMATION SYSTEM', 'Saya ingin membuat website sistem informasi sebuah Gym di Kota Malang yang berisikan tentang informasi-informasi terkait dengan gym tersebut dan dapat dijadikan untuk sarana promosi agar dapat mencakup pelanggan lebih luas. Website ini juga dapat berguna sebagai pengganti buku dalam kegiatan pencatatan pengunjung setiap harinya agar mempermudah pendataan dan dapat mengurangi penggunaan kertas, karena sekarang di lapangan masih menggunakan buku untuk mencatat pengunjung yang datang setiap hari. \n\nDidalam website tersebut terdapat pula halaman admin yang dapat mengatur keseluruhan website, dan juga untuk menginputkan data-data gym yaitu data member dan data jumlah pengunjung setiap beberapa periode. \n\nData jumlah pengunjung di website ini dapat melakukan perhitungan peramalan untuk meramalkan jumlah pengunjung gym tersebut dalam beberapa periode menggunakan dua macam metode, dari hasil kedua peramalan tersebut nantinya dapat dibandingkan untuk hasil yang lebih akurat. Hasil output data itu dapat dijadikan laporan untuk pemilik gym setiap bulannya dan diharapkan dapat menjadikan patokan pemilik gym tersebut untuk menentukan sebuah keputusan di kemudian hari.', 'Double Exponential Smoothing', 'Deseasonalized', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Q81pCQ0n8OtS4x5FHgnE0eOHYk5bFmHD', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1fMXivA6THTHCD_0U3vFpBVMhFI3t92dR', '', '', 71),
('Reynaldo Krisdiyanto', '1641720087', 'reynaldo.krisdiyanto@gmail.com', '083834974645', '082234943841', 'SISTEM INFORMASI REKOMENDASI PEMILIHAN PERUMAHAN DI KAWASAN KABUPATEN MALANG', 'Erfan Rohadi, ST., M.Eng., Ph.D.', 'INFORMATION SYSTEM', 'User dalam memilih perumahan sebenarnya tidak akan mendapat masalah jika hanya terdapat satu pilihan. Namun karena banyaknya pilihan perumahan yang memiliki kriteria yang sesuai dengan keinginan user, maka akan menimbulkan berbagai pertimbangan. Pertimbangan yang dimaksud disini adalah dari segi kriteria. Terkadang kriteria tersebut saling bertentangan seperti perumahan dengan harga yang mahal tetapi dekat dengan fasilitas publik atau perumahan dengan harga yang murah tetapi jauh dari fasilitas publik dan sekolah. Sehingga dapat diartikan bahwa satu kriteria dapat terpenuhi namun kriteria yang lain tidak dapat terpenuhi dan juga dibutuhkan detail informasi terkait perumahan yang ada. Maka dari itu atas permasalahan yang ada dibutuhkan solusi untuk mendapatkan hasil pilihan yang optimal dengan mempertimbangkan semua faktor yang ada. Solusi tersebut berupa pembuatan aplikasi Sistem Informasi Rekomendasi Pemilihan Perumahan Di Kawasan Kabupaten Malang. Pada aplikasi ini menggunakan metode algoritma ARAS (Additive Ratio Assessment), Karena metode ARAS lebih mudah dalam melakukan perangkingan dengan cara membandingkan alternatif lainnya sehingga mendapatkan hasil yang ideal dan terbaik, mencakup sistem fisik, sistem keputusan dan sistem informasi.', 'Metode ARAS (Additive Ratio Assessment)', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1CrhCErrdhzTRtUebANbM6AsamqLbnZQl', 'Hanya penamaan Judul Skripsi masih belum fix karena menunggu konfirmasi dari pembimbing (masih tugas ke luar kota), tetapi untuk topik skripsi sudah fix.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1_rNVp9XGK8hLr5DFTz1J_R7THQc2wnls', '', '', 72),
('Jihan Octavia Zaini', '1641720088', 'jihanoctavia10@gmail.com', '+6281342776551', '+6281233151511', 'Segmentasi Pelanggan Menggunakan Metode K-Means dan DBSCAN Dengan LRFM Model Untuk Mendukung Strategi Pemasaran (Studi Kasus PT. Bisturi Pratama)', 'Gunawan Budi Prasetyo, ST., MMT., Ph.D.', 'INFORMATION SYSTEM', 'Melakukan segmentasi pelanggan untuk menunjang strategi bisnis pada perusahaan dengan menerapkan model LRFM  (Length, Recency, Frequency, Monetary) untuk menentukan strategi, dan menggunakan metode DBSCAN dan K-Means untuk melakukan pengelompokkan pelanggan berdasarkan data penjualan perusahaan, kemudian hasil dari pengelompokkan yang didapatkan akan digunakan untuk menunjang keputusan strategi bisnis pada perusahaan PT. Bisturi Pratama.', 'K-Means', 'DBSCAN (Density-Based Spatial Clustering of Application with Noise)', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1of-5VDnQnyREC6BxduAc3CeDYvR1YaMb', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1kJMaUU_XpBExF7b-QIRJpV2bYVZPRy5S', '', '', 73),
('Yasmini', '1641720089', 'yasmin98s45@gmail.com', '085730815014', '085730815014', 'Implementasi Jaringan Saraf Tiruan Menggunakan Metode OPELM Untuk Memprediksi Volume Impor Kedelai Nasional', 'Ekojono, ST., M.Kom.', 'INFORMATION SYSTEM', 'Pada penelitian ini untuk memprediksi volume impor kedelai nasional akan dilakukan implementasi jaringan saraf tiruan menggunakan metode OPELM. Data yang digunakan dalam penelitian ini adalah Jumlah impor kedelai, produksi, konsumsi, dan harga domestik yang menjadi data masukkan, dan data impor kedelai menjadi data target. Data yang akan digunakan dalam penelitian ini diperoleh dari Badan Pusat Statistik, dan Kementerian Perdagangan Republik Indonesia.Untuk evaluasi performa metode Optimally Pruned Learning Machine (OPELM) dengan menggunakan MAPE. Hasil prediksi dari penelitian ini adalah volume impor kedelai pada tahun mendatang.', 'Metode OPELM', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1RM72ZdMktvz0St_F9SzxRN04w7OVk62I', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1csXLZxn6dPuo0r0NHy2LxAkhDC8ShwWp', '', '', 74),
('Mohammad Andra Darmawansyah', '1641720090', 'andrejrz97@gmail.com', '081333421300', '0811366620', 'Sistem Monitoring dan Controlling Pakan Ikan Koi Secara Paralel untuk Persediaan Pakan Berbasis IOT', 'Luqman Affandi, S.Kom., MMSI', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Saya ingin membuat alat untuk pakan ikan koi otomatis secara paralel, yang dimaksud dengan paralel yaitu tidak hanya satu alat saja tetapi bercabang, alat tersebut bisa di kontrol dan di monitoring oleh user atau penggunanya, tujuan nya agar bisa mempermudah user untuk mengontrol alat tersebut apa sudah waktunya ikan koi tersebut diberi makan atau belum dan untuk memonitoring yaitu mengetahui dan memantau sisa makanan di wadah alat tersebut, sehinggan user bisa tau apa persediaan pakan ikan koi tersebut masih ada atau sudah habis.', 'IOT', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1PcqIvbeebwKqwz52WM0sJoBpu39uBRhL', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1beCEvC_I5qsRVjxpsfnza96HVkYt0C77', '', '', 75),
('Al Wegi Herman', '1641720091', 'alwegi29@gmail.com', '+6283853208749', '+60169837095', 'Identifikasi Kesegaran Ikan Laut Berdasarkan Citra HSV dan Morfologi', 'Ekojono, ST., M.Kom.', 'COMPUTER VISION', 'Pada sistem yang bakalan saya buat untuk identifikasi kesegaran ikan laut yang baik untuk dikonsumsi khususnya pada ikan Tongkol. untuk identifikasi yang saya lakukan melalui 2 metode yang pertama untuk pengecekan warna dan kedua melalui tekstur ikan, pada pengecekannya saya hanya melalui mata ikan saja tidak untuk seluruh badan ikan.', 'Hue-Saturation-Value (HSV)', 'Morfologi', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1gfuaK-tbfp8ZYKmo6eCvQbg2TnMi_Zf9', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1x0RjCDWT_AlcR9I50z6LVPjSnNhc0Rhy', '', '', 76),
('AHMAD ILLYASA', '1641720093', 'ahmadillyasa2056@gmail.com', '081332117517', '085804517337', 'Sistem Rekomendasi Resep Masakan Berdasarkan Bahan Masakan Menggunakan Metode Case Based Reasoning Dengan Algoritma Adjusted Cosine Similarity', 'Ulla Delfana Rosiani, ST., MT.', 'SISTEM CERDAS', 'Sistem Rekomendasi Resep Masakan Berdasarkan Bahan Masakan Menggunakan Metode Case Based Reasoning Dengan Algoritma Adjusted Cosine Similarity', 'Case Based Reasoning', 'Algoritma Adjusted Cosine Similarity', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1cGUx_Sl_fGfKtvBSKj-A76WVTUFbkmHu', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=11H0Vgls4iHxe23FfjS8NkN3ouU8ziTXQ', '', '', 77),
('M. Alfin Zakariya', '1641720094', 'alfinyuki@gmail.com', '0895396057724', '082332970609', 'Deteksi Kualitas Biji Jagung Manis Layak Jual dari Tekstur dan Warna dengan metode RGB dan K-Means Clustering Menggunakan Pengolahan Citra Digital\n( STUDI KASUS Pada UD. Annur Sejahtera )', 'Mungki Astiningrum, ST., M.Kom.', 'COMPUTER VISION', 'Mendeteksi kualitas biji jagung manis yang layak untuk dijual. Selama ini pengevaluasian terhadap Jagung masih banyak menggunakan cara manual dan mengandalkan Indra Penghilatan dan sebagainya. Indra manusia memiliki kelemahan dan keterbatasan contohnya seperti perbedaan pendapat terhadap warna, kurang teliti, lelah dan tidak fokus pada saat evaluasi sehingga menghasilkan output yang belum tentu konsisten. Dari masalah tersebut terdapat solusi yang dapat membantu manusia untuk pengevaluasian kualitas Biji Jagung Manis yaitu dengan menggunakan Sistem Pengolahan Citra Digital, dimana dirancang memiliki kepekaan terhadap suatu warna dan tekstur. Dalam tugas akhir ini merancang sistem Pengolahan Citra Digital yang dapat membantu untuk mengevaluasi Biji Jagung Manis dari warna dan tekstur. Sehingga dapat menunjang produktifitas dan meningkatkan kualitas daya jual. \n\n', 'Warna HSV dan Metode K-Means ', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1qAnWfZwFtAZyK0CIF5WPZ_nAXnNspg1M', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1wRDyTpP4_W1BLUfpNA5yJLcFDF1ZJoDf', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1ZDnRdgXHd0al_Thj5TcLBpTnRGk5WU8h', '', 78),
('Nabil Fikri Winaji', '1641720096', 'fikri.winaji@gmail.com', '082232019404', '081329552673', 'Rancang Bangun Sistem Monitoring dan Controlling pada Budidaya Jamur Tiram Berbasis IoT (Internet Of Things)', 'Indra Dharma Wijaya, ST., M.MT.', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Sistem ini menggunakan inputan dari sensor DHT22. DHT22 adalah sensor yang dapat mengukur kelembapan dan temperatur disekitarnya. Dari beberapa inputan tersebut memiliki parameter yang akan digunakan sistem untuk mengolah data. Parameter dari kelembapan yaitu kering, lembab, dan basah. Parameter dari temperatur yaitu panas, sejuk, dan dingin. Data dari inputan akan diolah oleh ESP32 yang kemudian di deteksi oleh fuzzy sugeno untuk menentukan output yang berupa penyemprotan, penyalaan lampu, atau penyalaan kipas sehingga kelembapan dan temperatur pada kumbung jamur terjaga. Selain itu sistem ini juga bisa monitoring kelembapan dan temperatur pada kumbung jamur melalui browser sehingga petani tidak perlu mengecek kumbung jamur secara langsung. Diharapkan dengan adanya sistem ini dapat membantu petani jamur tiram dalam melakukan monitoring atau controlling kelembapan dan temperatur pada kumbung jamur tiram.', 'Fuzzy Sugeno', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1RTsg4q7jZi95dYHVJWN-EFOt6dLKp_tW', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1f_44jW8QAXQrVNrXqHvCuG9M6STMkIG2', '', '', 79),
('Trianta Almira Ramadhani', '1641720097', 'almiraramadhani0301@gmail.com', '081330285905', '08123495670', 'Aplikasi Chatbot Pada Sistem Informasi Penyewaan Scaffolding Dengan Menggunakan Metode TF-IDF', 'Dimas Wahyu Wibowo, ST., MT.', 'INFORMATION SYSTEM', 'Chatbot untuk menggantikan peran admin saat customer menanyakan mengenai penyewaan scaffolding dan sistem akan segera menjawab pertanyaan dari customer.', 'TF-IDF', 'NLP, Cosine Similarity, Recall dan Precission', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1j4Vscqau8wj5SEC5_cr-YCAakCwIHAMN', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=19OEP-jDNeNKWBTynJqnB5-EEjWiv5I4f', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1m85iomUzi3PSmlVyGubuUbQ2ZRlNvxLE', '', 80),
('Afirsta Aliyana', '1641720098', 'afirsta15@gmail.com', '082332509728', '082143236758', 'Peramalan Produksi Kopi di PT Margosuko dengan Metode OPELM', 'Ariadi Retno Ririd, S.Kom., M.Kom.', 'INFORMATION SYSTEM', 'Skripsi saya adalah tentang peramalan produksi kopi yaitu untuk meramalkan jumlah produksi kopi di tahun berikutnya dengan metode OPELM', 'Metode OPELM', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1v1il7YfM2E1F-QYohuC0YU1gp8fPdBNN', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=15MjmRjAd0mrAuBD6IXpY0eKA8OpacwqN', '', '', 81),
('Roy Achmad aziz', '1641720099', 'royachmad06@gmail.com', '085808174524', '082139022238', 'Implementasi Deep Learning untuk identifikasi batik tradisional menggunakan metode convolutional neural network (CNN)', 'Ulla Delfana Rosiani, ST., MT.', 'COMPUTER VISION', 'Pada Skripsi ini akan membahas tentang identifikasi jenis batik tradisional, yang nantinya akan dikembangkan menggunakan salah satu metode Deep Learning yaitu CNN, identifikasi ini mempunyai batasan hanya sampai di batik tradisional saja yang tentunya data-data tersebut akan di training terlebih dahulu kemudian akan dilakukan alur test, sistem tersebut akan bekerja pada mobile dengan cara mengambil objek citra dengan kamera kemudian akan mengidentifikasi dan memberikan informasi jenis batik apa yang telah diambil. selain itu terdapat fitur-fitur untuk pembelajaran tentang batik tradisional.', 'Deep Learning metode CNN', 'Metode Deep Learning CNN', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=11Z9mf7do9KYDfiMVC47UIfwrDnbZ1-NZ', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1yx3qUZ80JZkEsUWjhX2k6WXL60UDKVQl', '', '', 82),
('tholib subechan', '1641720100', 'tholibsubechan@gmail.com', '082228168205', '081241061325', 'rekomendasi pembelian handphone menggunakan metode Dinamis Promethee', 'Dwi Puspitasari, S.Kom., M.Kom.', 'INFORMATION SYSTEM', 'membuat rekomendasi handphone jika konsumen kesulitan atau tidak memahami berbagai macam merk handphone dan tipe , saya ingin membantu mereka dalam memilih handphone sesuai yang mereka butuhkan serta spesifikasi handphone tersebut, rekomendasi ini juga akan dibuat secara dinamis, dinamis tersebut kita gunakan di metode promethee dengan merangkingkan kriteria yang dibutuhkan oleh konsumen', 'Promethee', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1G1xr_U-yiO1HkX_Xglp_TEahFR1aYy-E', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1a9YLQllDmU3ahrTsVPUAJSNm5U4dooYm', '', '', 83),
('M. Syaikhul Alim', '1641720101', 'syaikhulalim9@gmail.com', '085777777567', '085736699663', 'Penentuan Prioritas Perbaikan Jalan dengan Metode Fuzzy dan ANP (Studi Kasus Kab. Bojonegoro)', 'Rawansyah., Drs., M.Pd.', 'INFORMATION SYSTEM', 'Sistem Informasi Penentuan Prioritas Perbaikan Jalan, diharapkan dapat membantu Dinas Pekerjaan Umum Kab. Bojonegoro menentukan prioritas perbaikan jalan mana yang terlebih dahulu dilakukan, sehingga mengoptimalkan anggaran.', 'Metode ANP', 'Metode Fuzzy', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1-lvsX6Otf3jMIIj4f3Y1dglbkI23h-0p', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1cYNzqrOZzzjSkmT7XMy411dieUbmsrgq', '', '', 84),
('Dinarpratnya Ningrum', '1641720102', 'Dinarpratnya12@gmail.com', '081233996612', '081334233396', 'Rancang bangun aplikasi SIAKAD Polinema menggunakan metode User Centered Design berbasis android', 'Pramana Yoga Saputra, S.Kom., MMT.', 'INFORMATION SYSTEM', 'Membuat sebuah interface aplikasi SIAKAD Polinema berdasarkan pengalaman  dan kenyaman user dengan menerapkan metode User Centred Design.', 'User Centred Design', 'System Usability Scale', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1_pAwdIvST0fskWUxgV5UKnTjGowE7be2', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1LSXtm3g4PVWJJMKWfbiqUMQNFIeoOWDY', '', '', 85),
('Ryan Fitra Fathony', '1641720104', 'ryan.fitrafathony@gmail.com', '081233625521', '081252303071', 'Penerapan Data Mining untuk Clustering Program Studi dalam Penentuan Tingkatan Kualitas Menggunakan Metode Self Organizing Maps (SOM)', 'Rudy Ariyanto, ST., M.Cs.', 'INFORMATION SYSTEM', 'Penerapan Data Mining untuk Clustering Program Studi dalam Penentuan Tingkatan Kualitas Menggunakan Metode Self Organizing Maps (SOM) dimana dari 24 program studi di Politeknik Negeri Malang akan di Cluster berdasarkan tingkatan kualitasnya, dimana diharapkan hasil Cluster dengan metode Self Organizing Maps (SOM) dapat digunakan untuk menentukan jenis penanganan perbaikan/peningkatan program studi.', 'Self Organizing Maps', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1LEkfJz0KWgB34Pjb0hMfkECGXo5cm7kZ', 'Kurang tanda tangan pembimbing, dikarenakan pembimbing masih ada tugas ke luar kota.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1enzAxQvD9GOYVXpfK-itLtH3gyKEGAN1', '', '', 86),
('Aldhan Biuzar Yahya', '1641720107', 'aldansorry@gmail.com', '081511099788', '081332529820', 'PENERAPAN FEATURE BASED PADA PERINGKASAN BERITA DARI PORTAL BERITA ONLINE', 'Imam Fahrur Rozi, ST., MT.', 'SISTEM CERDAS', 'Menerapkan metode feature based pada peringkasan berita, fiturnya kurang lebih yaitu kesamaan kalimat, kesamaan judul, panjang kalimat, unsur angka, unsur huruf kapital dan lain-lain yang akan diidentifikasi selanjutnya. peringkasan berita diharapkan dapat mempercepat pembaca dalam mendapatkan informasi. metode tambahan terdapat pada kesamaan kalimat yang menggunakan metode cross method latent semantic analysis', 'Feature Based', 'Cross method Latent Semantic Analysis', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1zDsJEIgUlyvI-obZZKvVQmGSkUNnp-8O', 'Mohon maaf ganti judul, namun sudah saya konfirmasi kepada pembimbing', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1mLb3bcba2idfjFOApM32PMZzIsKWX5kM', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1_m-slBYY-uUk4EdojOCNcEgMbwoDKjgX', '', 87),
('Ade Kurniawan Riswanto', '1641720108', 'adekurniawanr04@gmail.com', '083854036250', '081217580183', 'Sistem Pengambilan Keputusan Kelayakan Kredit dengan Metode SAW studi kasus PT.BAF Sidoarjo,Jawa TImur', 'Rawansyah., Drs., M.Pd.', 'INFORMATION SYSTEM', 'PT. Bussan Auto Finance (BAF) merupakan sebuah perusahaan yang bergerak di bidang jasa pembiayaan. Masyarakat dapat mengajukan permohonan berbagai macam jenis pembiayaan lainnya seperti multiproduk, mesin pertanian, mobil dan juga Dana Syariah.Permasalahan yang sering muncul dalam penentuan pemberian pinjaman kredit uang tunai ini adalah sulitnya menentukan anggota calon nasabah yang benar-benar berhak menerima pinjaman kredit uang tunai. Menentukan nasabah yang mengajukan pinjaman kredit uang tunai di PT. BAF yang layak menerima pinjaman berdasarkan kriteria-kriteria yang telah ditentukan sehingga akan mendapatkan hasil yang lebih akurat terhapat pemilihan calon kreditur di PT Bussan Auto Finance.', 'SAW', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1fHkC5JgnAXy9xIpRGTC6c7Olb-xQwAt_', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1qIWW1oLa6pTm5-HsXLyTsdcGcUYbXwIE', '', '', 88),
('Moch Rizki Eko Waluyo', '1641720109', 'mochrizkiekow@gmail.com', '081357982997', '081249797410', 'KLASTERISASI DAMPAK WILAYAH TANAH LONGSOR KABUPATEN & KOTA DI JAWA TIMUR', 'Pramana Yoga Saputra, S.Kom., MMT.', 'SISTEM CERDAS', 'klasterisasi dampak dari bencana tanah longsor,data yang diolah berdasarkan variabel yang disediakan oleh data,bertujuan untuk mengelompokkan daerah yang terkena dampak parah untuk upaya pengurangan dampak lebih lanjut.', 'K-Mean', 'DBI', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1UvoGgMTRnzg1XKW_NRO5qNJzL3RWXmm3', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=136OM6ZaVDTH9kj6tWdvmayU1ML1aS7Dy', '', '', 89),
('Fajar Audi Bagaswara', '1641720110', 'Fjrbgswra1@gmail.com', '0895800012024', '081233944238', 'Sistem Pendukung Keputusan Menggunakan Metode MOORA dan BORDA dalam penerimaan Karyawan Gudang dan Administrasi\n( STUDI KASUS Pada PT. Andalan Bisturi )', 'Dimas Wahyu Wibowo, ST., MT.', 'INFORMATION SYSTEM', 'Pada studi kasus saya di PT. Andalan Bisturi, sistem penerimaan pekerja yang ada pada perusahaan tersebut terutama untuk bagian gudang dan administrasi masihlah sangat tradisional dengan cara admin/HRD mengecek satu persatu nilai dari transkrip dari masing masing pelamar yang dikirim lewat online. Pemeriksaan nilai dari transkirp dan poin poin yang dibutuhkan dalam perekrutan ini dilakukan melewati wawancara langsung dengan pelamar. Sehingga pencarian karyawan pada perusahaan tersebut cenderung lama dikarenakan banyaknya pelamar. Sistem tersebut sangatlah tidak efektif dan efisien dalam penerimaan karyawanya.\nDengan adanya sistem yang saya buat ini, maka admin/HRD dapat dengan mudah melakukan penerimaan karyawan tanpa melakukan pemanggilan semua karyawan atau pengecekan berkas untuk pembandingan masing masing karyawan. Sistem yang saya buat ini untuk penggunaanya, untuk pertama ialah admin melakukan input data untuk masing masing pelamar. Kemudian setelah melakukan input data lalu sistem akan melakukan perangkingan antar pelamar tersebut sehingga dapat diketahui siapa pelamar yang memiliki potensi dan cocok dalam memenuhi poin poin yang dibutuhkan dalam bidang tersebut. Kemudian selanjutnya akan dipanggil beberapa karyawan yang dibutuhkan untuk melaksanakan pemanggilan wawancara interview hingga penerimaan pegawai. Sehingga dengan adanya sistem ini admin/HRD dapat menghemat waktu dan biaya dalam pencarian pelamar dan pelaksanaan wawancara pada perusahaan PT. Andalan Bisturi.', 'MOORA', 'BORDA', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1o7EdJrmQ9ZPBeZ9ZX5-0Zy3YzoHaUUVy', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1cJsk8LlC-MGqDyZXMYSg4acEJInc3_ZJ', '', '', 90),
('Muchammad Iqbal Arief Pradana', '1641720111', 'nyikdewo@gmail.com', '082221614411', '082331507780', 'Rancang dan Bangun Internet of Thing (IoT) Sistem Informasi e-Payment Menggunakan RFID Berbasis Website ( Studi Kasus : Kantin JTI Politeknik Negeri Malang )', 'Ekojono, ST., M.Kom.', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Saat ini dibidang pemasaran masih menggunakan pembayaran uang dalam bentuk fisik dan mengakibatkan susahnya pengembalian uang lebih dan panjangnya antrian, konsumen menginginkan metode pembayaran yang praktis dan cepat untuk mempersingkat waktu dalam transaksi.\n\nHadirnya teknologi RFID ini dapat membuat transaksi lebih praktis dan cepat dalam artian pelanggan tidak lagi membawa uang dalam bentuk fisik untuk melakukan transaksi. Transaksi ini juga lebih efesien dan cepat karena hanya perlu menempelkan smart card ke RFID Reader yang terdapat di kasir. Pengunjung juga dapat melihat saldo yang telah disediakan dimeja kasir. E-payment berbasis RFID ini juga membantu kasir, keuntungan dari kasir adalah untuk mendapatkan pemasukan keuangan yang lebih besar dikarenakan adanya sistem TopUp yang jika pelanggan ingin berbelanja maka diharuskan untuk mengisi saldo yang mau tidak mau pelanggan harus membelanjakan isi saldo tersebut, jika pelanggan tidak membelanjakan saldo maka akan adanya pengendapan saldo yang mengakibatkan keuntungan untuk kasir.\n\nSehingga, dengan adanya rancangan sistem pembayaran Â¬menggunakan smart card berbasis RFID ini nantinya pelanggan dapat melakukan transaksi cukup dengan satu kartu saja. Selain itu, catatan melalui web database nantinya juga dapat memudahkan pihak Kantin dalam pencatatan pemasukan penjualan produk yang ada di kantin secara terperinci.\n', 'Metode Kriptografi', 'Metode enkripsi RSA atau Hash', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Hk9AvmEHBk2sxgLrqKdWWqGPfvu46q1q', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1UxpF8RPYsK1Hmh0X1ukJo_eNEVuD2OFf', '', '', 91),
('RAHMAT IQBAL FANANI ABDILLAH', '1641720113', 'iiqbal1809@gmail.com', '081945523000', '0857757442443.082335134588', 'Text Extraction pada plat nomor kendaraan bermotor berbasis Image Processing', 'Putra Prima A., ST., M.Kom.', 'COMPUTER VISION', 'Pada dasarnya skripsi saya ini tentang pengolahan citra digital untuk Text Extraction pada objek plat kendaraan bermotor yang nantinya mengolah image menjadi Text String untuk keperluan projek dosen yaitu smartcard, Pada skripsi saya ini dengan menggunakan metode Feature Extraction dan SVM(Support Vector Machine) diharapkan mendapatkan hasil yang maksimal untuk pengolahan image to text. Terima Kasih', 'Feature Extraction', 'SVM( Support Vector Machine)', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1jV7kjfbK7oWsm8tw8wIIhjsBulNSMLzU', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1VoYiG3HuLKeU9znik9qEyZIyY4VXtyUW', '', '', 92);
INSERT INTO `v2_pendaftaran_proposal` (`nama_mahasiswa`, `nim`, `email`, `nomor_ponsel`, `nomor_ponsel_orang_tua`, `judul_proposal`, `nama_pembimbing_1`, `nama_grup_riset`, `deskripsi_singkat`, `literatur_utama`, `literatur_penunjang`, `form_kesediaan_membimbing`, `catatan_khusus`, `draft_proposal`, `revisi_draft_proposal_1`, `revisi_draft_proposal_2`, `id`) VALUES
('Ardhanarisvari Panduwinata', '1641720114', 'ardhapanduwinata@gmail.com', '085755177805', '0818384257', 'Penerapan Metode Gamifikasi pada Aplikasi Mosam(Money Sampah) Berbasis Android', 'Putra Prima A., ST., M.Kom.', 'INFORMATION SYSTEM', 'Dalam skripsi ini saya akan membuat sebuah aplikasi mobile mengenai Money Sampah atau uang dari sampah, yang merupakan salah satu ide fintech yang pernah saya ikutkan lomba hacketon. Sebenarnya aplikasi saya ini butuh IoT namun karena pada IoT tidak ada metode spesifik yang dapat saya terapkan, sehingga saya akan berfokus pada pembuatan aplikasi dari Mosam. Dalam aplikasi ini saya akan menerapkan metode Gamifikasi atau sebuah metode yang telah banyak digunakan pada aplikasi mobile untuk menarik pengguna agar ingin kembali menggunakan, ikut terlibat dan aktif dalam kegiatan dalam aplikasi.\n\nBeberapa hal dari metode Gamifikasi yang dapat diterapkan seperti penawaran poin, voucher, leader board, daily login, pemberian penghargaan jika mencapai misi dan lain sebagainya. Diharapkan setelah aplikasi ini dikembangkan, pada kesempatan berikutnya alat IoT untuk menghitung botol plastik dapat terwujud dan dapat menjadi salah satu terobosan dalam pengurangan sampah botol plastik setidaknya untuk ruang lingkup Jurusan Teknologi Informasi terlebih dahulu.', 'Gamifikasi', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=19mkiJgY8ppVoKOAzelPGh2KInlKaVKf9', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1gCDjUUAS3XHUTurE7icAeWA_oT_7-awT', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1CBy_UbvuGP_KwKfBMkv3k2u4Kj1elMJS', '', 93),
('Kharisma Dwiky Primadana', '1641720115', 'kharismadwikyprimadana@gmail.com', '081338330948', '08123209524', 'SISTEM PAKAR PERENCANAAN USAHA PETERNAKAN AYAM PETELUR UNTUK MELIHAT KEBUTUHAN MODAL DAN KEUNTUNGAN DENGAN METODE ROUGH SET (STUDI KASUS CV. MITRA MEGASATWA)', 'Budi Harijanto, ST., M.MKom.', 'INFORMATION SYSTEM', 'Hampir semua orang pasti telah mengenal telur ayam ras. Selain karena rasanya yang lezat dan bergizi tinggi , telur ayam ras juga termasuk salah satu sumber protein hewani dengan harga yang relatif terjangkau oleh berbagai kalangan . Tidak heran, jika permintaan terhadap telur ayam ras cenderung meningkat setiap tahunnya. Melihat fenomena tersebut, beternak ayam ras petelur komersial dapat menjadi peluang bisnis yang menguntungkan (Ir. Roni Fadilah, SE, Ir. Fatkhuroji, 2013).\n\nAgar mendapatkan keuntungan secara berkelanjutan, beternak ayam petelur juga perlu kiat-kiat tersendiri. Peningkatan produksi harus menjadi tujuan peternak sepanjang masa jika ingin usahanya tetap berkembang. Di samping itu, tuntutan terhadap inovasi teknologi tidak hanya untuk meningkatkan produksi , tetapi sekaligus mengantisipasi risiko-risiko usaha yang kemungkinan akan terus berkembang dengan semakin kompleknya kehidupan manusia (Dwi Joko Setyono, Maria Ulfah & Sri Suharti, 2013).\n\nPada perusahaan ternak ayam ras petelur CV. MITRA MEGASATWA menerapkan system agribisnis yang dimulai dari penyediaan sarana produksi, subsistem usaha tani (budidaya), subsistem pemasaran dan subsistem jasa layanan pendukung. Sistem agribisnis tersebut memiliki keterkaitan antara satu subsistem dengan subsistem yang lain, sebab apabila salah satu dari subsistem tersebut terganggu maka akan berpengaruh terhadap kegiatan usaha ternak tersebut. Semakin besar jumlah populasi ayam ras petelur tersebut menjadi tantangan tersendiri bagi usaha ternak CV. MITRA MEGASATWA untuk mempersiapkan sarana produksi secara memadai dan tepat agar tidak mengganggu kegiatan usahanya.\n\nBerdasarkan uraian diatas, penulis berniat untuk melakukan observasi skripsi di CV. MITRA MEGASATWA dengan mengangkat judul â€œSistem Pakar Perencanaan Usaha Peternakan Ayam Petelur Untuk Melihat Kebutuhan Modal Dan Keuntungan Dengan Metode Rough Set (Studi Kasus CV. MITRA MEGASATWA)â€ untuk melakukan perencanaan usaha pada peternakan ayam.\n', 'Rough Set', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=157OhNYZ4H7Yk2vAmj1J7_VvlPJX-gT5u', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1IGU3vXUSISHID9UDG-0tGI7ATtr9RTDf', '', '', 94),
('Muhamad Dirga Seftianto', '1641720119', 'ltrafalgar1@gmail.com', '082334597373', '085272747217', 'Aplikasi Remoting dan Monitoring Smart Room Berbasis Android Menggunakan IoT', 'Ekojono, ST., M.Kom.', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Pemberian akses pada orang yang dikenal ketika berada jauh dari ruangan, serta melakukan remoting dan monitoring ruangan untuk tindak pencegahan pembobolan ruangan secara paksa', 'Kriptografi/enkripsi', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=13CnrzqSbcMLySYfsWCnsnuhgriXa2wgF', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=15OjzRWso33kgXaVBk3zdsZFzXzY2gQuM', '', '', 95),
('Muhammad Pringgoloyo Brian Hananto Yudho', '1641720120', 'Pripur99@gmail.com', '081334658604', '081351983292', 'penentuan pemenang kontes ikan koi berdasarkan penilaian juri dan  juga  penilaian berdasarkan  kriteria dari berbagai pengunjung dengan  menggunakan metode AHP Moora', 'Ulla Delfana Rosiani, ST., MT.', 'INFORMATION SYSTEM', 'judul skripsi saya bertujuan ingin membuat  suatu trobosan baru sengam mengaplikasikan nya kapad kegiatan kontes ikan koi, tetapi yang akan menial adalah para pengunjung yang telah memperhatikan setiap ikan yang akan di lombakan, jadi semla penilaian nanti akan digabungkan ole penilaian ole juri yang telah disediakan Oleh panitia kontes nanti nya ', 'AHP Moora', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=132b5UZ_fFCsgwOUY-Bd2Dm_H4G4j9_Lc', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=12vDdR5wgBjsu0yAIP13OYg6ph-niwO-m', '', '', 96),
('Nur Laily Fauziah', '1641720122', 'nurlailyfauziyahfz@gmail.com', '082230103008', '082139380737', 'ANALISIS PERSEDIAAN GUDANG BUAH APEL DENGAN MENGGUNAKAN METODE TRIPLE EXPONENTIAL SMOOTHING DAN ARIMA ( STUDI KASUS UD. DUA PUTRA)', 'Gunawan Budi Prasetyo, ST., MMT., Ph.D.', 'INFORMATION SYSTEM', 'Sistem peramalan ini di harapkan dapat membantu UD.Dua Putra dalam melakukan pengontrolan buah apel, baik dalam proses pembelian buah apel ke petani maupun pengiriman buah apel ke beberapa pasar. Data sistem peramalan ini diambil berdasarkan data penjualan buah apel ke beberapa pasar. Sistem ini di buat karena pemilik gudang sering kali mengalami kerugian akibat buah apel yang membusuk karena penjualan di pasar yang tidak stabil, sehingga di perlukan suatu sistem peramalan untuk menentukan stok buah apel yang cukup, dengan mengetahui peramalan penjualan di priode yang akan datang pemilik gudang dapat meminimalisir terjadinya kerugian, baik dalam proses pengambilan buah apel dari petani maupun penjualan ke pasar, dan juga mengantisipasi terjadinya kekecewaan pelanggan karena kekurangan stok buah apel di pasar.', 'TRIPLE EXPONENTIAL SMOOTHING', 'ARIMA ( Autoregressive Integrated Moving Average ) ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1E28Rel90snEN5KYWqJ8AaGQDmeQZBpAJ', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Da1OB6m4obhKSvo4EU-dPFxPSwAJ6kzK', '', '', 97),
('Hidayati Mazmi', '1641720123', 'hidayatimazmi@gmail.com', '085236104175', '085245064483', 'IMPLEMENTASI ENKRIPSI DAN DEKRIPSI DENGAN MEMODIFIKASI ALGORITMA CAESAR CIPHER DAN RAIL FENCE UNTUK TEKS ALFANUMERIK PADA DATA SMART CARD PARKIR', 'Dwi Puspitasari, S.Kom., M.Kom.', 'SISTEM CERDAS', 'Pada penelitian Smart Card Parking Politeknik Negeri Malang akan diimplementasikan enkripsi dan dekripsi data pada kartu tersebut menggunakan Caesar Cipher. Dimana enkripsi dilakukan saat memasukkan data ke kartu dari plain text diubah terlebih dahulu menjadi cipher text, dan dekripsi dilakukan saat membaca data pada kartu dari cipher text diubah terlebih dahulu menjadi plain text. Sehingga data pada kartu menjadi aman dikarenakan data hanya bisa diganti dan dibaca menggunakan sistem yang telah diimplementasikan enkripsi dan dekripsi tersebut.', 'Caesar Cipher', 'Rail Fence', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1_SOg2IfOfjc-lYPqwneTBAAUf5KkEF_B', '', '', '', '', 98),
('salsa nalia fathin', '1641720125', 'salsanalia.fathin@gmail.com', '082335027679', '08127025004', 'IMPLEMENTASI METODE WASPAS PADA SISTEM PENDUKUNG KEPUTUSAN SELEKSI PENERIMAAN CALON KARYAWAN (STUDI KASUS: PT EPSON BATAM) BERBASIS ONTOLOGI', 'Gunawan Budi Prasetyo, ST., MMT., Ph.D.', 'INFORMATION SYSTEM', 'memberikan kemudahan pada perusahaan dalam melakukan penerimaan karyawan, kami mengusulkan untuk membangun sebuah sistem informasi penerimaan karyawan. dengan dibangunnya sistem ini, pihak perusahaan dapat bekerja lebih maksimal dan akurat dalam menyeleksi calon karyawan yang akan masuk ke tahap selanjutnya dan diterima sebagai karyawan', 'METODE WEIGHTED AGGREGATED SUM PRODUCT ASSESMEN', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1hBczhlN_AZ_4a7wB_jUzg03JyV2JrJWQ', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1mtK5sQ3p2wDfD9B4z8jAbaBhZGH8oIJj', '', '', 99),
