('Hanifa Pramana', '1641720142', 'hanifapramana17@gmail.com', '081230176467', '081233094910', 'Implementasi Intrusion Detection System Pada Cloud Computing Dalam Mendeteksi Serangan Menggunakan Metode Clustering', 'Yuri Ariyanto, S.Kom., M.Kom.', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'sistem ini diharapkan dapat menerapkan sebuah keamanan jarigan berupa Intruison Detection System (IDS) yang dapat mengidentifikasi traffic aman atau tidaknya sebuah jaringan cloud computing, di sistem ini akan menggunakan aplikasi snort yang berfungsi untuk menganalisa packet berdasarkan rule yang ada untuk mengenali adanya upaya serangan,untuk penyeleksian notifikasi serangan pada jaringan komputer berbasis IDS snort menggunakan metode clustering yang mendeteksi serangan jaringan berdasarkan data log pada snort dengan cara mengelompokkan data log tersebut menjadi 2 jenis serangan, bahaya dan tidak bahaya.', 'metode clustering ', 'K-means', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1irLIcPw7sybedgXLoygEvmM12VeHDV32', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1pJXllG78q1bSSpSerIINBtKEpXlS76fW', '', '', 112),
