('Bimo Syahputro', '1641720148', 'bimosyahputro88@gmail.com', '081233045596', '085234438940 ', 'PREDIKSI KEPADATAN LALU LINTAS MENGGUNAKAN YOLO OBJECT DETECTION DAN DI IMPLEMENTASIKAN PADA RASPBERY PI 3B+ DAN INTEL NCS 2', 'Rosa Andrie Asmara, ST., MT., Dr. Eng.', 'COMPUTER VISION', 'penelitian yang saya lakukan adalah untuk memprediksi kepadatan lalu lintas menggunakan camera yang dihubungkan pada raspberry pi, lalu rapsberry pi akan mendeteksi object object yang tertangkap pada camera lalu menghitung jumlah object tersebut, mobil maupun motor. jumlah kendaraan yang dihitung akan dikirim ke server secara berkala. hasil yang diterima akan dihitung dengan menggunakan metode double exponential smoothing.', 'Doube Exponential Smoothing', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1kfng-YvsCJGvkGAln53BkQMJK79fMEeK', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1kVF7hfdmYdvCpsP4Kj3Gs_inqe5-XcUf', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1bPFihaGB8_aAW8KdEqgYAy1u-XpdWIcE', 116),
('Hanif Luhur Wicaksono', '1641720149', 'hanifluhur15@gmail.com', '081250452532', '081346606042', 'Identifikasi Kualitas Mutu Cabai Yang Layak Dipasarkan Berdasarkan Warna Dan Tekstur', 'Dhebys Suryani, S.Kom., MT', 'SISTEM CERDAS', 'Citra digital adalah citra yang dapat diolah oleh komputer. \nYang disimpan dalam memori komputer hanyalah angka-angka yang menunjukkan besar intensitas pada masing-masing piksel. \nDisini saya mengambil studi kasus berupa identifikasi kualitas mutu Cabai berdasarkan warna dan tekstur. Masih banyak ditemui kualitas mutu Cabai yang ada di perkebunan, distributor, maupun pasar yang tidak dipasarkan, tetapi tetap dijual demi meraup keuntungan, yang berakibat kerugian pada konsumen. Dengan adanya sistem ini memudahkan konsumen dan distributor Cabai yang mengatahui mana kualitas mutu Cabai yang siap dipasarkan atau tidak. Cara membedakan mutu umbi porang berdasarkan warna dan tekstur. Untuk Cabai yang memiliki kualitas baik memiliki kriteria seperti berikut yaitu mempunyai warna merah segar belum berubah warna, bentuk berukuran besar berbentuk lurus serta tidak melengkung, ketika dipegang terasa empuk, mempunyai aroma khas pedas, memiliki batang cabai yang keras dan kokoh dan warna dari batang cabai kualitas baik cenderung kehijauan. Dengan adanya sistem pengolahan citra digital ini meminimalisir kecurangan petani Cabai dalam menjual cabai mereka ke distributor cabai.', 'KNN ( K-Nearest Neighbor )', 'Metode HSV (ekstraksi warna)', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=13i-syJQlgPHuSw_SHivBrjoyeJWVt0KF', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1NcXynRzC61y8pswpclecpCHf7UNKjSXr', '', '', 117),
('Andy putra wijaya', '1641720150', 'andyputrawijaya376@gmail.com', '089630086072', '+6282276710971', 'Implementasi metode least square dalam peramalan penjualan pada PT Semen Indonesia', 'Deddy Kusbianto PA, Ir., M.Mkom.', 'INFORMATION SYSTEM', 'Untuk meramalkan penjualan PT semen indonesia agar mengetahui perencanaan penjualan yang akan datang dan mengetahui targer kedepannya menggunakan metode least square', 'Least square', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=15fC4B-Ud6eJypUb6PUCeQSFOZ-js4wxE', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1QFNyvoyDSKMctei5hTrjFh1GcfIZPfpq', '', '', 118),
('Muhammad Qolbil Atiq', '1641720151', 'qolbilatiq1@gmail.com', '083854917920', '085232633477', 'IDENTIFIKASI KARAKTER PLAT NOMOR KENDARAAN DENGAN LEARNING VECTOR QUANTIZATION', 'Kolonel Lek Dr. Arwin Datumaya Wahyudi Sumari', 'COMPUTER VISION', 'Membuat pengolahan citra untuk mendeteksi angka dan huruf pada plat nomor', 'Learning vector Quantization', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=18ta7dcJsre787nZBm2yrvMvkmBJeCQog', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1KulfselCs5IMdk2shnxS1Ro7iQHpdOFn', '', '', 119),
('Septa Hoga Samara', '1641720152', 'hogahoga17@gmail.com', '082251238946', '08125060298', 'Sistem Pakar Diagnosa Penyakit Kelamin Menular pada Laki-laki dengan Metode Demster Shafer.', 'Erfan Rohadi, ST., M.Eng., Ph.D.', 'SISTEM CERDAS', 'Membantu pengguna awam sebagai alat pendeteksi penyakit pada kelamin laki-laki yang terindikasi menular dan memberikan saran pengobatan yang mungkin dapat dilakukan, tetapi aplikasi ini bukan sebagai kemutlakan pengganti dokter spesialis kulit dan kelamin, karena sangat dianjurkan tetap meminta saran langsung pada pakarnya.', 'Dempster Shafer', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1OvtDMHClSOB4sQJztYsoRzz9e1ZeQr2Q', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1yCcpqj3H_A8-ntnc2IYr1IEmur09Ivfe', '', '', 120),
('Bagus Pogar Herlambang', '1641720153', 'bagus.pogar@gmail.com', '082264412488', '085257757275', 'PENERAPAN KONSEP Collaborative, Planning, Forecasting and Replenishment ( CPFR ) MENGGUNAKAN METODE Autoregressive Integrated Moving Average ( ARIMA )\n(STUDI KASUS PABRIK KOPI SENJA MATARAM MALANG)', 'Dwi Puspitasari, S.Kom., M.Kom.', 'INFORMATION SYSTEM', 'Berdasarkan hasil observasi dan wawancara dengan pihak Pabrik Kopi Senja Mataram Malang , Dalam memproduksi kopi Pabrik Kopi Senja Mataram Malang sering mendapat kendala menentukan persediaan kopi untuk memenuhi kebutuhan distribusi. Pabrik Kopi Senja Mataram Malang sulit dalam menentukan persediaan produk kopi untuk memenuhi kebutuhan distribusi karena permintaan pelanggan yang tidak pasti. Akibatnya sering terjadi Over Stock ataupun Under Stock sehingga mengakibatkan harga kopi menjadi tidak stabil. \nBerdasarkan permasalahan di atas untuk mengatasi permasalahan tersebut di butuhkan sebuah sistem peramalan yang tepat. Tujuannya adalah untuk menjaga agar harga kopi tetap stabil. Untuk meningkatkan nilai tambah pada rantai pasok terutama untuk optimasi dalam menekan inventory, harga logistik dan efisiensi pada seluruh rantai pasokan yang berhubungan dengan semua peserta maka dipergunakan konsep Collaborative, Planning, Forecasting and Replenishment (CPFR). Konsep CPFR digunakan untuk mengurangi perbedaan antara ramalan yang dibuat oleh beberapa pelaku supply chain yang kemudian secara bersama menentukan kebijakan replenishment. Penelitian ini menggunakan konsep CPFR untuk pemenuhan konsumsi produk kopi pada Pabrik Kopi Senja Mataram Malang.\nBerdasarkan pada data konsumsi yang di miliki oleh pihak Pabrik Kopi Senja Mataram jenis peramalan yang digunakan yaitu time series dengan metode Autoregressive Integreted Moving Average (ARIMA). ARIMA sering juga disebut metode runtun waktu Box-Jenkins. ARIMA sangat baik ketepatannya untuk peramalan jangka pendek dimana metode ini sangat tepat di gunakan mengingat data yang akan di ramalkan yaitu data konsumsi kopi yang di rekap setiap 1 bulan sekali untuk menentukan inventory di bulan berikutnya, sedangkan untuk peramalan jangka panjang ketepatan peramalannya kurang baik.\n', 'Autoregressive Integrated Moving Average', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Xl2BptCUNkH4Oh1RbKzBDjmRiOTqUdsI', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1YLg_tYISBikVGnil-w_nhybps6d2jsO1', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1gaMVZCi1FdoRDwV9jyXMcaH6uWixg494', '', 121),
('Fransdhinta Dewana Prianggoro', '1641720154', 'dhintaF@gmail.com', '+6285933132727', '+6282232304990', 'IMPLEMENTASI METODE RAPID CENTROID ESTIMATION DAN K-MEANS UNTUK KLASTERISASI SEKOLAH BERDASARKAN FASILITAS\n( STUDI KASUS KAB. MALANG)', 'Deddy Kusbianto PA, Ir., M.Mkom.', 'SISTEM CERDAS', 'Klasterisasi Sekolah berdasarkan fasilitas, fasilitas yang dimaksud adalah guru, ruang kelas, lab. dan perpustakaan. Sekolah mana saja yang secara kualitas sudah bagus baik sekolah negeri atau swasta, dengan begitu dapat dievaluasi sekolah mana saja yang kurang baik dalam hal fasilitas, nantinya bisa dilakukan pemerataan.', 'K-Means', 'Rapid Centroid Estimation', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1SCOBXM_rRwkov2uSh0igq2C8I-9Q-JB1', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1FU3GgW0se-iaChmYWf3VQarFohcm3iq7', '', '', 122),
('Muhammad Aslam Ibrahim Ramdani', '1641720155', 'aslamdhoni0261@gmail.com', '081332918558', '081248641174', 'Media edukasi pembelahan sel hewan dan tumbuhan pada SMA berbasis virtual reality dan Leap motion', 'Hendra Pradibta, SE., M.Sc.', 'MULTIMEDIA AND GAME', 'Aplikasi ini bertujuan untuk meningkatkan pemahaman dan hasil belajar siswa SMA kelas 11 pada mata pelajaran biologi materi bab sel hewan dan tumbuhan dengan cara yang interaktif. \n\nUntuk menciptakan aplikasi yang interaktif ini, penulis menggunakan teknologi gabungan yaitu virtual reality  dan juga Leap motion untuk membuat dengan tujuan dapat memvisualisasikan lebih baik menggunakan model 3d.', 'Fuzzy Tsukamoto', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1aCavua2xtsSu0bdyUSWKPAB7WL8yiVch', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1-50Wwagu7SAyWeZDwSMqigTJHJXsS1xV', '', '', 123),
('Alief Himawan', '1641720158', 'tomkins726@gmail.com', '082141795129', '0813317681111', 'SISTEM INFORMASI PERAMALAN KETERSEDIAAN STOK SUKU CADANG SEPEDA MOTOR DENGAN METODE TREND MOMENT di YAMAHA SIP PAHLAWAN', 'Deddy Kusbianto PA, Ir., M.Mkom.', 'INFORMATION SYSTEM', 'Yamaha SIP Pahlawan merupakan sebuah Unit dagang yang bergerak di bidang penjualan sepeda motor suku cadang dan melayani jasa service motor. Dimana Unit dagang ini setiap harinya harus memenuhi kebutuhan konsumen, sehingga penjualan dan pembelian merupakan hal yang utama dalam perusahaan tersebut. Seiring dengan perkembangan teknologi informasi, Yamaha SIP Pahlawan perlu memanfaatkan teknologi informasi untuk meningkatkan kinerja dan produktivitas agar dapat bertahan dan bersaing dalam usahanya.\nYamaha SIP Pahlawan dalam menangani penjualan suku cadang dan pembelian masih menggunakan sistem konvensional yaitu pencatatan setiap transaksi dengan menggunakan buku besar, sehingga pembuatan laporan membutuhkan waktu yang tidak sedikit. Hal ini diakibatkan karena setiap saat terjadi perubahan pada stok yang dikarenakan oleh pembelian dan penjualan barang. Dari permasalahan tersebut dirancang dan dibangun sistem informasi penjualan barang yang berisikan data-data pembelian barang, stok barang, data-data penjualan barang serta laporan-laporan penjualan barang yang terjadi setiap harinya. Dari sistem ini diharapakan data membantu dalam menyelesaikan masalah laporan data penjualan barang dengan cepat dan kapan saja jika dibutuhkan dan hasil dari proses pengolahan data ini pun lebih akurat dibanding jika dilakukan proses pengolahan data dengan sistem konvensional.\nPada Yamaha SIP Pahlawan proses penjualan, pembelian suku cadang sepeda motor dan pembuatan laporan masih menggunakan metode konvensional sehingga pembuatan laporan membutuhkan waktu yang tidak sedikit. \nTujuannya membantu pihak manajemen dalam memprediksi penjualan suku cadang pada periode berikutnya.', 'Trend Moment', 'Time Series', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1-m7y8fmNctD3nMzjkQrkYHFsyad2kKC_', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1-nqPYvcdDs4kJcVqx3Tpv40lMypYfnIE', '', '', 124),
('Eka Putri Leksono', '1641720159', 'ekaapue@gmail.com', '081235682802', '081357993334', 'Sistem pakar diagnosa hama dan penyakit tanaman kopi robusta menggunakan metode case-based reasoning', 'Ariadi Retno Ririd, S.Kom., M.Kom.', 'SISTEM CERDAS', 'Terkait permasalahan produktivitas kopi Robusta yang ada di Ngantang, terhadap gejala yang timbul pada tanaman kopi di lahan. Dan, minimnya ahli pakar kopi di daerah Ngantang. Dibutuhkan suatu sarana yang dapat diakses oleh para petani dan petugas di lapangan, sehingga dengan segera dapat diambil tindakan sesuai target penanggulangannya. Dengan mengunakan sistem yang berkembang pada saat ini yaitu sistem pakar. Mampu membantu untuk mendiagnosa hama dan penyakit tanaman kopi robusta, dan menggunakan metode case-based reasoning.', 'Case-based Reasoning', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1f1oQUr0FUzruySf5rd7rrsOGaAXKfKNn', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1YNAsA9aZpzX4IEm_tmrgz9axDJtiLoNf', '', '', 125),
('Hanif Lukmantya', '1641720161', 'tyatapan@gmail.com', '082234809187', '081233505091', 'Analisa Performa Penerapan Algoritma Spesifikasi Server Raspberry Untuk Aksesbilitas Ujian Online (Studi Kasus SMK Negeri 4 Malang)', 'Luqman Affandi, S.Kom., MMSI', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Skripsi ini menganalisa perbedaan penggunaan web server mini (server yang menggunakan desktop) dan web server yang menggunakan Raspberry pi 3 yang diberi load balancing menggunakan HaProxy', 'Round Robin', 'Least Connection, Static RR', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1uq3Z4ndy2s853ekrKMQUJ3_OUqCjHkRl', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1YxBIon9VrcY3BAlQrfe56HjYrLVShqxW', '', '', 126),
('Mochammad Iqbal Maulana', '1641720162', 'iqbaljrz58@gmail.com', '081230104864', '087759789705', 'pengembangan sistem peramalan produksi kopi menggunakan exponential smoothing', 'Budi Harijanto, ST., M.MKom.', 'INFORMATION SYSTEM', 'Kopi telah menjadi suatu pilihan menarik dalam hal minuman yang \nbisa dinikmati di hampir segala kalangan, situasi kondisi, tempat, dan berbagai \nevent-event yang ada. Di Indonesia, ada banyak sekali jenis kopi yang \nberanekaragam dengan berbagai varian citarasa pahit yang khas mewakili daerah \nasal kopi tersebut. Di kawasan Politeknik Negeri Malang, banyak dijumpai \nkedai kopi yang menyajikan berbagai macam kopi beserta aneka kudapan.  \nTeknologi Informasi (TI) berkembang sangat cepat. Dampak dari \nperkembangan TI tersebut memberi kemudahan bagi masyarakat \nuntuk memenuhi segala kebutuhannya. Tuntutan masyarakat yang menginginkan \nkemudahan dalam setiap aktivitas dan kebutuhannya, merupakan tantangan bagi \npara pelaku bisnis untuk memberikan pelayanan secara maksimal bagi para \nkonsumennya dengan cara menyediakan berbagai fasilitas yang memadai guna \nmemenuhi kebutuhan mereka. Banyak fasilitas dari dunia digital yang dapat \ndimanfaatkan dalam berbagai bidang usaha.\n', 'exponential smoothing', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1fCKwlQJI0EJJAGukmRHpGYtNt8FAug03', '', '', '', '', 127),
('ACHMAD MAHFUD', '1641720163', 'achmadmahfud13@gmail.com', '081234571146', '081252411654', 'sistem peramalan modal kegiatan pembelian tebu pada UD juara agro perkasa di kecamatan bantur. \n', 'Budi Harijanto, ST., M.MKom.', 'INFORMATION SYSTEM', 'jadi skripsi saya ingin meramalkan sebuah modal untuk kegiatan pembelian tebu selama satu musim tebang. termasuk ongkos biaya dan lain supaya diketahui agar modal di bulan berikutnya. ', 'autoregressive integrated moving average (ARIMA)', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1obSnnRqgsuahrMqGhcgQrMOFoon4tOiJ', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=13uQFGoRzFNqt_D8ltl5YHT0dB19tL8KA', '', '', 128),
('Akbar Formadika', '1641720165', 'akbarformadika37@gmail.com', '082244971700', '081335492052', 'Penentuan Jumlah Peserta Minimal Kapitasi FKTP Pada Dokter Praktek Menggunakan Metode Naive Bayes Classifier (Studi Kasus Dokter Praktek Di Kab.Madiun)', 'Rudy Ariyanto, ST., M.Cs.', 'SISTEM CERDAS', 'Sistem ini adalah tentang penentuan jumlah peserta minimum di dokter praktek yang layak untuk diberlakukan sistem pembayaran secara kapitasi di wilayah kab.madiun. Berdasarkan penentuan yang didapat maka dokter praktek dapat mengetahui, apabila peserta yang terdaftar pada dokter praktek masih kurang dari minimal dapat dipastikan terjadi ketidakseimbangan antara besaran kapitasi yang diterima dokter praktek dengan biaya yang dikeluarkan tidak sesuai. Kemudian untuk mengetahui berapa jumlah peserta minimum yang harus ada pada dokter praktek dilakukan pengelompokan data dari dokter praktek yang bekerja sama dengan bpjs di kab.madiun bertujuan untuk mengetahui akurasi ketercapaian dokter praktek mana saja dari perhitungan metode naive bayes  dengan data jumlah peserta yang tertanggung, jumlah kunjungan, biaya obat, biaya laboratorium, dan biaya tenaga. Dan hasil yang diperoleh adalah analisis ketercapaian yang menjadi acuan untuk penentuan nilai minimum kapitasi.', 'Naive Bayes Classifier', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1VHf4Y9iKFZRXHvKKZo20qxfKmk_JnT1D', 'Kurang tanda tangan pembimbing, karena pembimbing masih tugas ke luar kota', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=12vLSZGguJBd_9vAeo2vL4CQkubu8S8UE', '', '', 129),
('Muh. Marsudiarto', '1641720166', 'marsudiarto313@gmail.com', '085655544578', '085855046338', 'Rancang Bangun Automasi Kincir Air pada Tambak Udang Vannamei dengan Metode Fuzzy', 'Yuri Ariyanto, S.Kom., M.Kom.', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Kualitas air merupakan hal yang sangat penting pada budidaya udang vannamei dikarenakan ekosistem air menjadi salah satu penyebab keberhasilan panen menjadi lebih optimal dan meminimalisir kerugian ataupun kematian dari benih vannamei, oleh sebab itu saya ingin membuat sistem monitoring kualitas air tambak(pH, suhu) yang secara realtime bisa diakses dari smartphone. Nantinya yang diharapkan dari input nilai pH dan suhu air akan menyalakan kincir air otomatis sesuai kebutuhan dan kondisi pada tambak udang vannamei yang bisa memberikan output menurunkan suhu dan kadar nilai dari pH.', 'Fuzzy Logic Control', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1kBscLYDwcUdJ7gNe_pWqsIXoft0PXQd0', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1-1sUeADix1FUvx8CcPMJCP-e4QRIM20X', '', '', 130),
('Hilda Lauda Satria', '1641720167', 'satriahilda3@gmail.com', '087703273696', '0811696934', 'tingkat kemasaman buah apel dari warna kulit dan tekstur', 'Cahya Rahmad, ST., M.Kom., Dr. Eng.', 'COMPUTER VISION', 'saya menggunakan judul skripsi ini untuk membantu para petani apel yang ingin memetik buah apel,karena pada dasarnya apel berwarna kulit sama tapi ada yang asam banget dan ada yang kurang asam(manis)', 'KNN', 'HSV', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1mTNije3Y_hO_z9d9IR55ZmGJFlRaZB2A', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1JWSa6fNMT166zOKkCnXiDBbjuToivWl1', '', '', 131),
('Anisa Dyah Fatmawati Almahfudi', '1641720168', 'anisadyah353@gmail.com', '081259947163', '085233221623', 'Proyeksi Instabilitas Harga Telur Puyuh untuk Memutuskan Penambahan DOQ Baru dengan Metode Fuzzy Time Series Markov Chain ', 'Deddy Kusbianto PA, Ir., M.Mkom.', 'INFORMATION SYSTEM', 'Sistem ini akan berisi tentang catatan produksi setiap peternak dari anggota NS Quail Farm dan data transaksi pengambilan telur dari peternak ke pengepul. Berdasarkan data transaksi dapat diramalkan harga telur untuk 2 bulan kedepan, sehingga dapat diketahui bahwa harga akan stabil atau menurun. jika harga satbil dan cenderung meningkat maka dapat memberikan pertimbangan peternak untuk menambah DOQ (Day Old Quail) karena dapat dipastikan jika harga satbil dan meningkat maka dalam 2 bulan kedepan saat puyuh mulai panen maka peternak akan mendapatkan keuntungan. sedangkan jika harga menurun maka peternak harus berhati-hati dalam menambah DOQ baru karena terdapat kemungkinan akan mengalami kerugian dikarenakan harga turun saat puyuh panen.', 'Fuzzy Time Series Markov Chain', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1xqMTtueQOGhrSlgtYUw_Ck-M73ROEDzj', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1mlsfN6QboCEX-WYP7XLfeJ8-OUB97M5d', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1b5nk0KdTpJ-jhFEiaR7pk5rQeI0VEIll', '', 132),
('Kukuh Hariyanto Dwi Setya Hadi', '1641720169', 'kukuhhariyanto26@gmail.com', '082213369768', '08115413330', 'Sistem Pendukung Keputusan Pemilihan Lokasi Objek Wisata Di Kabupaten Paser Menggunakan Metode Profile Matching', 'Dimas Wahyu Wibowo, ST., MT.', 'INFORMATION SYSTEM', 'Judul Skripsi yang saya ambil yaitu tentang pemilihan lokasi objek wisata di kabupaten paser yang nantinya akan di pilih yang terbaik salah satu dari beberapa wisata di kabupaten paser dan juga saya ingin mengenalkan wisatawan yang ingin berlibur ke kalimantan timur tepatnya di kabupaten paser , Kabupaten Paser merupakan kabupaten yang letaknya strategis karena dekat dengan ibu kota baru yaitu Penjama Paser Utara , Selain memiliki letak yang strategis, juga memiliki aneka ragam objek wisata. Di samping wisata danau yang indah, Kabupaten Paser juga memiliki wisata alam berupa Air Terjun dan gunung. Dalam memilih tempat wisata tidaklah mudah. Terdapat faktor-faktor yang perlu di pertimbangkan untuk melakukan pemilihan lokasi wisata yang dikunjungi. Faktor-faktor tersebut antara lain biaya yang dikeluarkan untuk wisata, jarak suatu tempat wisata, cuaca saat itu, sarana dan fasilitas di tempat wisata dan tingkat keramaian di tempat wisata.', 'Profile Matching', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1EmULvh7gVE8mtSjcu7WeO-FHMRJ3tNhn', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1SeiR7K3v_bCd-PLYsInJHWlp4VQFV2OW', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1PSrPG4Tkh5YGYgUEMiVAmgQQMFqOYdb4', '', 133),
('Sheyba Adinda Azigita', '1641720170', 'sheybaadinda@gmail.com', '081390657024', '081335699402', 'Sistem Pakar Identifikasi Pola Asuh Orang Tua Menggunakan Metode Naive Bayes dengan Laplace Smoothing', 'Luqman Affandi, S.Kom., MMSI', 'INFORMATION SYSTEM', 'Aplikasi Sistem pakar berbasis android yang akan membantu para orang tua mengidentifikasi pola asuh mereka terhadap anak-anaknya. Alasan saya membuat skripsi ini karena kebanyak orang tua masih belum mengerti pola asuh yang benar dan baik untuk anak-anak mereka . Pola asuh yang salah dapat mengakibatkan kontroversi antara anak dan orang tua . Pola asuh orang tua yang benar harus ditanamkan sejak dini agar masa depan anak lebih berkualitas', 'Naive Bayes', 'Laplace Smoothing', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1wYSbUIJm6gVANeAqhkSgBLB5Tj6Y2wth', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Gfvt-_2Ov_iELmhabINv4rSm24lWMYkR', '', '', 134),
('Abror Rahmatullah', '1641720171', 'rahmatullahabror@gmail.com', '082234341474', '081335201958', 'Implementasi Metode Triple Exponential Smoothing Untuk Peramalan Jumlah Penumpang Kereta Api di Daerah Operasi 7 Madiun', 'Eka Larasati Amalia, S.ST., MT.', 'INFORMATION SYSTEM', 'Sistem informasi yang digunakan untuk meramalkan jumlah penumpang kereta api di Daerah Operasi 7 Madiun dimasa mendatang dengan menggunakan data dari masa lalu', 'Triple Exponential Smoothing', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1snZvqZ0MWe79B-lf6kCoZYgT6_dU-FNH', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1F7pEQLoyLPHMJVwr6JlNUb7VZFIKStA9', '', '', 135),
('Jelita Sekar Melati', '1641720174', 'jelitasekarmelati@gmail.com', '089522131510', '081335434967', 'Sistem Pendukung Keputusan Penerima Kredit UKM Menggunakan Metode Weighted Aggregated Sum Product Assessment (Studi Kasus Bank BPR Jatim Cabang Magetan)', 'Luqman Affandi, S.Kom., MMSI', 'INFORMATION SYSTEM', 'skripsi ini saya buat untuk memudahkan pimpinan bank dalam menentukan penerima kredit berdasarkan kriteria tetap yang ditentukan dari bank yaitu 5C, setelah mendapatkan alternatif dengan nilai akhir tertinggi selanjutnya ukm akan di survey dan diwawancarai. ', 'Metode Weighted Aggregated Sum Product Assessment', 'Weighted Aggregated Sum Product Assessment', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1yoW71YoYET9LOrPoEdcvoJUFmtWr_YD0', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1kzIlV_irzvdBNbFB1bHPZ9D7LFuO1RlE', '', '', 136);
INSERT INTO `v2_pendaftaran_proposal` (`nama_mahasiswa`, `nim`, `email`, `nomor_ponsel`, `nomor_ponsel_orang_tua`, `judul_proposal`, `nama_pembimbing_1`, `nama_grup_riset`, `deskripsi_singkat`, `literatur_utama`, `literatur_penunjang`, `form_kesediaan_membimbing`, `catatan_khusus`, `draft_proposal`, `revisi_draft_proposal_1`, `revisi_draft_proposal_2`, `id`) VALUES
('Mardiana Putri Sasmita', '1641720175', 'mputrisasmita@gmail.com', '082139266360', '081249531853', 'SISTEM PAKAR IDENTIFIKASI KECANDUAN GADGET MENGGUNAKAN TEORI ELIZABETH HURLOCK DENGAN METODE NAÃVE BAYES CLASSIFIER\nUNTUK ANAK SEKOLAH DASAR', 'Luqman Affandi, S.Kom., MMSI', 'SISTEM CERDAS', 'membuat sistem aplikasi pakar yang menampung pengetahuan dari pakar psikolog dalam hal mencegah dan mendiagnosa kecanduan gadget, aplikasi ini bertujuan untuk pencegahan dini bagi anak Sekolah Dasar agar waspada dalam menggunakan gadget. selain itu juga, aplikasi ini memberikan saran berupa motivasi agar anak bisa waspada tingkat kecanduan menggunakan gadget.', 'Naive Bayes Classifier', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1JbwcqaUMWSGCtXGGXvjiqlLIOcMseXNJ', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1kuwFV9NHrKo7lcTLlDyAA7xDXtY92Sko', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1V2DhQZgVD6EXHxiieYWFxTZnMDobo-1c', '', 137),
('Reynaldi Oktino Libria Putra', '1641720176', 'reynaldiolp@gmail.com', '085706526558', '082335491954', 'OPTIMASI E-COMMERCE MEMANFAATKAN WEB USAGE MINING MENGGUNAKAN METODE ASSOSIATIVE RULE MINING UNTUK MENGETAHUI POLA REKOMENDASI PRODUK', 'Indra Dharma Wijaya, ST., M.MT.', 'SISTEM CERDAS', 'Mengetahui pola kunjungan website e-commerce dengan menganalisa data hit / klik pada suatu website yang terdapat pada web log file untuk menentukan rekomendasi produk yang sesuai dengan keinginan customer dengan melakukan optimasi pada layout yang terdapat dalam website sehingga akan membantu meningkatkan penjualan produk website e-commerce.', 'Associative Rule Mining Algoritma Apriori', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1vxTMK-HWweMqpkolPjYY6bVdO82ZXbJS', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1rzRq8Kp94LOVtF_saOE7tJ9i6dKKjT6s', '', '', 138),
('VERENCA LAILA OKTA AZAHRA', '1641720177', 'verencaazura@gmail.com', '085604260443', '083132676300', 'Implementasi Pendekatan Brute Force pada Penyusun Jadwal Perjalanan Wisata Otomatis dengan Kombinasi Knapsack-Traveling Salesman Problem', 'Faisal Rahutomo, ST., M.Kom., Dr.Eng.', 'SISTEM CERDAS', 'Sistem yang dibuat bertujuan untuk melakukan penjadwalan untuk orang yang akan wisata didaerah Malang dan Batu . dengan adanya sistem ini mempermudah untuk wisawatan yang memiliki waktu sempit untuk memilih wisata mana yang cocok dengan waktu yang dimiliki . selain itu dengan adanya sistem penjadwalan ini di maksudkan untuk mempermudah wisatawan mengetahui lokasi , jarak dan waktu tempuh , serta efisiensi waktu yang dapat digunakan untuk menghabiskan arena didalam wisata. ', 'Brute Force', 'Knapsack Problem , Traveling Salesman Problem', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1HeJz_7YWZILMCvLzTSmzhgD5LYI995Gv', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1MmXz2o1T4tOvAA5vaskRIDbRmCgNhsWZ', '', '', 139),
('Ana Miftakhul Hikmah', '1641720178', 'anamiftakhulh@gmail.com', '081252856335', '081334022584', 'Pengembangan Media Pembelajaran Bagian Tubuh Pribadi bagi Anak Down Syndrome', 'Hendra Pradibta, SE., M.Sc.', 'MULTIMEDIA AND GAME', 'Pengembangan media pembelajaran bagian tubuh pribadi bagi anak down syndrome adalah media pembelajaran yang berbasis multimedia. Media pembelajaran tersebut berisi tentang pendidikan seksual dengan mengenalkan perbedaan antara laki-laki dan perempuan, perubahan fisik saat memasuki masa pubertas, yaitu pada saat memasuki usia 10-12 tahun, serta hubungan dengan orang lain. Masa pubertas juga dialami oleh anak down syndrome, yaitu anak dengan gangguan genetik yang terjadi pada kromosom atau disebut juga trisomi 21, di mana terjadi kelebihan salinan pada kromosom ke-21. Down syndrome menyebabkan pengidapnya memiliki ciri tampilan fisik yang khas, serta keterbelakangan intelektual yang menyebabkan kecacatan belajar, hambatan dalam berkomunikasi, interaksi sosial dan perilaku. Seks dan seksualitas bagi penderita down syndrome masih dianggap tabu, menyeramkan, menakutkan, dan masih diabaikan oleh banyak orang. Media pembelajaran dibuat untuk menghindarkan anak berkebutuhan khusus down syndrome menjadi korban pelecehan seksual maupun menjadi pelaku pelecehan seksual dikarenakan tidak mengetahui sebagaimana mereka bertindak. Media pembelajaran ini menggunakan animasi 3D yang dibuat menggunakan blender dan diolah menggunakan unity, serta menggunakan audio. Animasi dan audio tersebut digunakan untuk memudahkan anak down syndrome menangkap materi yang ada. Selain itu terdapat evaluasi belajar yang berisi pertanyaan mengenai materi bagian tubuh pribadi. Dalam evaluasi tersebut, dilakukan analisis menggunakan metode fuzzy tsukamoto pada dua kelompok siswa yang masing-masing terdiri dari laki-laki dan perempuan mengenai jumlah jawaban benar terhadap waktu tertentu. Sehingga dapat diperoleh hasil media pembelajaran tersebut efektif atau tidak digunakan untuk anak berkebutuhan khusus down syndrome. ', 'Fuzzy Tsukamoto', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1xaL5uQP-fO_pMzYURN0KoSf6jeUFMybF', '', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1rB5dPf70_2JcFt7_XmhtfI2rPcDIEwyZ', '', 140),
('Nadya Fitrani Adisty', '1641720179', 'nadisty51@gmail.com', '085604519700', '08125207844', 'Sistem Pengambilan Keputusan pemilihan dosen pembimbing menggunakan metode SMARTER studi kasus D4 Keperawatan Poltekkes Malang', 'Ariadi Retno Ririd, S.Kom., M.Kom.', 'INFORMATION SYSTEM', 'Untuk menentukan pemilihan dosen pembimbing program studi D4 Keperawatan Politeknik Kesehatan Kemenkes Malang', 'Metode SMARTER', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1vmiiR9ECy2oJfakM0fC51irQWBcuJePy', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=12Eksmt5dVmTL1CJ0kxga8RnBsoZiG51L', '', '', 141),
('Prasetyanti Devi Madyaratri', '1641720180', 'prasetyantidevi123@gmail.com', '082143159210', '085155400106', 'SISTEM PENDUKUNG KEPUTUSAN PENERIMA BANTUAN SISWA MISKIN (BSM) PADA SEKOLAH DASAR STUDI KASUS KABUPATEN TULUNGAGUNG DENGAN METODE AHP DAN MOORA', 'Indra Dharma Wijaya, ST., M.MT.', 'INFORMATION SYSTEM', 'Dalam pengolahan data siswa yang layak menerima dana BSM di sekolah dasar pada kabupaten Tulungagung saat ini masih dilakukan secara manual atau belum adanya sebuah metode yang dapat membantu dalam menentukan siswa/siswi yang benar-benar berhak mendapatkan dana BSM, penentuan penerima dana BSM dengan cara manual ini dapat menyebabkan kesalahan pada saat menyeleksi,  sehingga kriteria penilaian siswa miskin yang telah di tetapkan sering terjadi  kesalahan.\nHal ini terjadi karna sulitnya pengolahan data dengan cara manual tersebut, maka dari itu saya ingin menciptakan sebuah aplikasi yang mana dapat membantu dalam pengolahan data siswa/siswi tersebut supaya lebih mudah, cepat dan akurat.\nDalam pembuatan aplikasi ini saya akan menggunakan dua metode yaitu AHP dan MOORA, dimana pada metode AHP ini saya akan menghitung berapa nila bobot untuk setiap atribut dan pada metode MOORA saya akan melakukan proses perangkingan yang akan menentukan alternatif yang optimal, yaitu siswa terbaik. Pembagian BSM  dilakukan untuk membantu seseorang yang tidak mampu selama menempuh studinya.', 'Analytical Hierarchy Process (AHP)', 'Multi-Objective Optimization by Ratio Analysis (MOORA)', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1OtwCzeUwx3Vtp1YF4w5yfzYt581Ow8kG', '', '', '', '', 142),
('Okky Bagus Baitis Tuta', '1641720181', 'okkybagus.b@gmail.com', '081333669360', '082334677007', 'Identifikasi Bibit Lele Unggul Berdasarkan Geraknya Menggunakan Metode Phase Only Correlation', 'Ulla Delfana Rosiani, ST., MT.', 'COMPUTER VISION', 'Berdasarkan jurnal tentang sistem pendukung keputusan pemilihan bibit unggul ikan lele, pergerakan ikan lele merupakan kriteria yang memiliki bobot terbesar dalam pemilihan bibit lele.\nMaka dari itu dibuatlah sistem berupa pengolahan citra digital dengan menggunakan metode phase only   correlation yang dapat menentukan ikan lele mana yang bergerak dengan cepat dan lamban. Sistem ini dibuat untuk memudahkan pembudidaya ikan lele untuk memilih bibit ikan lele yang bagus, dengan melihat pergerakan ikan lele, jika ikan lele bergerak cepat dan gesit maka ikan lele dianggap bagus', 'Phase Only Correlation', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1vcYfseDy1pmB1EgfoTgBUBMnm6ZibqbN', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1qcRCatpsf-aSQV184Q5RVbjXU1E6XByI', '', '', 143),
('Ferdiana Rochmatul Chusna', '1641720182', 'ferdianarc@gmail.com', '082231350898', '081331127963', 'Pengembangan Sistem Pre-Assessment Sertifikasi Label Halal  (Studi Kasus PLUT-KUMKM Kota Batu) ', 'Faisal Rahutomo, ST., M.Kom., Dr.Eng.', 'SISTEM CERDAS', 'Sistem pakar tentang pre-assessment sertifikasi label halal untuk produk UMKM agar pelaku usaha/UMKM dapat melakukan simulasi audit internal sebagai syarat sertifikasi label halal sehingga tercapai tujuan dari pembuatan aplikasi ini menganalisa dan mengevaluasi kapasitas suatu produk dari Pelaku Usaha atau UMKM untuk dapat lolos uji Sertifikasi Label Halal.', 'Fuzzy Logic System', 'Genetic Algorithm', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1lufUfHZK8rjw01otvm55QAgIQLrw1Uk2', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1WA2l-UhtqlI4AvqAI2yG-c6HlMSrBvsc', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1TPp43QynsUStN6DAJhdLRJdutTO3HflY', '', 144),
('Muhamad Alif Fudianto', '1641720183', 'aliffudianto@gmail.com', '081949614671', '087856246792', 'Penerapan Metode Trend Moment Untuk Peramalan Penjualan Obat Ternak Berbasis Web (Studi Kasus PT Otasindo Prima Satwa Cabang Surabaya)', 'Deddy Kusbianto PA, Ir., M.Mkom.', 'INFORMATION SYSTEM', 'Pemenuhan permintaan merupakan salah satu kendala yang sering terjadi di perusahaan supplier kebutuhan peternakan seperti obat ternak. Sebagian pesanan yang tidak terprediksi karena masalah ketersediaan stok obat ternak dapat menimbulkan kerugian bagi perusahaan. Hal ini merupakan suatu hal yang menarik untuk di cermati sehingga pemenuhan pesanan dapat dilakukan secara lebih baik. sehingga PT Otasindo Prima Satwa Cabang Surabaya perlu adanya aplikasi untuk menentukan peramalan penjualan obat ternak agar tidak kehabisan produk yang akan dijual.\nBerdasarkan permasalahan diatas Penulis bertujuan untuk merancang sebuah sistem informasi peramalan untuk membantu perusahaan dalam memperkirakan kebutuhan stok pada bulan-bulan berikutnya berdasarkan data historis sebelumnya, untuk mengatasi masalah ketersediaan stok barang. Berdasarkan uraian diatas metode trend moment dipilih karena  merupakan metode yang cocok dengan kesesuaian data yang digunakan dalam peramalan penjualan obat ternak di PT Otasindo Prima Satwa Cabang Surabaya karena trend setiap tahunnya berulang di setiap bulannya, diharapkan dengan adanya sistem ini nantinya dapat membantu dalam perencanaan penjualan yang akan dilakukan oleh pihak PT Otasindo Prima Satwa Cabang Surabaya, dan juga membantu dalam mengatasi masalah ketersediaan stok barang pada bulan-bulan berikutnya.\n\n', 'Trend Moment', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1O8zcrpw-AWH_h6esKhoBJV1K_2xOUusk', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1pGaVp6nAR1qzt78yVLiIK0XYmVj3s7QN', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=17NZJA3RYX4P1r64kptwzePJ_S3Q-oJS1', '', 145),
('Idris Cahyono', '1641720184', 'idriscahyono@gmail.com', '0895338083582', '085235497045', 'Line E-Commerce Chatbot Menggunakan Finite State Machine', 'Putra Prima A., ST., M.Kom.', 'SISTEM CERDAS', 'Line chatbot untuk membantu penjual dalam merespon pelanggan yang seringkali menayakan hal yang sama dan berulang tanpa batasan waktu dan jam kerja, sehingga dapat meningkatkan kepuasan pelanggan', 'Finite State Machine', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1fLh7pEeU1vbtWpDkpB7kixe2Xj2uCrkm', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1xLaNkFUjLL8pUCHvwX4MZIV7Il-E02PD', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1atEuDT2-soitFIl1bFDwPZU6Z6SZ4Mp4', '', 146),
('Moh. Rofid Taufiqun Billah', '1641720185', 'rofid14@gmail.com', '0895329306904', '085155210390', 'IMPLEMENTASI METODE TRIPLE EXPONENTIAL SMOOTHING UNTUK PREDIKSI PERMINTAAN PRODUK FURNITURE PADA CV. KYKY MEBEL', 'Deddy Kusbianto PA, Ir., M.Mkom.', 'INFORMATION SYSTEM', 'untuk memprediksi jumlah permintaan barang pada bulan atau tahun yang mendatang, agar dapat membantu perusahaan dalam perencanaan pengadaan bahan baku', 'TRIPLE EXPONENTIAL SMOOTHING', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1msdQy1uvDupVt2Ky6Z5wb_e2sHilDW6U', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1aQFPLo55Rc-Z9d1PdgqL6QCxxm-NuzES', '', '', 147),
('Nugroho Febriyanto', '1641720187', 'nugrohofebriyanto15@gmail.com', '085336753855', '085856731153', 'Deteksi Kerusakan dan Kelayakan Ban Mobil Berdasarkan Ekstraksi Teksturnya Menggunakan Gray Level Co-Occurance Matrix dengan Metode Jaringan Syaraf Tiruan', 'Cahya Rahmad, ST., M.Kom., Dr. Eng.', 'COMPUTER VISION', 'Sistem berbasis Dekstop untuk mendeteksi jenis kerusakan pada ban mobil serta mengklasifikasikan jenis kerusakan untuk kelayakan pemakaian ban mobil tersebut. \nJenis kerusakan ban ini dapat diambil dari citra ban mobil yang diakuisisi dari tapak lebar / diameter ban. Kemudian citra tersebut diproses untuk pengambilan teksturnya dengan menggunakan Gray Level Co-Occurance Matrix sehingga dapat mendeteksi jenis kerusakan apa yang terjadi pada ban mobil. Setelah itu masing masing jenis kerusakan ban mobil diklasifikan dengan metode Jaringan Syaraf Tiruan Backpropagation untuk menghasilkan kelayakan ban. Kelayakan ini terbagi menjadi 3 kelas yaitu : 1. Layak, 2. Setengah Layak, 3. Tidak Layak.\nDari klasifikasi tersebut user dapat melihat jenis kerusakan dan bagaimana kelayakan ban mobil tersebut untuk pertimbangan ganti ban.', 'Gray Level Co-Occurance Matrix', 'Jaringan Syaraf Tiruan Backpropagation', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1-BXO7U58QcbukzKj-K5qykYYeh67g9P6', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1s3yPyc-3MynOa_-o_a-d5ANAi5rKB3wT', '', '', 148),
('achmad devri darmawan', '1641720188', 'genswoli@gmail.com', '085722140956', '082142043526', 'sistem rekomendasi pencarian lahan baru usaha penanaman porang untuk mencari lahan terbaik', 'Dhebys Suryani, S.Kom., MT', 'INFORMATION SYSTEM', 'Pada studi kasus kali ini saya telah mengembangkan bisnis penanaman porang di daerah kediri, akan tetapi terdapat sebuah permasalahan untuk pemilihan lahan sebagai media penanaman porang yang baik seperti apa, maka dengan itu untuk penelitian yang saya lakukan ,yaitu membuat sebuah sistem rekomendasi pemilihan lahan untuk penanaman porang di wilayah kediri, sehingga permasalahan di atas mendapatkan solusi.', 'MOORA', 'fuzzy', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1H0yqLGu2ZrttsTKhnlM-_vE4sxu1amiF', '', '', '', '', 149),
('Farinda Ramadhani S', '1641720189', 'enjokeek@gmail.com', '081217710742', '085337667071', 'Pengendalian Persediaan Bahan Baku Biobriket Dengan Menggunakan Metode POQ (Period Order Quantity) dan ARIMA (Autoregressive Integrated Moving Average) di CV. Bintang Yasa Abadi', 'Gunawan Budi Prasetyo, ST., MMT., Ph.D.', 'INFORMATION SYSTEM', 'jadi saya akan membuat sistem peramalan stok bahan baku biobriket, yaitu dimana nanti pada aplikasi ini dapat meramalkan persediaan stok biobriket supaya tidak kelebihan dan kekurangan stok, dengan menghitung dari data pembelian bahan baku dan penjualan yang sudah diberikan oleh CV. Bintang Yasa Abadi dengan menggunakan metode POQ (Period Order Quantity) dan ARIMA (Autoregressive Integrated Moving Average)', 'POQ (Period Order Quantity)', 'ARIMA (Autoregressive Integrated Moving Average)', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1c4NsbEJm80eiX4XwUlSjlgz0Uu86X1s9', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=170Fq_AsK_SeiFQ8qxDec2Wlmj-XRK7br', '', '', 150),
('Diva Adittiyaputra', '1641720190', 'wewedodo2@gmail.com', '089617406325', '081347646351', 'PENCARIAN RUTE TERDEKAT PELAKU USAHA MIKRO, KECIL DAN MENENGAH DI KABUPATEN MALANG PADA ANDROID DENGAN MENGGUNAKAN METODE  FLOYD WARSHALL ( STUDI KASUS KOMINFO KAB. MALANG)', 'Mungki Astiningrum, ST., M.Kom.', 'INFORMATION SYSTEM', 'Skripsi saya adlah tentang pencarian rute terdekat pelaku usaha mikro, kecil dan menengah di kabupaten malang. Data yang digunakan adalah data UMKM yang di dapatkan dari kominfo kabupaten malang. Nantinya selain pada aplikasi android, data UMKM juga ditampilkan dalam bentuk crud yang diakses oleh admin lewat browser. Aplikasi ini berbasis android, sehingga pengguna dapat menggunakan aplikasi ini dimanapun. Aplikasi ini memerlukan internet dan gps untuk mengetahui lokasi dari pengguna. Pada tampilan awal aplikasi, pengguna akan dihadapkan oleh dua menu yaitu menu untuk melihat data umkm dan menu untuk mencari rute terdekat. Pada menu data umkm, pengguna dapat melihat data informasi dari pengusaha yang ada di kabupaten malang. Lalu untuk menu kedua, pengguna dapat mencari rute terdekat menuju tempat usaha yang dicari. Dalam mencarian rute terdekat, terdapat fitur filter yang digunakan untuk merinci usaha yang ingin dicari. Setelah menentukan usaha yang ingin dicari, selanjutnya aplikasi akan membaca lokasi dari pengguna, lalu dengan metode Floyd-Warshall aplikasi akan menampilkan rute terdekat untuk menuju tempat usaha yang dicari. Setelah proses pencarian rute terdekat selesai pengguna dapat melihat informasi data dari pengusaha yang dicari. Di sisi lain, admin melakukan perubahan data UMKM melalui browser', 'Metode Floyd-Warshall', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1YEeiCw3NGRZbUkLH0sKXndvT2THI8Myl', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1jlTb-6cD-v0DKCZKRvbu9iSfyXut0Nm9', '', '', 151),
('Muhammad Alif Yudhistira', '1641720191', 'yudhistirathio@gmail.com', '085645891315', '08155523308', 'KLASIFIKASI TOPIK DAN MOOD LAGU BERDASARKAN LIRIK DAN CHORD MENGGUNAKAN METODE K-NEAREST NEIGHBOR', 'Pramana Yoga Saputra, S.Kom., MMT.', 'SISTEM CERDAS', 'Seiring berkembangnya zaman, jumlah lagu yang tersedia di dunia semakin banyak. Salah satu stimulus luar untuk emosi pun semakin banyak, yaitu lagu itu sendiri. \nDengan bertambahnya jumlah lagu digital maka diperlukannya suatu sistem yang dapat mengklasifikasikan lagu-lagu tersebut. Pengklasifikasian lagu berdasarkan emosi juga belum banyak digunakan. Padahal emosi  cenderung berperan besar dalam komunikasi antar manusia di kehidupan sehari-hari. Terdapat beberapa metode machine learning yang dapat digunakan untuk klasifikasi. Pada tugas akhir ini penulis menggunakan metode k- Nearest Neighbor (k-NN). Pada penelitian k-NN sebelumnya yang digunakan untuk klasifikasi emosi untuk teks berbahasa Indonesia mencapai akurasi dengan tingkat 60% [5]. Selain itu, pengklasifikasian topik lagu berdasarkan chord atau akor juga sangat menarik untuk dibahas pada masalah ini. Dengan nilai keakurasian yang sudah cukup, maka bisa dikatakan pada metode ini sangat cocok untuk mengkalsifikasi lirik lagu berdasarkan topik dan mood.', 'K-Nearest Neighbor', 'TF-IDF', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1WWbXS6K23kE2f7maXHlHq9maF1DNhBGy', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1OzWteFD1_akKI-NTZpCTRfJRjB3gTMdo', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1vXZvBPzb_i9yyPLvkSBqv-5ky4agEWmw', '', 152),
('Ramadhan Nur Cholis Januar', '1641720192', 'adhann98@gmail.com', '082334686278', '081216678160', 'Klasifikasi jenis buah apel berdasarkan tulang daun menggunakan metode Ant\nColony Optimization dan K-Nearest Neighbor', 'Rosa Andrie Asmara, ST., MT., Dr. Eng.', 'COMPUTER VISION', 'Penelitian ini bertujuan untuk mengklasifikasikan jenis buah apel\nberdasarkan bentuk tulang daun menggunakan metode  K-Neareast Neighbor untuk menentukan jenis buah apel. Pola citra yang akan diolah adalah bentuk tulang daun, dengan dilakukan deteksi tepi ciri tulang daun menggunakan metode Ant Colony Optimization', 'Ant Colony Optimization', 'K-Neareast Neighbor', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1_E7yHJLur5uJR5xWHsjtUNWmgUiZlV9H', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Se3CHpXlYJmecmT4Aq8-83pZ5nLYBvKt', '', '', 153),
('Isnu Hendy Kurniawan', '1641720194', 'idsamid18@gmail.com', '087785305316', '081231046306', 'SISTEM INFORMASI PERAMALAN PERSEDIAAN BIBIT BENIH IKAN KOI DI BATU KOI CENTER SIDOMULYO ', 'Deddy Kusbianto PA, Ir., M.Mkom.', 'INFORMATION SYSTEM', 'Masalah persediaan barang merupakan masalah yang sangat penting bagi sebuah perusahaan, terutama jika perusahaan tersebut bergerak dalam bidang distribusi barang. Tanpa adanya persediaan, perusahaan akan dihadapkan pada suatu resiko dimana perusahaan mengalami kendala karena tidak dapat memenuhi keinginan pelanggan yang membutuhkan barang maupun jasa yang dihasilkan oleh perusahaan tersebut. Masalah yang sering dihadapi adalah keterbatasan persediaan barang dalam memenuhi pesanan. Namun, persediaan barang yang terlalu berlebihan juga dapat menimbulkan kerugian berupa biaya penyimpanan dan tidak terjadi perputaran uang dalam perusahaan. Penyelesaian untuk masalah ini sangat penting untuk diperhatikan. Oleh karena itu diperlukan suatu metode yang dapat diaplikasikan dalam pengendalian persediaan barang.\nsaya ingin membuat sistem tersebut membantu pihak koi center sidomulyo mengambil keputusan persediaan ikan hias yang akan disiapkan untuk periode selanjutnya.', 'Metode Least Square', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1-ZQUwCKxQPjy6KEpzGg3XjuapGO_5NiT', '', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1HMz2iAGxLUgIe5bNSESGt_4jaLBXTCmu', '', 154),
('fahmi auliya rohman', '1641720196', 'Elfaruqqiyah1998@gmail.com', '082266437883', '082266437883', 'Evaluasi Dan Perancangan User Interface Dan User Experience Menggunakan Metode Human Centered Design dan Heuristic Evaluation Pada Website Kabupaten Jembrana ', 'Mungki Astiningrum, ST., M.Kom.', 'INFORMATION SYSTEM', 'Skripsi saya bertujuan untuk menemukan masalah tentang usability dengan metode Human Centered Design dan kemudian mengevaluasinya, usability yang dimaksud yaitu tentang sejauh mana suatu produk atau sistem dapat digunakan oleh pengguna untuk mencapai tujuan tertentu dengan efektifitas, efisiensi dan kepuasan, salah satu metode evaluasi usability adalah Heuristic Evaluation, diharapkan dibuat nya tema ini untuk  dapat meningkatkan jumlah pengguna yang mengunduh, menggunakan dan meningkatkan kenyamanan pengguna saat menggunakan website jembrana', 'human centered design', 'heuristic evaluation', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1iYPl4O4lpCo3X2nnh0Z0SvNollAiRPs_', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1s2vnm2T8GvyFVpwPNZCkEA5A0xjNlr5l', '', '', 155),
('Yudistira Eka Putra', '1641720197', 'yudistiraputra95@gmail.com', '083834565645', '089857227282', 'Implementasi Analisa Kemiripan Teks pada Disposisi Keluhan Warga pada Pemerintahan Daerah', 'Cahya Rahmad, ST., M.Kom., Dr. Eng.', 'SISTEM CERDAS', 'Pengaduan adalah penyampaian keluhan yang disampaikan pengadu kepada pengelola pengaduan pelayanan publik atas pelayanan pelaksana yang tidak sesuai dengan standar pelayanan. Dalam penyampaian pengaduan ini banyak kota yang memakai website sebagai media penerima pengaduan masyarakat.Contoh adalah kota malang yang memiliki website pengaduan https://sambat.malangkota.go.id/ website ini menerima 570 keluhan tiap harinya. Tiap keluhan ini akan di disposisi ke dinas-dinas yang terkait dengan keluhan yang ada. Agar proses disposisi ini lebih efisien maka saya ingin mengimplementesi text mining terhadap keluhan yang ada sehingga dapat melakukan rekomendasi kemana disposisi tersebut akan diarahkan.', 'Cosine Similarity', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1eDZszEhiv4yKYjPegDsZmp1-dVasxi0U', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1t6DetoJWji1uIPVrYWiuHH0zwlyfnZKX', '', '', 156),
('M. Imron Rozikin', '1641720201', 'rozikinimron@gmail.com', '089679104044', '086533514538', 'Penerapan IOT pada UMKM kerupuk untuk menghindari resiko penghambat waktu pengeringan menggunakan sensor kelembaban', 'Yuri Ariyanto, S.Kom., M.Kom.', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Inti dari Penerapan IOT pada UMKM kerupuk untuk menghindari resiko penghambat waktu pengeringan menggunakan sensor kelembaban yaitu membuat sebuah prtotype pada UMKM kerupuk yang dimana apabila disaat proses pengeringan kerupuk terjadi hujan maka sistem akan menganalysis data dari hujan yang ada menggunakan sensor-sensor yang ada seperti sensor suhu dan kelembaban DHT11, sensor ldr, sensor hujan, sensor suara, dan apabila cuaca menunjukan kalau akan terjadi hujan sesuai data yang diterima oleh sensor maka produsen kerupuk tersebut akan menerima peringatan melewati aplikasi android yang dapat diakses dimana saja kemudian produsen kerupuk tersebut dapat melakukan aksi penutupan tempat pengeringan melalui aplikasi andorid yang tersedia atau apabila produsen tidak sempat melakukan aksi tersebut dan cuaca menunjukan terjadi hujan maka sistem akan otomatis melukukan penutupan pada tempat pengeringan. semua ini bertujuan apabila produsen kerupuk lalai terhadap pengeringan kerupuk maka dapat terbantu oleh sistem untuk mengatasi masalah resiko waktu pengeringan yang berkepanjangan gara-gara terkena hujan.', 'Fuzzy Tsukamoto', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1UKo_z5c4ZMea6C91owXxS2FehWOlcNwt', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=14k7R5iK-s4wOrtmkeZXTG3MBK65kUwux', '', '', 157),
('Atina Za\'ima Rasyida', '1641720208', 'atinazr@gmail.com', '082228168203', '085235056781', 'ANALISIS SENTIMEN KUALITAS LAYANAN ONLINE MARKETPLACE DI INDONESIA MENGGUNAKAN METODE SUPPORT VECTOR MACHINE', 'Indra Dharma Wijaya, ST., M.MT.', 'SISTEM CERDAS', 'melakukan sentimen analisis mengenai beberapa marketplace besar di indonesia dengan cara mengklasifikasikan komentar tweet menjadi negatif, positif, dan netral kemudian membandingkan nilai akhir hasil sentimen analisis tersebut untuk mengetahui marketplace mana yang memiliki tingkat pelayanan terbaik sehingga dapat direkomendasikan kepada masyarakat', 'support vector machine', 'TF-IDF', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1FdZAY6M1Y5akdng6YdvnQo6H_tM8qN8p', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1IdLuiE643zPYLrXLI-LJJ-dWy5Jem7Jm', '', '', 158),
