('Piping Adel Wijaya Putri Yacobus', '17411723006', 'pipingyacobus@gmail.com', '085233187011', '081331812495', 'Sistem pakar rekomendasi menu makanan untuk mencegah stunting pada anak usia dini dengan metode Z-Score', 'Luqman Affandi, S.Kom., MMSI', 'INFORMATION SYSTEM', 'Di skripsi ini saya membuat sistem pakar tentang rekomendasi menu makanan yang dapat mencegah stunting pada anak di usia dini, dengan cara memenuhi jumlah asupan gizi yang di perlukan saat anak masih dalam masa kandungan hingga masa usia 0-24 bulan yang dimana di masa tersebut anak akan mudah terkena penyakit stuning.', 'z-score', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1uJx-T7ROTGNvGOs5EQhdM0CSSudnMfgH', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1l3TuF0bfiTHJBrErbwiWeZmkkmWxopDG', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1XyImPk4a9mKgmrTehrbvuVBR0Rwnj41v', '', 161),
('Tri Nanda Satrio Purnomo', '1741723001', 'trinsp11@gmail.com', '082244443789', '081333212359', 'Rancang dan Bangun  Sistem Lecturer Room Automation menggunakan RFID berbasis website (Studi Kasus : Jurusan Teknologi Informasi Politeknik Negeri Malang)', 'Ekojono, ST., M.Kom.', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Politeknik Negeri Malang adalah salah satu institusi pendidikan tinggi dan teknik lanjutan serta penelitian ilmiah atau pendidikan vokasi profesional, yang memiliki spesialisasi dalam bidang ilmu pengetahuan, teknik dan teknologi atau jurusan teknis yang berbeda. Pengembangan IoT di Politeknik Negeri Malang sering dilakukan dalam penggunaan daya listrik gedung atau sebagai pembelajaran perkuliahan jurusan. Untuk pengembangan IoT dilingkungan Politeknik Negeri Malang, perlu dilakukan riset terhadap suatu masalah. Problematika yang  dijumpai adalah mahasiswa saat ini ketika ingin bertemu dengan dosen maka mahasiswa harus mengecek langsung keruang dosen dan menanyakan dosen yang bersangkutan ada ditempat atau tidak . Tentunya hal tersebut menimbulkan rasa canggung terhadap mahasiswa karena ditakutkan mengganggu aktifitas dosen yang lain didalam ruangan. Dampak dari hal itu, maka sering kita jumpai mahasiswa berkumpul didepan ruang dosen dan menunggu demi bertemu dosen yang bersangkutan. Kondisi seperti itu mengakibatkan lobby di depang ruang dosen kurang enak dipandang oleh visitor dari instansi, kampus ataupun sekolah. Dengan melihat kondisi yang demikian penulis memberikan saran untuk membuat perancangan sistem informasi berbasis website yang didukung dengan perangkat IoT guna mengatasi problematika yang dialami oleh Politeknik Negeri Malang tepatnya di jurusan Teknik Informatika. Dengan adanya perancangan sistem informasi yang terintergrasi diharapkan menjadi manfaat dan terobosan baru dalam mendapatkan informasi dosen dengan mudah yang dapat digunakan oleh visitor, mahasiswa ataupun dosen.', 'Metode Kriptografi', 'Metode enkripsi RSA atau 