INSERT INTO `v2_proposal` (`nim_pengusul`, `judul_proposal`, `nama_grup_riset`, `literatur_utama`, `literatur_penunjang`, `catatan_khusus`, `id_dosen_pembimbing_1`, `deskripsi`, `form_kesediaan`, `draft`, `revisi_draft_1`, `revisi_draft_2`, `id`) VALUES
('141723017', 'Sistem Analisis Permintan Darah di Palang Merah Indonesia Unit Tranfusi Darah Kabupaten Bojonegoro', 'INFORMATION SYSTEM', 'Support Vector Regression', '', '', 16, 'Palang Merah Indonesia (PMI) adalah sebuah organisasi perhimpunan nasional di Indonesia yang bergerak di bidang sosial kemanusiaan. PMI berperan sebagai penyedia jasa kebutuhan darah, membuat PMI dituntut memnuhi kebutuhan pasien. Penelitian ini mengamati persediaan darah di PMI Unit Transfusi Darah (UTD) Kabupaten Bojonegoro. Karena sifat darah yang perishable, maka produk darah memiliki batas umur masing-masing. Sehingga dibutuhkan suatu sistem pengendalian persediaan untu menghindari kerusakan darah. Tujuan dari penelitian ini adalah memberikan analisis peramalan persediaan untuk periode kedepan. Peramalan dilakukan untuk jangka panjang dengan menggunakan metode dengan tingkat error terkecil.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1FWWs2l86RKx714EivDX8Braa5l37iJ09', '', '', '', 1),
('1431140137', 'Aplikasi Pengenalan Plat Nomor Kendaraan Bermotor dengan Metode Deep Learning', 'COMPUTER VISION', 'Deep Learning', 'Tenserflow atau yang lain', '', 7, 'Pengenalan Plat Nomor dengan metode deep learning dan pengolahan citra sehingga menghasilkan output yaitu Nomor kendaraan berdasarkan citra yang didapat oleh kamera', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1z4GhDWvSkBR5dIO_vx6FCY19wLSOpYG8', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1vn6UwaOAes9DA0HLAG6DKKwKdLNZydSQ', '', '', 2),
('1541180038', 'SISTEM INFORMASI PREDIKSI TINGKAT KRIMINALITAS DENGAN MENGGUNAKAN METODE WINTERS EXPONENTIAL SMOTHING ', 'INFORMATION SYSTEM', 'Winter Exponential Smothing', 'Simple Moving Average', '', 16, 'Selama ini di Polres Kabupaten Probolinggo bertugas menyelanggarakan tugas pokok Polri dalam rangka memelihara\nkeamanan dan ketertiban masyarakat, menegakkan hukum, serta memberikan perlindungan, mengayomi\nkepada masyarakat. Dari permasalahan yang terjadi khusunya dalam tindakan kriminalitas masyarakat yang ada di wilayah Probolinggo dan agar tidak terjadi kenaikan tindakan kriminal diwilayah Probolinggo di awal bulan maka\ndiperlakukan pembenahan sistem peramalan yang nantinya dapat meramalkan hasil tindakan kriminal untuk\nbulan mendatang. Metode Exponential Smoothing itu menjadi tiga, yaitu Single , Double, dan Triple\n(Winters). Metode Single Exponential Smoothing sangat tepat di gunakan ketika pola datanya mempunyai\nsifat musiman, metode Double Exponential Smoothing sangat efektif digunakan ketika pola data bersifat\ndata trend (kenaikan) dan Triple Exponential Smoothing (Winters) sangat tepat digunakan ketika pola data\nbersifat musiman dan trend (kenaikan). Karena tingkat kriminalitas tersebut bersifat musiman (per-bulan)\ndan trend (kenaikan), maka metode yang tepat untuk meramalkan tingkat kriminalitas di Probolinggo yakni\nmenggunakan metode Winters Exponential Smoothing.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1PK4Ru4QRaWdAREJ_xQJ3DdYjqVEpxSEd', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1YgF0Gm1cArH8FwKxJnZxRmtzSs5q6KzW', '', '', 3),
('1541180052', 'IMPLEMENTASI METODE FUZZY TIME SERIES PADA SISTEM PERAMALAN KEPADATAN JALAN RAYA KOTA MALANG KHUSUSNYA JL. SOEKARNO HATTA \n', 'INFORMATION SYSTEM', 'FUZZY TIME SERIES ', '', 'Untuk sementara kalimat judul skripsi belum di fix kan oleh pembimbing', 10, 'Meramalkan kepadatan kendaran di Jl. Soekarno Hatta Malang. Dan dari hasil prediksi ini akan ditentukan langkah - langkah yang tepat untuk menekan laju pertumbuhan jumlah kendaraan.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1vuS33pmhYIG-mWFI2rBoPJeiEXR2kCkO', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1TzRJ0G9T9wjDQUFdr2N2GPGup8Tb8ewm', '', '', 4),
('1541180229', 'SISTEM PAKAR PENDETEKSI KERUSAKAN PADA KAMERA DSLR (DIGITAL SINGLE LENS REFLEX) DENGAN MENGGUNAKAN METODE CASE BASED REASONING DAN CERTAINTY FACTOR  ', 'SISTEM CERDAS', 'Case Based Reasoning', 'Certainty Factor', 'Penulisan Judul masih belum fix, masih perlu konfirmasi dari Bapak Erfan selaku pembimbing. Karena beliau masih tugas ke luar kota, saya disuruh menunggu untuk bertemu beliau kembali insyaAllah pada hari Senin, 02 Desember 2019', 10, 'Membuat sebuah Sistem Pakar yang dapat mendeteksi kerusakan kamera DSLR (Digital Single Lens Reflex) dengan cara pengguna memasukkan gejala-gejala kerusakan yang muncul pada kameranya, lalu sistem akan memproses hingga mengeluarkan output berupa nama kerusakannya yang dialami dan solusi penanganannya.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1hyBLEu24UKSY0b4VbQmb5sNcqtF1ROpL', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1jgf_LlRVt8H20ObOu5mEFR0Mwsa17IPw', '', '', 5),
('1641720001', 'Rekomendasi Pemilihan Lahan Baru Untuk Instalasi PDAM di Kabupaten Grobogan', 'INFORMATION SYSTEM', 'Weight Agregated Sum Product Assessment (WASPAS)', 'Fuzzy', '', 7, 'Untuk mengurangi kekeringan pada kemarau panjang PDAM Kabupaten Grobogan. Untuk membuka lahan baru pdam memerlukan keputusan mana lahan yg terbaik untuk di buat instalasi baru. Keputusan tersebut di pilih berdasarkan kriteria yang sudah di tentukan oleh PDAM', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1LclbhVSSNq1mttGBVStO7991D7gK1-G8', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1t0X3Z8-Rt98ugo27TDoFbLankc6moWHa', '', '', 6),
('1641720002', 'IMPLEMENTASI METODE LINEAR DISCRIMINANT ANALYSIS UNTUK DETEKSI KEMATANGAN PADA BUAH STOROBERI MENGGUNAKAN EKSTRAKSI FITUR GRAY LEVEL CO-OCCURRENCE MATRIX DAN EKSTRAKSI WARNA HSV', 'COMPUTER VISION', 'Algortima Linear Discriminant Analysis (LDA)', 'Ekstrasksi fitur warna menggunakan HSV, dan ekstraksi tektur GLCM', 'judul di form kesediaan membing masih kurang tepat', 24, 'membuat aplikasi yang bisa membantu para pengusaha stroberi atau petani stroberi dalam mensortir buah secara efektif dan efisien. Dimana dizaman yang sudah modern ini masih banyak perkebunan terutama buah stroberi yang memetik pasca panen dan mensortir buah masih mmenggunakan tenaga manusia. sehingga buah yang di sortir sesuai dengan yang dibutuhkan oleh pembeli. ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=17Z7FenbmMrQBdqcs2uUcFUiF75mKnOS2', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1oaw0wBS4g_dXObx7LMm-B9B4dfpR1d_6', '', '', 7),
('1641720003', 'Prediksi Permintaan Kebutuhan Cabai di Kota Batu Menggunakan Metode Extreme Learning Machine', 'INFORMATION SYSTEM', 'Extreme Learning Machine', '', '', 9, 'Sistem ini dibuat karena kebutuhan cabai terus meningkat setiap harinya. Hal ini juga diikuti dengan meningkatnya jumlah penduduk dan semakin berkembangnya industri makanan yang berbahan baku cabai, maka diperkirakan laju permintaan kebutuhan komoditas cabai akan terus mengalami peningkatan. Akan tetapi jumlah ketersediaan dengan jumlah permintaan cabai tidak selalu seimbang. Hal ini disebabkan karena tidak stabilnya jumlah cabai yang diproduksi dan jumlah permintaan konsumen yang berfluktuatif sehingga dapat memberikan dampak pada ketidakstabilan harga cabai.\nDengan adanya sistem untuk memprediksi permintaan kebutuhan cabai di Kota Batu menggunakan metode Extreme Learning Machine ini diharapkan dapat membantu pihak perusahaan atau instansi terkait agar dapat menentukan langkah-langkah apa yang dapat dilakukan selanjutnya untuk menjaga kestabilan harga cabai dengan seimbangnya antara permintaan kebutuhan dengan produksi.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1-MU3YNeN1qQu8k3GK9ZEGMVHp5wnGNo0', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1QsWJy6JbkA1QxPrNgSW__60MeG-VER64', '', '', 8),
('1641720004', 'Sistem Pendukung Keputusan Penempatan Siswa PKL Menggunakan Metode Moora dan Simple Additive Weighting (studi kasus : SMK Negeri 5 Malang)', 'INFORMATION SYSTEM', 'moora', 'simple additive weighting', '', 8, 'membuat sistem pendukung keputusan untuk menempatkan siswa smkn 5 malang pada tempat pkl ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=15YB5T14gio4luYPztVEiCXfr9tbOPa8l', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1iXE73dt9aDhNQNBf33CAA5_u4U5gOgZB', '', '', 9),
('1641720005', 'Perancangan Aplikasi Mobile Penentuan Jalur Tol dan Tarif Menggunakan Metode BFS', 'SISTEM CERDAS', 'BFS ( Breadth first search )', '', '', 22, 'Dengan semakin berkembangnya pembangunan infrastruktur jalan tol,tentunya akan semakin banyak juga beberapa rute yang lebih cepat ataupun lebih tepat untu di lewati dalam studi kasus tertentu,dan juga nilai kumulatif total tarif juga akan menjadi masalah jika tidak bisa di prediksi dari awal,maka dengan adanya permasalahan tersebut perancangan aplikasi mobile penentuan rute tol dan tarif sangat amat di perlukan guna untuk memberikan kemudahan di penggunaaan fasilitas infrastruktur jalan tol', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1SjlPEX__1XFjCgSwf95kfrM6BXJLauRl', '', '', '', 10),
('1641720006', 'Implementasi Algoritma Extreme Learning Machine Untuk Identifikasi Komponen GUI pada Prototype Aplikasi Mobile', 'COMPUTER VISION', 'Algoritma extreme machine learning (ELM)', 'Canny Edge Detection ', '', 24, 'Para developer pemula seringkali kebingungan untuk membuat sebuah desain tampilan dari aplikasi yang akan dibuatnya atau code seperti apa yang harus diketikan untuk membuat tampilan aplikasi dari sebuah citra prototipe yang dijadikan referensinya. Oleh karena itu peneliti akan membuat sebuah sistem yang dapat membantu proses identifikasi komponen yang terdapat dalam citra (gambar screenshot, gambar prototipe) tampilan halaman aplikasi Android Mobile. Dengan keluaran sistem berupa kode program. Uji coba dari penelitian sebelumnya untuk mengidentifikasi komponen yang terdapat dalam citra (gambar screenshot, gambar prototipe) tampilan halaman aplikasi Android Mobile yang menggunakan metode Convolutional Neural Network (CNN) menunjukan hasil akurasi sebesar 85,32% (Astiningrum, et al., 2019). Penulis mencoba menggunakan metode Extreme Learning Machine (ELM) karena metode ini berhasil melakukan pengenalan objek citra digital dengan rata-rata tingkat akurasi lebih baik dari pada metode CNN (Fikriya, et al., 2017).  Dengan adanya aplikasi ini diharapkan dapat membantu pengguna dalam menentukan komponena yang akan digunakan untuk membuat desain tampilan suatu aplikasi.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1xQ6wrueHKPoxwKmEHpGCNj36Fq4sBK1s', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1zUs5C_2v4IybYovj0agl0GJR9u0LpKHP', '', '', 11),
('1641720007', 'identifikasi jalan aspal berlubang', 'COMPUTER VISION', 'GLCM dan KNN', '', '', 20, 'pendeteksi jalan berlubang dengan citra digital', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1WhLnBgIi3AdbKL-UBy_G653Jr3zXM6w1', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1ZYhBZLupxoqkUhLSQddXk_J59Ua07Ar7', '', '', 12),
('1641720008', 'Management API Gateway pada arsitektur microservices menggunakan Server Side Load Balancing', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Round Robin', '', '', 17, 'Penyeimbang beban di terapkan pada arsitektur microservices', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Sfed4Gddy7ZHWZfFwom9hbWL7WXjULMu', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1t91qGNmGseZzsQruvbEU8qYnJpS1egay', '', '', 13),
('1641720011', 'Implementasi Face Recognition pad smart untuk membuka kunci rumah', 'COMPUTER VISION', 'Metode Fisherface', '', '', 3, 'Teknologi sebuah sistem pengaman untuk masuk ke sebuah rumah telah banyak dikembangkan seperti menggunakan kartu, password. Metode tersebut masih memiliki kekurangan seperti keterbatasan manusia dalam mengingat benda dan mengingat kombinasi angka yang menyebabkan tidak dapat diaksesnya pintu tersebut. Sistem keamanan rumah konvensional dinilai kurang efektif dan efisien. Hal tersebut disebabkan karena pengguna diharuskan memasukan kunci terlebih dahulu kemudian memutar kunci kearah tertentu sehingga pintu dapat dibuka. Oleh karena itu alangkah baiknya jika sistem pengenalan wajah dapat di gunakan untuk sistem keamanan rumah. Sistem keamanan rumah menggunakan wajah memiliki kelebihan seperti wajah tidak dapat di duplikasi, wajah manusia berbeda-beda dan lebih efisien karena pemilik rumah hanya perlu mengarahkan wajah ke kamera untuk membuka pintu. Oleh karena itu penulis membuat sistem pengenalan wajah sebagai sistem kendali buka tutup pintu ruangan. Penggunaan wajah sebagai kunci untuk masuk ke dalam rumah diharapkan dapat meningkatkan tingkat keamanan menjadi lebih tinggi dikarenakan wajah tidak dapat diduplikasi dan berpindah tangan. [1] Sistem keamanan yang digunakan pada sistem ini menggunakan teknologi biometrika pengenalan wajah yaitu dengan menggunakan ciri â€“ ciri fisik manusia yang memiliki karakteristik berbeda â€“ beda yang selalu melekat pada manusia. Pada pengaplikasiannya, sistem keamanan menggunakan pengenalan wajah dilakukan dengan bantuan sebuah kamera atau webcam untuk menangkap wajah seseorang yang kemudian akan dibandingkan dengan wajah yang sebelumnya telah disimpan di dalam database tertentu. ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1hf_pEJf63o8C3zRznZM5X8ed2ItpWyPg', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1rAEo8kDo79COVM7m2rk048pY9ntsGsBI', '', '', 14),
('1641720012', 'Klasifikasi Mutu Kelapa Berdasarkan Warna dan Tekstur Untuk Produksi Wingko yang Berkualitas Menggunakan Metode SVM ( Support Vector Machine ) (Studi Kasus Putra Agung Wingko )', 'COMPUTER VISION', 'SVM (Support Vector Machine)', 'HSV (hue, saturation, value), GLCM (Gray Level Co- Occurrence Matrix)', '', 16, 'Salah satu tempat produksi wingko di Babat yakni Putra Agung Wingko. Dalam waktu satu hari produksi dapat menghasilkan 700 produk wingko, salah satu proses yang menentukan kualitas wingko yakni dengan pemilihan kelapa, menurut hasil wawancara dengan pemilik Putra Agung Wingko salah satu tempat produksi wingko di Babat para pekerja kurang memperhatikan kualitas kelapa karena harus memenuhi target produksi wingko setiap harinya. Selain itu pada proses pemilihan kelapa masih manual. Dengan demikian wingko yang dihasilkan kurang berkualitas dan membuat banyak kerugian. Oleh karena itu, akan membangun sebuah aplikasi yang dapat memilih kelapa yang baik dan kelapa yang kurang baik berdasarkan warna daging kelapa dan juga tekstur dari daging kelapa tersebut. Dengan adanya aplikasi ini dapat membantu tidak hanya untuk mencapai target produksi tetapi juga untuk meningkatkan mutu wingko, dan aplikasi dapat ini mempermudah para pekerja dalam melakukan proses pemilihan. Akan tetapi pada aplikasi ini pemeriksaan dilakukan secara statis tidak dinamis. Aplikasi yang dibuat ini menampilkan 2 kelas mutu kelapa yang pertama mutu baik dan yang kedua mutu kurang baik. Dalam pengklasifikasian mutu dari daging kelapa menggunakan metode SVM ( Support Vector Machine ).   ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1oyBmZIavuFePGscmfBhKL65wr51b-Fx4', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1hnIWl2XsnKppwg7XkxjtUVhYcgCDIl62', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1ovvIr0kOU2vAXsN0kXZNOJrHr53vMLxZ', '', 15),
('1641720014', 'aplikasi penyusun tesaurus kata tidak baku', 'SISTEM CERDAS', 'CONSTRAINT SATISFACTION PROBLEM', 'Cooccurrences ', '', 19, 'membuat tesaurus kata tidak baku yang mengambil data dari tweet twiter', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1b2dVpa5xp9BLSoy-o4TZDBON2KkN15HR', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Nifkfv38Dwi-IMmPUG1n3ECu9l5VgsCU', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1ZoVvEgWj_tyBxZMciynoOTisnZXda0w8', '', 16),
('1641720015', 'IMPLEMENTASI MONITORING AIR BERSIH PADA AQUARIUM IKAN KOI DENGAN NODEMCU ESP8266 MENGGUNAKAN METODE FUZZY', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Fuzzy', '', '', 7, 'Melakukan pemantauan air jernih yang ada di akuarium ikan koi menggunakan sistem informasi yang bertujuan untuk memberikan kualitas air yang baik untuk ikan koi', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1OeshPL8LkUTb04VigWdDDMH0_AznU627', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Jk3HjISpJQ1RJlbd1Tlx_Z740tnaGLbP', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1IrQASFnxFLxep2UaQ9uqKWr-9pWCvkIJ', '', 17),
('1641720016', 'SISTEM MONITORING KINERJA PANEL SURYA UNTUK IRIGASI SAWAH DENGAN METODE FUZZY', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Fuzzy', '', '', 26, 'Penelitian ini membahas pemanfaatan panel surya untuk pemenuhan kebutuhan irigasi sawah secara efisien. Panel surya mampu mengubah panas matahari menjadi listrik sehingga dapat menjadi energi alternatif pada area tidak terjangkau listrik PLN, yakni sawah pertanian. Teknologi panel surya bermanfaat untuk irigasi sawah pertanian secara efisien menggantikan penggunaan pompa air gen set yang memerlukan biaya tambahan untuk BBM. \nNamun penerapan panel surya memerlukan sistem pendukung agar pengoperasiannya berjalan secara efektif. Penelitian ini memadukan sistem solar tracker yang membuat panel surya mengikuti gerak matahari otomatis untuk mengoptimalkan kinerja panel surya menangkap radiasi matahari. Sistem monitoring daya panel surya melalui parameter arus dan tegangan, dan sistem kontrol irigasi sawah sesuai pola irigasi padi. Ketiga sistem tersebut terintegrasi dalam sistem monitoring kinerja panel surya untuk irigasi dengan metode fuzzy.\nAlgoritma fuzzy untuk memperhitungkan durasi pengairan yang diperlukan sesuai pola tanam, melalui parameter daya panel surya, kelembapan tanah dan ketinggian air untuk mengontrol pompa air. Perancangan sistem berbasis mikrokontroler Arduino Uno dihubungkan ke aplikasi melalui modul Wi-Fi ESP8266. Komunikasi pengiriman data menggunakan metode UDP dan data terkirim tersimpan pada database. Pengambilan data penelitian dilakukan dengan membuat skema prototipe untuk solar tracker, solar panel sebagai catu daya pompa, pompa air , dan miniatur sawah serta sumber air.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=19UOmCY4Rcnz3KgGjcNQMykjUIQtOQ8p9', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=18NDjkTkHxtl3u1E-p1Q6ryeMG13yjlka', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1GBTRAEI-S1rKBA8SeesvuaILph1eSkp_', '', 18),
('1641720017', 'Identifikasi kualitas terung ungu berdasarkan warna dan tekstur menggunakan metode jaringan syaraf tiruan', 'COMPUTER VISION', 'Backpropagation', '', '', 18, 'Skripsi yang akan saya kerjakan nantinya adalah pengidentifikasian kualitas terung ungu berdasarkan warna dan tekstur, menggunakan metode pengklasifikasian backpropagation, dengn inputan gambar, dan menghasilkan penjelasan apakah layak untuk dikonsumsi', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1ioYOZdYeUMKNLHIXIkYteuujL7geIwA8', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1y-jox5_GszpMUhCKYcghWcyKyRaMeLNy', '', '', 19),
('1641720018', 'Pengenalan Alat Indra Dengan Pendekatan Mix Reality (Studi Kasus Museum Tubuh)', 'MULTIMEDIA AND GAME', 'Metode Fisher Yates', '', '', 13, 'Pengenalan Alat Indra di Museum Tubuh Bagong dengan Pendeketan mix Reality menjadi momen yang tepat untuk meningkatkan ketertarikan pengunjung dalam mengeksplorasi benda yang ada di museum karena bersifat interaktif. Penggunaan aplikasi ini untuk mengamati pengalaman dan kebutuhan pengguna saat mencobanya. Aplikasi ini akan memunculkan gambaran atau visualisasi alat indra manusia secara 3D, pengunjung akan di perlihatkan macam alat indra manusia sebagai sarana informasi. Pada tahap akhir, akan ada kuis atau semacam evaluasi atas informasi yang sudah diberikan untuk mengetahui apakah aplikasi berhasil memberikan informasi alat indra dengan baik atau belum.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1rEMmlsUfagEBO-Gby1WhGBRZ88Y7M3Jx', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1RdHnywyUOB6iAohN7RWp62BLGW0JHPoh', '', '', 20),
('1641720019', 'Perancangan Sistem Prediksi Kepadatan Lalu Lintas Menggunakan Metode Double Exponential Smoothing Berbasis IoT', 'COMPUTER VISION', 'Double Exponential Smoothing ', 'Haar Cascade Classifier menggunakan opencv', '', 22, 'Raspberry Pi akan Di instal modul kamera dan merekam kepadatan jalan berupa video secara realtime, video akan di olah menjadi informasi berupa jumlah kendaraan/detik, data akan di kirimkan ke website untuk di analisis menggunakan metode Double Exponential Smoothing dan di tampilkan berupa grafik line. ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1CKHIHEV7YPUfujif-9XyYBvkqooXJyei', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1W77-q_p8KiLTZnveWYTLkdhW36SpYcUh', '', '', 21),
('1641720020', 'Penerapan Algoritma Score-Based pada Peringkasan Teks Cerpen Otomatis ', 'SISTEM CERDAS', 'algoritma score-based', 'cosine similarity', '', 11, 'sistem ini diharapkan mampu membuat ringkasan cerpen yang bisa mewakili isi dari cerpen tersebut. Dengan metode score-based kalimat akan diberi bobot dan dirangking untuk mengtahui mana kalimat yang mewakili isi bacaan. diakhir penelitian akan dilakukan penyebaran kuisioner untuk mengetahui tingkat kepuasan pembaca ringkasan', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=126gtPVLqImeZywFjPUXM5NyASHL2SwJM', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1dP82gQW0WtMGsxPMy3tpvm5iwACDQ9EA', '', '', 22),
