('1641720023', 'ANALISIS KEPUASAN PELANGGAN PADA LAYANAN JASA PT.KAI MENGGUNAKAN METODE APRIORI', 'SISTEM CERDAS', 'Apriori', '', '', 5, 'Skripsi saya mengangkat tentang analisis kepuasan pelanggan pada layanan jasa PT.KAI, aplikasi ini nantinya menggunakan metode apriori. Dan hasil dari analisis ini diharapkan menghasilkan pola yang membuat pelanggan puas terhadap aspek-aspek yang berkaitan dengan kualitas PT.KAI', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1etNOiO-zBf-Mg1OpE9ZUE_fZyADEK-im', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1DR8bBdvui3UJ_7aU458T3pugU3TS4_lf', '', '', 25),
