('1641720025', 'Sistem Pendukung Keputusan Adaptif untuk Seleksi Atlet Baseball dan Softball Tim Kota Malang menggunakan Metode VIKOR', 'INFORMATION SYSTEM', 'VIKOR', '', '', 8, 'Sesuai dengan judul yang saya bahas, dengan mengerjakan skripsi ini saya ingin membuat sebuah program yang bisa membantu PERBASASI Kota Malang agar lebih mudah dan efektif dalam proses seleksi atlet tim kota. Selama ini, proses seleksi hanya dihitung manual dari nilai rata-rata tes yang diberikan, sehingga kurang efektif dan memakan banyak waktu dalam penilaian nya. dengan sistem yang saya buat ini, saya berharap bisa lebih mengefisienkan tenaga dan waktu untuk penilaian serta menghasilkan hasil yang terbaik dari proses seleksi yang dilakukan. Selain itu, sistem yang akan saya buat bersifat adaptif. yang dimaksud adaptif disini adalah kriteria yang dimasukkan bisa di ubah-ubah sesuai dengan tes yang akan dilakukan. selain itu, nilai bobot dari tiap kriteria juga bisa diubah, bergantung pada kriteria mana yang ingin diunggulkan dalam seleksi tersebut.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1st0EsKcByO_h8hqRllvs_dzOu5RH-iiC', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1lI8NbUJ-wfV30gxH_G8gN4Fet64I8_Fv', '', '', 27),
('1641720026', 'Penerapan Market Basket Analysis Pada Data Penjualan Menggunakan Algoritma Pincer Search', 'SISTEM CERDAS', 'Algoritma Pincer Search', 'Algoritma Apriori', '', 14, 'Menganalisa kebiasaan pembeli dengan menemukan hubungan antara barang yang berbeda pada keranjang belanja mereka yaitu dengan menganalisis tiap-tiap transaksi. Penemuan pola tersebut dapat membantu produsen untuk mengembangkan strategi penjualan dengan mempertimbangkan barang yang sering dibeli bersamaan oleh pelanggan. Untuk menerapkan Market Basket Analysis ini dibutuhkan algoritma yang bisa membantu, salah satu algoritma yang dapat digunakan adalah Algoritma Pincer Search. Algoritma Pincer Search dikembangkan oleh Dao- I Lin dan Zvi M. Kedem dari Universitas New York pada tahun 1997. Algoritma ini merupakan pengembangan dari Algoritma Apriori yang hanya menggunakan bottom up, namun pada algoritma ini menggunakan 2 cara pendekatan, yaitu top down serta bottom up. Sehingga dapat dengan cepat menemukan itemset yang frequent. Dengan begitu, sistem ini akan menghasilkan sebuah rule-rule penjualan yang dapat digunakan untuk strategi penjualan.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1o9vsDS5djhBlfacR0tN7EE24IlD48TlJ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1KAOILUTtMcovNVZRGPsYwVaOgugWgzBX', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1HKgqMSTFnKsIdGZQDWNhsR3kYnQg9CN6', '', 28),
('1641720027', 'Implementasi Metode TF-IDF Pada Aplikasi Chatbot Berbasis Web Dalam Sistem Penjualan Online Radja Printing', 'INFORMATION SYSTEM', 'TF-IDF', 'NLP, Cosine Similarity, Recall-Precision', '', 6, 'Tujuan dari pembuatan skrispi ini adalah menggantikan peran customer service dalam melayani pertanyaan-pertanyaan yang diajukan oleh user seputar pemesanan produk.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1tigxCsHnWGG5XMMkvAyyiX-dezYQz_Tn', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1uM1HL4fCk2R49l39NNRh-4951dXroO9P', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1km9icNoYO4oDJStbvnai6agp1uvrua45', '', 29),
('1641720028', 'PENERAPAN METODE FUZZY MAMDANI UNTUK PEMILIHAN PRODUK HERBALIFE BERDASARKAN PREDIKSI KESEHATAN KONSUMEN\n( STUDI KASUS RUMAH NUTRISI FRESH CLUB)\n', 'INFORMATION SYSTEM', 'Fuzzy Mamdani', '', '', 22, 'Pada era yang modern, kesehatan dan pengelolaan berat badan menjadi faktor utama agar penampilan menjadi lebih menarik. Di indonesia tingkat obesitas atau kegemukan berat badan semakin tinggi, Obesitas disebabkan oleh ketidakseimbangan antara jumlah energi yang masuk dengan yang dibutuhkan oleh tubuh untuk berbagai fungsi biologis seperti pertumbuhan fisik, perkembangan, aktivitas, pemeliharaan kesehatan. Untuk menanggapi permasalahan  obesitas PT Herbalife solusi yang tepat untuk mengurangi tingkat obesitas.\nDengan banyaknya produk herbalife, konsumen sulit untuk memutuskan produk apa saja yang harus dikonsumsi sesuai dengan masalah kesehatannya. Berdasarkan permasalahan diatas muncul sebuah gagasan untuk membuat sebuah sistem rekomendasi pemilihan produk herbalife berdasarkan prediksi kesehatan konsumen. SPK bertujuan untuk menyediakan informasi, membimbing, memberikan prediksi serta mengarahkan kepada pengguna informasi agar dapat melakukan pengambilan keputusan dengan lebih baik. \nSalah satu cara yang bisa digunakan dalam pemilihan produk herbalife berdasarkan prediksi kesehatan konsumen adalah penerapan logika fuzzy, karena terdapat beberapa data yang bisa digunakan dalam melakukan perhitungan guna mendapatkan pilihan produk herbalife yang tepat dan sesuai.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1nbBay9lROKHxS_0ssI3MI2ZAbIJ31XTn', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1zOW16dNp8fE9KLPaiqP82ryHPZtAqlgh', '', '', 30),
