('1641720031', 'Implementasi Deep Learning Untuk Sistem Mengemudi Otonom Dengan Menggunakan Artifitial Neural Network Dan Object Detection', 'COMPUTER VISION', 'artifitial neural network', '', '', 3, 'mengimplementasikan kecerdasan buatan ke dalam sistem mobil tanpa awak atau autonomous driving dengan melakukan analisa terhadap obyek seperti rambu-rambu lalu lintas atau benda disekitarnya', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1U08e2EJviG2BeKhCaAZMOokZfGAOmnU-', '', '', '', 33),
('1641720032', 'Identifikasi "Acne Vulgaris" Berdasarkan Fitur Warna dan Tekstur Menggunakan Klasifikasi JST Backpropagation', 'COMPUTER VISION', 'JST Backpropagation', 'Ruang Warna HSV & Metode GLCM', '', 24, 'Skripsi saya tentang identifikasi acne vulgaris, Acne Vulgaris adalah penyakit kulit kronis umum yang melibatkan penyumbatan dan atau peradangan pada folikel rambut dan kelenjar minyak yang menyertainya. Acne vulgaris memiliki bermacam-macam jenis, kadangkala orang-orang susah untuk membedakan apakah acne vulgaris yang muncul merupakan jenis a, b atau c. Kebanyakan orang juga tidak tahu apakah acne vulgaris yang dimilikinya masih dalam kondisi ringan atau sudah meradang. Untuk itu sistem ini dibuat agar acne vulgaris dapat dideteksi apakah termasuk kedalam jenis a atau jenis b, sehingga orang-orang pun mengetahui jenis acne vulgaris yang mereka punya dan dapat diketahui bagaimana cara penanganan yang tepat untuk setiap jenisnya.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1t-gb3F1SZIsPM8To1eQ3mtGxxle5hZpW', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1coup8DZWLSkyHJK360Ggu3qmfMStULg8', '', '', 34),
('1641720034', 'Pengolahan Citra Digital Desain Sablon Untuk Menentukan Estiamsi Harga di Percetakan', 'COMPUTER VISION', 'CNN', '', '', 21, 'Penelitian ini bertujuan untuk memebuat sebuah aplikasi yang dapat memberikan dukungan untuk memberikan estimasi harga berdasarkan desain  yang telah dibuat sebelumnya. dalam penelitian ini, penulis melibatkan beberapa narasumber berupa percetakan spanduk dan banner yang telah berdiri. data yang didapatkan akan menjadi referensi penelitian untuk mendapatkan akurasi yang diinginkan.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1wU7fOa3Yzfr19wbAtKqQlCLEi5hOdkq6', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1t9lFcALQON3PMy8OUuGnq62i83CSNsAM', '', '', 35),
('1641720035', 'Evaluasi Aplikasi Go Food dari Sisi Pengalaman Pengguna Menggunakan Metode Heuristic Evaluation', 'INFORMATION SYSTEM', 'Heuristic Evaluation', 'Persona,HCD,UCD', '', 19, 'Mengevaluasi aplikasi go food dari sisi user experience,kemudian saya buat aplikasi go food baru sesuai analisis dari saya', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1RYfFcXencBJP36R_PNWCyFS0nH_zMgcz', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1FhL11TPyQecLgDNPpgvya73WBr4wiRSk', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1dgBIB6ZpVsuPZHknfCisAU9e7sYdKFla', '', 36),
('1641720036', 'Optimasi Komposisi Pakan Itik Petelur Menggunakan Algoritma Genetika', 'SISTEM CERDAS', 'Algoritma Genetika', '', '', 14, 'Memberikan output komposisi pakan itik petelur yang paling optimal dari pakan yang tersedia', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1m8y0NyBmD3gyz8SPVtH87BUPnSRcHBgB', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Pk59s40UOV2rjpnDFb908aUz48EaziHl', '', '', 37),
('1641720038', 'Klasifikasi jenis kayu berdasarkan serat dan tekstur menggunakan metode gray level dan K - Means', 'COMPUTER VISION', 'Gray Level', 'gabor filter', '', 3, 'Jadi skripsi saya bertujuan untuk mengklasifikasi jenis kayu beradasarkan serat dan teksture bagian dalam kayu, penelitian ini juga bertujuan untuk mengetahui kualitas kayu jangka panjang berdasarkan seratnya', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1kkalw7UfyCYwkU0wkj154Y87H7FKX2GC', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1NWjzl6-AUC-TqeILqRzfIn65JzaD6o2W', '', '', 38),
('1641720039', 'Implementasi Gamification di Lembaga Bimbingan Belajar Primagama', 'MULTIMEDIA AND GAME', 'Gamification', '', '', 6, 'Implementasi konsep Gamification di LBB Primagama Berbasis Website', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=129q0EpcLIKMwkREONb3i4IKL07-ziLP_', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1OAP2uRyKAsuzemc-w87LRze_sTeBkHnn', '', 39),
('1641720041', 'CERTAINTY FACTOR UNTUK SISTEM PAKAR DIAGNOSA HAMA DAN PENYAKIT PADA BUNGA KRISAN', 'SISTEM CERDAS', 'certainty factor', '', 'Kurang tanda tangan pembimbing, karena pembimbing masih tugas ke luar kota.', 23, 'aplikasi ini digunakan untuk menentukan jenis penyakit dan hama pada bunga krisan berdasarkan gejala yang sudah ada sehingga memberikan solusi yang tepat dan terbaik', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1xF4daG9QnhjKifEyF16RVPI6g22jbW2l', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1X3kaXWtU2GH8SxyV2RS5TI6fyYjsaAwt', '', '', 40),
('1641720042', 'Implementasi Metode Support Vector Machine untuk Diagnosis Fault Transformator Daya', 'SISTEM CERDAS', 'Support Vector Machine', '', '', 9, 'Sistem yang dapat menghasilkan kesimpulan suatu tranformator daya memiliki potensi kegagalan (diagnosa) secara cepat, tepat dan efisien dengan cara menghitung persentase gas yang terlarut pada transformator daya yaitu CH4, C2H4, dan C2H2. Hasil diagnosa tersebut dibagi menjadi 7 kelas berdasarkan Duval Triangle, diantaranya yaitu : Partial Discharge (PD), Discharge of Low Energy (D1), Discharge of High Energy (D2), Combination of Thermal Fault and Discharges (DT), Thermal Faults of Temperature T < 300ï‚°C (T1), Thermal Faults 300ï‚°C<T<700ï‚°C (T2), Thermal Faults T>700ï‚°C (T3). Klasifikasi untuk hasil diagnosa transformator daya menggunakan metode Support Vector Machine.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1QSIlLrvNc7owcKOxoGI6F5H2bNijeU9I', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1E9plT1ws2-8P2mco0AJOVAIXFlf4toKx', '', '', 41),
('1641720043', 'Implementasi Fuzzy Time Series Ruey Chyn Tsaur Untuk Mengukur Potensi Penjualan Produk di UD.Rama Jaya Water Heather', 'INFORMATION SYSTEM', 'Fuzzy Time Series Ruey Chyn Tsaur', '', '', 15, 'Melakukan sebuah penelitian yang betujuan untuk membentuk sebuah sistem pengukuran dan potensi penjualan yang tepat, guna menentukan persediaan barang dan penjualan yang ada sesuai dengan permintaan yang akan datang.Serta melakukan pengukuran keakuratan hasil potensi penjualan produk menggunakan fuzzy time series Ruey Chyn Tsaur,yang diharapkan dari hasil pengukuran potensi penjualan tersebut UD.Rama Jaya Water Heather dapat menentukan keputusan terkait persediaan barang, rencana  produksi, cash flow dan investasi aktiva.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1t_AIE3ngb6xpIQRFGEFRrMlln8lENn6U', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1RuiucjJwUnlF1oKenEdYv8KCcWOUiT2W', '', '', 42),
('1641720044', 'Evaluasi K-Means Clustering Pada Preprocessing Sistem Temu Kembali Informasi', 'SISTEM CERDAS', 'K-Means', 'TF-IDF, Cosine Similarity ', '', 11, 'Melakukan pengujian efektifitas dan efisiensi tambahan pada tahap preprocessing pada sistem temu kembali. yaitu, mengklasterkan informasi yang ada terlebih dahulu menggunakan metode K-means. kemudian melakukan pencocokan query dengan dokumen disederhanakan kepada pencocokan query dengan centroid klaster. kemudian dilakukan pengujian menggunakan recall, precision dan f-score', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1wJlhKMTxXvnW9EWVdj10ZIoZG-hRxq36', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1L1mpl0Mj0PI6d01X4Sk9xhhVtl6npnPx', '', '', 43),
('1641720046', 'Implementasi Deep Learning Untuk Deteksi Ekspresi Emosi Pada Twitter', 'SISTEM CERDAS', 'Long Short Term Memory (LSTM)', 'Sentiment-specific Word Embedding (SSWE) dan Global Vector (GloVe)', 'Judul yang ada di form bimbingan direvisi oleh pembimbing. Jadi judul di form dan draft proposal berbeda (sudah kesepakatan dengan pembimbing)', 11, 'Menguji metode SS-BED untuk deteksi emosi pada twitter. Metode SS-BED merupakan gabungan\ndari dua layer. Layer pertama mengombinasikan metode deep learning LSTM dengan SSWE dan layer kedua LSTM dengan GloVe. \nHarapannya dengan mengombinasikan metode deep learning dengan fitur word embedding ini bisa mengetahui mendeteksi emosi di twitter yang lebih akurat', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Zhg-eek07L-3vZ8D5Z7ixcKLK2DquXNq', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1z1qGRjODjUPFL2zIxbkS6Kaj6M4gkIsB', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1RRu4RcHlMbfjuJs87inyaJ187M1V5wk9', '', 44),
('1641720047', 'Sistem Informasi Prediksi Stok dan Utilitas Gudang', 'INFORMATION SYSTEM', 'Metode Markov Chain', 'Metode Class Based Storage Policy', 'Sudah ada tanda tangan pembimbing', 19, 'PT. Keramik XYZ merupakan salah satu perusahaan industri keramik, yang mana mereka memproduksi 2 macam keramik yaitu, keramik lantai dan keramik dinding. Pada keramik dinding terdapat beberapa masalah yaitu menurunnya minat di pasar pada tipe keramik dinding ini sehingga mengalami penumpukkan keramik pada gudang. Maka dari itu diperlukan aplikasi yang mana dapat untuk memprepdiksi stok keramik dinding di gudang untuk ke depannya apa saja tipe yang paling diminati agar tidak mengalami kelebihan produksi. Dan setelah memprediksi stok keramik dinding , diperlukan juga untuk memprediksi utilitas dari gudang tempat menyimpan stok keramik dinding agar gudang tersebut tidak mengalami kelebihan maupun kekurangan stok di gudang. Jadi perlu diperhitungkan juga untuk penempatan stok keramik dindingnya. Untuk memprediksi stok keramik ditunjang menggunakan Metode Markov Chain sedangkan untuk memprediksi utilitas gudang menggunakan Metode Class Based Storage Policy.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1_hjKzk9tBClVEwrfhSPwyz4w7QuDU7xV', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=15VMSiUzkNrJ7Eo7PNTpaFG1RHCQNYyyu', '', '', 45),
('1641720048', 'Penerapan Metode Design Thinking  pada Perancangan User Interface Aplikasi Kotakku', 'INFORMATION SYSTEM', 'System Usability Scale', 'Desgin Thinking', '', 19, 'Sistem Informasi Kotakku ini adalah sebuah marketplace katering yang akan mempermudah user untuk mencari informasi tentang katering baik dari segi harga, jarak dan lain-lain yang nantinya akan dikemas menggunakan sebuah metode user experience Design Thinking dan pengujiannya menggunakan metode System Usability Scale, dimana permasalahan ini diambil dari sebuah komunitas dan keluarga yang rata-rata susah dalam mencari sebuah katering untuk acara baik untuk aqiqah, pernikahan dan lain-lain.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1DuWalmkQyTkmSi1UNvPtWVzRNhlBZrL3', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1cFhzSpoV9U08AQ41xM6E-FEILWB82jl7', '', '', 46),
('1641720049', 'Impelementasi association analys untuk peningkatan tingkat risiko kredit kendaraan bermotor', 'SISTEM CERDAS', 'SVM', '', '', 11, 'Analisa untuk tingkat risiko kredit bermotor', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1q8W_DD0cF4GRTnuzNWsy3SlGOPotBtxq', '', '', '', 47),
('1641720051', 'PENERAPAN ALGORITMA APRIORI UNTUK MENENTUKAN LOKASI BARANG DI GUDANG\n( STUDI KASUS : PG KEBON AGUNG MALANG)\n', 'INFORMATION SYSTEM', 'Algoritma Apriori', '', '', 16, 'Gudang merupakan bagian yang penting dari suatu proses produksi, dikarenakan gudang merupakan tempat penyimpanan material produksi. Manajemen gudang sangat diperlukan agar aliran rantai pasok dapat berjalan dengan baik. Tata letak juga memegang peranan penting dan memiliki banyak dampak strategis bagi perusahaan. Tata letak mempengaruhi perusahaan dari segi kapasitas, aliran material, fleksibilitas, biaya, kualitas lingkungan kerja, dan lain sebagainya. Kemudahan dalam mengambil dan meletakan barang merupakan suatu yang sangat  penting  dalam  tata  letak  gudang  dalam  sebuah  perusahaan  agar  tidak  ada kesalahan  dalam  pengambilan  dan  peletakan  produk-produk  yang  disimpan  oleh perusahaan didalam gudang. (Benedictus Rahardjo,2017)\nPG Kebon Agung sendiri merupakan perusahaan yang bergerak di bidang industri gula, PG. Kebon Agung Malang memiliki bagian-bagian tersendiri pada setiap bidang termasuk bagian Gudang, di gudang PG. Kebon Agung terdapat banyak rak dengan berbagai barang untuk kebutuhan pabrik. Pada bagian gudang belum tersedia sistem yang dapat digunakan untuk melakukan penentuan lokasi barang di gudang, sehingga penataan barang di gudang masih belum optimal. Dengan permasalahan tersebut diperlukan sistem untuk melakukan penataan barang di gudang, sehingga penataan  barang setiap rak akan lebih efisien. Untuk penataannya sendiri berdasarkan frekuensi barang yang sering di ambil atau barang keluar sehingga barang yang sering di ambil akan berada di rak paling depan. Di dalam sistem juga akan menampilkan denah gudang, sehingga memudahkan pegawai gudang dalam melakukan penataan barang dan pencarian barang.\n', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1qiZfVjy6gfR3Vbcr4rLp2j5UzdCWD2n1', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1BhinJS5WsOqHHBh3uvkKZ_ySwLxfpdeA', '', 48),
('1641720052', 'SISTEM PERAMALAN DAN PEMANTAUAN JUMLAH  PRODUKSI IKAN BERBASIS WEB DENGAN METODE Autoregressive Integrated Moving Average(ARIMA)\n(STUDI KASUS DINAS PERIKANAN KAB.MALANG )', 'INFORMATION SYSTEM', 'ARIMA', '', '', 18, 'Meramalan jumlah produksi ikan kabupaten malang  setiap bulanya, disini terdapat dua pengguna yaitu admin dengan user, user hanya bisa melihat permalan jumlah produksi ikan setiap bulanya n dan juga tampilan data jumlah produksi setiap bulanya. tujuanya dari peramlan ini untuk menimalisisr terjadinya overproduksi diKabupaten Malang.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1NIcb4NzZ7FGMyQXeB-EEuGRplmvyN_h1', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1T_xCtG2dOJjp2KVM_c0CtxmPX8SVqOIi', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1O8b06R6hv7b1Qe5WRpesIsj5-z1FmKJ3', '', 49),
('1641720053', 'Implementasi instant update pada hybrid mobile development menggunakan dynamic loading bundle', 'INFORMATION SYSTEM', 'dynamic loading bundle', '', '', 20, 'setiap kali ada perubahan pada aplikasi android, seperti perbaikan atau penambahan fitur, maka pihak playstore akan melakukan proses peninjauan ulang terhadap APK yang telah diupload, hal ini membutuhkan waktu berhari - hari hingga berminggu - minggu, sehingga perubahan tersebut tidak dapat langsung diterima oleh pengguna aplikasi\n\ndisini saya akan membuat platform yang dapat melakukan perubahan pada aplikasi android yang dibangun menggunakan hybrid mobile development, tanpa harus melalui proses peninjauan ulang pada playstore, sehingga apabila ada perubahan, maka pada saat itu juga pengguna dapat menerima perubahan tersebut', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1bZCAaApacNOqFHWlUxcJph9GDgzCvZ5x', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1YphNHabJ2aNbeMS2cm7FS7ISv8A3NVF4', '', '', 50),
('1641720054', 'Klasifikasi Mutu Telur Burung Puyuh Berdasarkan Tekstur dan Warna Menggunakan Metode K-Means Clustering (Studi Kasus NS Quail Farm)', 'COMPUTER VISION', 'K-Means Clustering', 'Threshold Otsu', '', 16, 'Salah satu peternakan yang melakukan ternak burung puyuh ini adalah NS Quail Farm. Burung Puyuh yang diternakkan pada NS Quail Farm yakni Blaster. Produktifitas Burung puyuh cukup tinggi dalam per tahun satu burung puyuh dapat menghasilkan 250-300 butir telur, Burung Puyuh dapat menghasilkan setidaknya satu butir telur dalam waktu satu hari. Pada umumnya burung telur puyuh ini berwarna putih dengan memiliki bintik-bintik berwarna hitam pada cangkang telurnya. Panen telur burung puyuh dilakukan setiap hari pada waktu pagi atau sore hari. Telur-telur yang sudah di ambil kemudian di seleksi, seleksi dilakukan dengan cara memisahkan telur dengan kualitas yang baik dan jelek. Menurut hasil wawancara dengan salah satu pegawai di peternakan NS Quail Farm, kualitas telur burung puyuh dapat dilihat bedasarkan tekstur pola pada kulit telur burung puyuh dan juga warna pada kulit telur burung puyuh. Pada proses pemilihan telur dapat meningkatkan tingkat kualitas produksi pada peternakan NS Quail Farm. Penilaian kualitas yang dilakukan pada peternakan NS Quail Farm masih dilakukan dari prespektif para pekerja. Selain membutuhkan waktu yang cukup lama dalam proses pemilihan telur burung puyuh ini, penilaian para pekerja dalam melakukan pemilihan telur dengan kualitas yang baik berbeda-beda antara pekerja yang satu dan pekerja lainnya. Dari permasalahan tersebut dilakukan peneliti akan membuat suatu aplikasi yang dapat memngelompokkan mutu dari telur burung puyuh yang dilihat dari tekstur dan juga warna telur burung puyuh. ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1n4r80Zk_BLFdL5LFOA6Npfjv1nf9-QB_', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1ak0Vzu1BKaJhnmRxa4rtcEJKLZHwphQf', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1T1froMONcQQt9ufy-uK9Q4OV8MMgoXs3', '', 51),
('1641720055', 'Sentiment Analysis Terhadap Object Wisata Alam Kota Malang Di Instagram Dan Facebook Menggunakan Metode Naive Bayes Dan Support Vector Machine.', 'INFORMATION SYSTEM', 'Naive Bayes Dan Support Vector Machine', '', '', 12, 'Membuat sistem informasi sebuah objek wisata yang di ambil dari sebuah komentar instagram dan facebook dari komentar tersebut data di ambil lalu akan di urutkan berdasarkan ulasan positif', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=15n3qlRmqOu4u86ojjhHkbQeeNJCNHPVf', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1qziDnFulc1fgh15KQIQEkLfvfZj_Mt1i', '', '', 52),
('1641720056', 'Penerapan Metode Cosine Similarity Pada Aplikasi Ujian Online Essay Otomatis', 'SISTEM CERDAS', 'Cosine Similarity', '', '', 8, 'Dalam skripsi yang penulis akan susun nantinya, akan membuat sistem penilaian ujian essai otomatis yang dimaksudkan agar memperoleh hasil penilaian yang objektif tanpa ada tambahan faktor eksternal yang sifatnya mungkin kurang adil bagi sebagian orang. Dimana dalam penyusunannya, penulis menggunakan Metode Cosine Similarity.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1ykV_XAFSM2lFeOawLVNmkWzYY7kfVfd8', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1TiSGw8ru2OZ_T5QO0X2WZFs-nmpt_UFE', '', '', 53),
('1641720058', 'SISTEM PENDUKUNG KEPUTUSAN BERBASIS ONTOLOGI UNTUK PEMILIHAN PEMAIN YANG TEPAT SESUAI ROLE PADA TIM PUBG MOBILE MENGGUNAKAN METODE ANP DAN BORDA', 'SISTEM CERDAS', 'Analytic Network Process', 'Borda', '', 12, 'Awalnya saya melihat permasalahan yang ada disekitar saya yaitu ketika tim Esport di kota Malang akan membuat tim baru dan mereka kesulitan mencari pemain dengan kriteria yang sesuai, dari sini saya ingin mewujudkan pembuatan sistem pendukung keputusan untuk pemilihan pemain mereka agar sesuai dengan kriteria yang diinginkan.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1piFZAhSfotYQp8CmyLzSuT0XPIFXcVMF', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1YJ_J9SEDHyk11hXdaItxi-WGSucvyAh0', '', '', 54);
INSERT INTO `v2_proposal` (`nim_pengusul`, `judul_proposal`, `nama_grup_riset`, `literatur_utama`, `literatur_penunjang`, `catatan_khusus`, `id_dosen_pembimbing_1`, `deskripsi`, `form_kesediaan`, `draft`, `revisi_draft_1`, `revisi_draft_2`, `id`) VALUES
('1641720059', 'Sistem Pakar Diagnosa Awal Penyakit  Kucing Berbasis Ontologi dengan Metode Dampster-Shafer', 'SISTEM CERDAS', 'Dempster-Shafer', '', '', 12, 'sistem pakar ini dapat membantu pemilik/pemelihara kucing mendiagnosa awal penyakit  kucing dengan melihat gejala - gejala yg terjadi pada kucing tersebut. Sistem pakar ini dibuat dikarenakan banyak pemilik kucing yg tidak tahu gejala awal yg terjadi jika kucing tersebut sakit dan mereka baru menyadari kucing mereka sakit saat terjadi perubahan yg signifikan pada kucing tersebut dan juga alasan lain dikarenakan minimnya klinik hewan yang buka operasional secara 24 jam, selain itu sistem pakar ini dibuat agar dapat mengetahui dan memahami jenis penyakit kulit pada kucing yang mereka pelihara.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1LPuT9AClClY8ceBKBjaoGB6IL1JCcyJn', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1iPw1lc5AwPDmCqny5Aw1gGnTfvCt3EcF', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1VS96t_v4VPqLdl6_nWhB3JdT8Gx02V1g', '', 55),
('1641720060', 'Sistem Pendukung Keputusan Prioritas Pembangunan Daerah Dengan Metode AHP dan PROMETHEE (Studi Kasus di Kec.Semanding Kabupaten Tuban)', 'INFORMATION SYSTEM', 'AHP dan PROMETHEE', '', '', 21, 'Mencari prioritas pembangunan daerah di setiap nama desa/tempat/daerah yang ada di kecamatan semanding kabupaten tuban, nantinya setiap desa/tempat/daerah akan di cari mana yang di dahuluin untuk di bangun fasilitas umum ataupun perbaikan fasilitas, untuk pemerataan pembangunan di setiap daerah', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=176sEYNzGyVgPUkZSC9Ph_MRDKws7PyLK', '', '', '', 56),
('1641720064', 'Implementasi Metode Case-based Reasoning Untuk Sistem Pakar Diagnosa Penyakit Pada Organ Genitalia Wanita', 'SISTEM CERDAS', 'Case-based Reasoning', 'K-Nearest Neighbor', '', 15, 'Membantu memberi informasi bagi wanita yang memiliki masalah atau merasakan gejala kurang nyaman pada area genitalia. Karena tidak jarang wanita malu untuk berkonsultasi secara langsung dengan dokter.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1fmmswInkq0Dun5UgxtsCzQHFe8IgQtqt', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=12eqb0T4CE14d7X6zttIlQgx-y6NIq50l', '', '', 57),
('1641720065', 'Implementasi Business Intelligence pada Data PDDikti untuk Menganalisa Pengembangan Program Studi', 'SISTEM CERDAS', 'Metode Support Vector Machine dengan Sequential Minimal Optimization ', '', '', 11, 'Memanfaatkan data PDDikti suatu Universitas dalam analisa Pengembangan Program Studi ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1MMMKZLh3Y5SKqZLAZ119KZaPJ0gR1lLd', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1CSpX8qGvFAyD6frreAOQv-lGNKGaTHVE', '', '', 58),
('1641720067', 'Sistem Supply Chain Management untuk Penentuan Produksi dan Promosi Menggunakan Metode Backpropagation dan WASPAS pada PT. Tiga Serangkai Pustaka Mandiri', 'INFORMATION SYSTEM', 'Backpropagation Neural Network', 'WASPAS (Weighted Aggregated Sum Product Assesment)', '', 8, 'meramalkan penentuan penyiapan bahan baku produksi agar barang tidak out of stok dan menentukan promosi', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1hI8SB1iOATuF1XHs4YK-znl7uZdlLFRF', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1gMvC8zRkywYSS_fXeXFLyDmjUWn1Ffj5', '', '', 59),
('1641720069', 'SISTEM INFORMASI GEOGRAFIS BERBASIS WEB UNTUK PEMETAAN LAHAN DAN PRODUKSI APEL MENGGUNAKAN METODE K-MEANS DI KOTA BATU ', 'INFORMATION SYSTEM', 'K-MEANS', '', 'Kurang tanda tangan pembimbing, karena pembimbing masih tugas ke luar kota.', 23, 'Sistem Informasi Geografi (SIG) pemetaan lahan dan klasterisasi produksi apel digunakan untuk penyampaian informasi yang tepat dalam memberikan data lokasi pemetaan lahan perkebunan buah apel dan klasterisasi produsksi apel di Kota Batu. Sistem ini dapat memudahkan seorang investor untuk membeli lahan perkebunan atau berkerjasama dengan pemilik kebun apel setelah melihat kondisi jumlah produksi (klaster) setiap kebun dan juga memudahkan Dinas Pertanian dalam mengelola keberadaan persebaran lahan perkebunan apel di Kota Batu', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1WvIB5ttFJjcM4o1w8THG6cyx8UOr0bll', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Dt9pAIl0RAgyLkCfqcqLLvkf4rqqolwe', '', '', 60),
('1641720070', 'SISTEM PERAMALAN KEBUTUHAN PEGAWAI KATERING BERDASARKAN JUMLAH PESANAN MENGGUNAKAN METODE FUZZY TIME SERIES\n( STUDI KASUS KATERING DEWI SRI REJEKI )', 'INFORMATION SYSTEM', 'Fuzzy Time Series', '', '', 16, 'Katering merupakan usaha kuliner penyediaan makanan, usaha katering ini biasanya di butuhkan ketika ada acara seperti hajatan, pernikahan, sunatan, reuni dan lain sebagainya. Katering menjadi pilihan banyak orang karena dengan katering, tidak perlu repot-repot lagi memasak untuk para tamu undangan ataupun untuk komsumsi pribadi. Padatnya kesibukan masyarakat Indonesia membuat kurangnya waktu untuk melakukan pemasakan dalam jumlah besar dan disaat waktu yang mendesak, dan ketatnya persaingan dibidang katering yang semakin meluas (Irwana Dewi, 2019) \nSeiring  besarnya dan bertambahnya konsumen pemilik bisnis membuat inovasi baru yang belum pernah ada sebelumnya,sehingga bisnis catering tidak hanya melayani penyediaan makanan untuk acara pesta melainkan juga melayani untuk rumahan,perusahaan juga fokus dalam penyediaan jenis makanannya.(Wulan Ayodya 2008). \nDalam usaha katering beberapa di antaranya memulai dari rumah berkembang terus hingga mengalami peningkatan .peningkatan usaha memerlukan kerja yang meningkat pula, dalam kerja operasional katering pemilik usaha dibantu oleh beberapa tenaga kerja bergantung pada skala kateringnya. Dalam mengelola usaha Katering (Wulan Ayodya 2016)\nTidak ada hitungan baku untuk menentukan jumlah karyawan membuat usaha katering kebingungan untuk menentukan pegawai sesuai kebutuhan pesanan  . Oleh karena itu, peneliti akan membuat sebuah aplikasi yang digunakan untuk meramalkan pegawai berdasarkan jumlah pesanan\nBerdasarkan uraian diatas, Penelitian ini mengambil judul â€œSistem Peramalan Kebutuhan pegawai Katering berdasarkan jumlah pesanan menggunakan metode Fuzzy Time Seriesâ€sehingga dapat memudahkan dalam menentukan pegawai katering sesuai jumlah pesanan.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1geS_s-VKfl5xLnf27ghazlG4lGHTuN9G', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1WgocCk7XRsFUVADkeHa1Q8KlYXlw6dXk', '', '', 61),
('1641720071', 'Analisis Sentimen Opini Masyarakat Terhadap Pembangunan Infrastruktur Kota Malang Melalui Twitter Dengan Menggunakan Metode Support Vector Machine', 'SISTEM CERDAS', 'Support Vector Machine', 'TF-IDF', '', 15, 'Melakukan analisa sentimen tentang opini masyarakat terhadap pembangunan infrastruktur yang ada di Kota Malang melalui media sosial twitter yang diharapkan dari hasil sentimen tersebut dapat memberi masukan kepada pemerintah mengenai pembangunan infrastruktur yag ada di Kota Malang, apakah lebih cenderung mengarah ke positif atau negatif.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1vMZpnxsLAAhKKFpNE-LZB9c67I2YBf6S', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1FqcwtoIJBNf2OqXBFv2_o5u4h-ykmMfZ', '', '', 62),
('1641720073', 'implementasi rule based analysis sentiment pada twitter untuk laynan ojek online', 'SISTEM CERDAS', 'rule based', '', '', 7, 'analysis sentiment pada twitter gojek dan grab untuk di ketahui bersentiment positif negatif atau netral, tujuan nya untuk mengetahui kepuaasan pelanggan dari ojek online tersebut. media yang digunakan berupa sosial media twitter, di karenakan banyak nya\nOpini yang disampaikan pelanggan melalui akun resmi twitter Gojek yakni @gojekindonesia dan Grab yakni @GrabId bisa dijadikan alat ukur kepuasan pelanggan terhadap layanan ojek online di kedua penyedia layanan ojek online tersebut dengan menganalisis twitter mereka.\n', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1HWTucT4Mbd8v01x60TWqGZ-gHA6udduY', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Sq_KwJJgItAHCF-a9ZBTBPMpXWy077XS', '', '', 63),
('1641720075', 'Implementasi Media Pembelajaran Pengenalan Hewan Nusantara Mengguanakan Virtual Realty dan Leap Motion Controller', 'MULTIMEDIA AND GAME', 'algoritma fisher yates shuffle', '', '', 6, 'Virtual reality adalah teknologi yang dapat berinteraksi dengan suatu lingkungan yang disimulasikan oleh komputer. Secara teknisnya, virtual reality digunakan untuk menggambarkan lingkungan tiga dimensi yang dihasilkan oleh komputer dan dapat berinteraksi dengan seseorang. Namun saat ini harga untuk VR Headset sendiri masih dijual dengan cukup mahal, dengan harga berkisar 7 Jutaan, Dengan permasalahan yang ada diatas, ada salah satu perangkat yakni Leap Motion Controller, perangkat controller ini dapat mendukung kacamata VR biasa menjadi seperti VR Headset dengan biaya yang lebih terjangkau dengan harga sekitar 2,3 jutaan. \nPenggunaan teknologi Virtual Reality dengan Leap Motion Controller, membuat pengguna dapat melakukan interaksi dengan dunia virtual seolah-olah tangan pengguna merupakan bagian di dalamnya, dan tanpa perlu menggunakan sarung tangan capture melainkan hanya dengan tangan kosong. Untuk mewujudkan bentuk interaksi teknologi ini, penulis memutuskan untuk mengeimplementasikannya kedalam permainan game. ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1zHzW7xmXeAHhJxGMzAWgYVY_UnrrzVtZ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1tskuy0l5zh_AJDzqoRWdAl3t-AVR2i_F', '', '', 64),
('1641720076', 'Rancang dan Bangun Sistem Absensi  Menggunakan Smart Card  RFID Berbasis Website (Studi Kasus : Kelas JTI Politeknik Negeri Malang) ', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'encryption', '', '', 26, 'Membuat sistem absensi kehadiran mahasiswa menggunakan smart card untuk membantu meningkatkan kedisiplinan mahasiswa.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1ct7wx27uUI9RDeieErjk8A93mAUSbngp', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1207RQ4zC3xK2v6ay5Rrw-UGkBgmcS1mP', '', '', 65),
('1641720077', 'Identifikasi kualitas daun bayam dengan fitur tekstur dan warna dengan metode K-Means', 'COMPUTER VISION', 'YUV(warna), K-Means(tekstur)', '', '', 18, 'aplikasi untuk menentukan kualitas sayur bayam dilihat dari kulitas tekstur dan warnanya. sampel diambil dari daun sayur bayam yang di foto, nantinya di olah dengan citra digital sehingga bisa diketahui kualitas sayur bayamnya dengan melihat tekstur dan warna dengan metode YUV(warna) dan K-Means(tekstur).', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1EQqBXemVQBettOT_99mbBFAOIRwXwx3r', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Qo9aSk7w2CwZcx4bBTXkyCwnTWlzY3iH', '', '', 66),
('1641720078', 'PENERAPAN METODE PROFILE MATCHING UNTUK SELEKSI PEMAIN INTI FUTSAL ( STUDI KASUS SMA NEGERI 3 KEDIRI )', 'INFORMATION SYSTEM', 'profile matching', '', '', 21, 'Dalam perkembangan teknologi saat ini tidak bisa dipungkiri bahwa teknologi merupakan salah satu alat pendukung dalam melakukan pekerjaan. Saat ini perkembangan teknologi mulai diterapkan pada berbagai bidang dan salah satu manfaat dari teknologi ini adalah untuk membantu dalam melakukan pengambilan keputusan, pengambilan keputusan merupakan proses pemilihan alternative tindakan yang bertujuan untuk mencapai tujuan tertentu, dengan melakukan pengumpulan data yang diubah menjadi informasi serta ditambah dengan kriteria-kriteria  yang  perlu  dipertimbangkan dalam sebuah pengambilan keputusan. \n\nBerdasarkan permasalahan di SMA Negeri 3 Kediri yang mana pemilihan pemain inti masih dengan cara manual berdasarkan penilaian kriteria-kriteria yang sudah ditentukan oleh pembimbing ektrakulikuler. Sehingga dibutuhkan sebuah metode yang tepat untuk seleksi pemilihan pemain inti futsal. Ada banyak metode yang bisa dipakai dalam mengambil keputusan, salah satu metode yang dapat dipakai yaitu metode Profile Matching. Konsep metode Profile Matching yaitu metode pengambilan keputusan dengan mengasumsikan bahwa terdapat tingkat variable predictor yang ideal yang harus dipenuhi oleh subyek yang diteliti, bukannya tingkat minimal yang harus dipenuhi atau dilewati (Kusrini, 2007).  Metode Profile Matching sangat cocok digunakan dalam upaya manajemen SDM (Sumber Daya Manusia), karena dalam proses metode Profile Matching secara garis besar merupakan proses membandingkan antara kemampuan individu ke dalam kompetensi yang harus dicapai dalam suatu jabatan/posisi. Dari perbandingan tersebut dapat diketahui perbedaan kompetensinya, sehingga akan mendapatkan alternatif yang baik. Dengan demikian, metode ini dapat menyelesaikan masalah yang terjadi pada SMA Negeri 3 Kediri dalam menerima dan menempatkan posisi pemain inti dalam ektrakulikuler futsal', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1QkVC2ZE9AinuWcFAYEg8ztYmonxvGzCD', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1MVmF81WzbSe2Qe9dmnfxYCzDhiGQVUBB', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=11dU-RspCpAkQ2MHaco4fT3X4FUNY7mNm', '', 67),
('1641720079', 'Pengembangan Sistem Pakar Diagnosis Penyakit Kelinci Dengan Metode Case Based Reasoning', 'SISTEM CERDAS', 'Case Based Reasoning', 'K-Nearst Neighbor', '', 17, 'Dalam skripsi ini saya mengambil group riset yaitu Sistem Cerdas yang berjudul Pengembangan Sistem Pakar Diagnosis Penyakit Kelinci Dengan Metode Case-Based Reasoning. Dalam sistem pakar ini diharapkan aplikasi dapat membantu peternak kelinci dan pemilik kelinci dalam mmendiagnosis penyakit dan mendapatkan penanganan pertama saat kelinci terserang penyakit. Sistem ini digunakan oleh peternak dan pemilik kelinci. Sedangkan pakar yang diambil yaitu dokter hewan. dalam judul ini sebelumnya skripsi sudah pernah ada, namun disini saya kembangkan lagi  dengan metode yang lain. metode yang saya gunakan ini bekerja dengan cara mengklasifikasikan penyakit dengan banyak pola kemiripan gejala yang sudah ada.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1KS4-eGga4X0mmN52Ds5gRB2FbfKBkLiI', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1F-b4hh7yzCQRIfAcZTuNDjxOR0ymPSSI', '', 68),
('1641720080', 'Implementasi GraphQL Untuk Mengatasi Under-fetching pada Pengembangan Sistem Informasi Pelacakan Alumni Politeknik Negeri Malang', 'INFORMATION SYSTEM', 'GraphQL', 'REST API', '', 20, 'Saya ingin mengimplementasikan GraphQL pada Sistem Informasi Pelacakan Alumni di Politeknik Negeri Malang yang akan saya bangun untuk mengatasi under-fetching yang menjadi masalah pada performa di metode REST API.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=106tCXSY_RNyEV5l-KxLdcRU_tcxamTQM', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1ZVQa-pnISsPo0T_A7ECPUW_93_oWDJTb', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1bXpBCKGccVtKtmBPvNa_ZiwUrbgJSNTW', '', 69),
('1641720083', 'Pengenalan Hama Kutu Batang Pada Tanaman Apel (studi kasus dusun gerdu Tulungrejo kecamatan Bumiaji kota batu)', 'SISTEM CERDAS', 'KNN (K-Nearest Neighbor)', '', '', 5, 'Citra digital adalah citra yang dapat diolah oleh komputer. Yang disimpan dalam memori komputer hanyalah angka-angka yang menunjukkan besar intensitas pada masing-masing piksel. Disini saya mengambil studi kasus yang terdapat di dusun gerdu, desa Tulungrejo kecamatan Bumiaji kota batu, permasalahan sebagian kebun apel terkena hama kutu batang atau kutu sisik, menyerang sebagian batang apel ditandai dengan jamur pada batang dan bintik merah, tujuan sistem yang saya buat adalah untuk mengidentifikasi hama yang menyerang tanaman apel menggunakan foto atau citra berdasarkan warna pada batang apel agar dapat mengetahui khususnya tanaman apel ini terserang hama atau tidak.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Iho2dvbsSgPimmUOcpESDNE22pKBBq6a', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1z4dH2XipW8dBU30BrD_3qAtqFoM2gcWZ', '', '', 70),
('1641720085', 'Metode Deseasonalized dan Double Exponential Smoothing Untuk Menganalisis Peramalan Jumlah Pengunjung Tempat Fitness', 'INFORMATION SYSTEM', 'Double Exponential Smoothing', 'Deseasonalized', '', 8, 'Saya ingin membuat website sistem informasi sebuah Gym di Kota Malang yang berisikan tentang informasi-informasi terkait dengan gym tersebut dan dapat dijadikan untuk sarana promosi agar dapat mencakup pelanggan lebih luas. Website ini juga dapat berguna sebagai pengganti buku dalam kegiatan pencatatan pengunjung setiap harinya agar mempermudah pendataan dan dapat mengurangi penggunaan kertas, karena sekarang di lapangan masih menggunakan buku untuk mencatat pengunjung yang datang setiap hari. \n\nDidalam website tersebut terdapat pula halaman admin yang dapat mengatur keseluruhan website, dan juga untuk menginputkan data-data gym yaitu data member dan data jumlah pengunjung setiap beberapa periode. \n\nData jumlah pengunjung di website ini dapat melakukan perhitungan peramalan untuk meramalkan jumlah pengunjung gym tersebut dalam beberapa periode menggunakan dua macam metode, dari hasil kedua peramalan tersebut nantinya dapat dibandingkan untuk hasil yang lebih akurat. Hasil output data itu dapat dijadikan laporan untuk pemilik gym setiap bulannya dan diharapkan dapat menjadikan patokan pemilik gym tersebut untuk menentukan sebuah keputusan di kemudian hari.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Q81pCQ0n8OtS4x5FHgnE0eOHYk5bFmHD', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1fMXivA6THTHCD_0U3vFpBVMhFI3t92dR', '', '', 71),
('1641720087', 'SISTEM INFORMASI REKOMENDASI PEMILIHAN PERUMAHAN DI KAWASAN KABUPATEN MALANG', 'INFORMATION SYSTEM', 'Metode ARAS (Additive Ratio Assessment)', '', 'Hanya penamaan Judul Skripsi masih belum fix karena menunggu konfirmasi dari pembimbing (masih tugas ke luar kota), tetapi untuk topik skripsi sudah fix.', 10, 'User dalam memilih perumahan sebenarnya tidak akan mendapat masalah jika hanya terdapat satu pilihan. Namun karena banyaknya pilihan perumahan yang memiliki kriteria yang sesuai dengan keinginan user, maka akan menimbulkan berbagai pertimbangan. Pertimbangan yang dimaksud disini adalah dari segi kriteria. Terkadang kriteria tersebut saling bertentangan seperti perumahan dengan harga yang mahal tetapi dekat dengan fasilitas publik atau perumahan dengan harga yang murah tetapi jauh dari fasilitas publik dan sekolah. Sehingga dapat diartikan bahwa satu kriteria dapat terpenuhi namun kriteria yang lain tidak dapat terpenuhi dan juga dibutuhkan detail informasi terkait perumahan yang ada. Maka dari itu atas permasalahan yang ada dibutuhkan solusi untuk mendapatkan hasil pilihan yang optimal dengan mempertimbangkan semua faktor yang ada. Solusi tersebut berupa pembuatan aplikasi Sistem Informasi Rekomendasi Pemilihan Perumahan Di Kawasan Kabupaten Malang. Pada aplikasi ini menggunakan metode algoritma ARAS (Additive Ratio Assessment), Karena metode ARAS lebih mudah dalam melakukan perangkingan dengan cara membandingkan alternatif lainnya sehingga mendapatkan hasil yang ideal dan terbaik, mencakup sistem fisik, sistem keputusan dan sistem informasi.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1CrhCErrdhzTRtUebANbM6AsamqLbnZQl', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1_rNVp9XGK8hLr5DFTz1J_R7THQc2wnls', '', '', 72),
('1641720088', 'Segmentasi Pelanggan Menggunakan Metode K-Means dan DBSCAN Dengan LRFM Model Untuk Mendukung Strategi Pemasaran (Studi Kasus PT. Bisturi Pratama)', 'INFORMATION SYSTEM', 'K-Means', 'DBSCAN (Density-Based Spatial Clustering of Application with Noise)', '', 12, 'Melakukan segmentasi pelanggan untuk menunjang strategi bisnis pada perusahaan dengan menerapkan model LRFM  (Length, Recency, Frequency, Monetary) untuk menentukan strategi, dan menggunakan metode DBSCAN dan K-Means untuk melakukan pengelompokkan pelanggan berdasarkan data penjualan perusahaan, kemudian hasil dari pengelompokkan yang didapatkan akan digunakan untuk menunjang keputusan strategi bisnis pada perusahaan PT. Bisturi Pratama.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1of-5VDnQnyREC6BxduAc3CeDYvR1YaMb', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1kJMaUU_XpBExF7b-QIRJpV2bYVZPRy5S', '', '', 73),
('1641720089', 'Implementasi Jaringan Saraf Tiruan Menggunakan Metode OPELM Untuk Memprediksi Volume Impor Kedelai Nasional', 'INFORMATION SYSTEM', 'Metode OPELM', '', '', 9, 'Pada penelitian ini untuk memprediksi volume impor kedelai nasional akan dilakukan implementasi jaringan saraf tiruan menggunakan metode OPELM. Data yang digunakan dalam penelitian ini adalah Jumlah impor kedelai, produksi, konsumsi, dan harga domestik yang menjadi data masukkan, dan data impor kedelai menjadi data target. Data yang akan digunakan dalam penelitian ini diperoleh dari Badan Pusat Statistik, dan Kementerian Perdagangan Republik Indonesia.Untuk evaluasi performa metode Optimally Pruned Learning Machine (OPELM) dengan menggunakan MAPE. Hasil prediksi dari penelitian ini adalah volume impor kedelai pada tahun mendatang.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1RM72ZdMktvz0St_F9SzxRN04w7OVk62I', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1csXLZxn6dPuo0r0NHy2LxAkhDC8ShwWp', '', '', 74),
('1641720090', 'Sistem Monitoring dan Controlling Pakan Ikan Koi Secara Paralel untuk Persediaan Pakan Berbasis IOT', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'IOT', '', '', 17, 'Saya ingin membuat alat untuk pakan ikan koi otomatis secara paralel, yang dimaksud dengan paralel yaitu tidak hanya satu alat saja tetapi bercabang, alat tersebut bisa di kontrol dan di monitoring oleh user atau penggunanya, tujuan nya agar bisa mempermudah user untuk mengontrol alat tersebut apa sudah waktunya ikan koi tersebut diberi makan atau belum dan untuk memonitoring yaitu mengetahui dan memantau sisa makanan di wadah alat tersebut, sehinggan user bisa tau apa persediaan pakan ikan koi tersebut masih ada atau sudah habis.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1PcqIvbeebwKqwz52WM0sJoBpu39uBRhL', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1beCEvC_I5qsRVjxpsfnza96HVkYt0C77', '', '', 75),
('1641720091', 'Identifikasi Kesegaran Ikan Laut Berdasarkan Citra HSV dan Morfologi', 'COMPUTER VISION', 'Hue-Saturation-Value (HSV)', 'Morfologi', '', 9, 'Pada sistem yang bakalan saya buat untuk identifikasi kesegaran ikan laut yang baik untuk dikonsumsi khususnya pada ikan Tongkol. untuk identifikasi yang saya lakukan melalui 2 metode yang pertama untuk pengecekan warna dan kedua melalui tekstur ikan, pada pengecekannya saya hanya melalui mata ikan saja tidak untuk seluruh badan ikan.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1gfuaK-tbfp8ZYKmo6eCvQbg2TnMi_Zf9', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1x0RjCDWT_AlcR9I50z6LVPjSnNhc0Rhy', '', '', 76),
('1641720093', 'Sistem Rekomendasi Resep Masakan Berdasarkan Bahan Masakan Menggunakan Metode Case Based Reasoning Dengan Algoritma Adjusted Cosine Similarity', 'SISTEM CERDAS', 'Case Based Reasoning', 'Algoritma Adjusted Cosine Similarity', '', 24, 'Sistem Rekomendasi Resep Masakan Berdasarkan Bahan Masakan Menggunakan Metode Case Based Reasoning Dengan Algoritma Adjusted Cosine Similarity', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1cGUx_Sl_fGfKtvBSKj-A76WVTUFbkmHu', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=11H0Vgls4iHxe23FfjS8NkN3ouU8ziTXQ', '', '', 77),
('1641720094', 'Deteksi Kualitas Biji Jagung Manis Layak Jual dari Tekstur dan Warna dengan metode RGB dan K-Means Clustering Menggunakan Pengolahan Citra Digital\n( STUDI KASUS Pada UD. Annur Sejahtera )', 'COMPUTER VISION', 'Warna HSV dan Metode K-Means ', '', '', 18, 'Mendeteksi kualitas biji jagung manis yang layak untuk dijual. Selama ini pengevaluasian terhadap Jagung masih banyak menggunakan cara manual dan mengandalkan Indra Penghilatan dan sebagainya. Indra manusia memiliki kelemahan dan keterbatasan contohnya seperti perbedaan pendapat terhadap warna, kurang teliti, lelah dan tidak fokus pada saat evaluasi sehingga menghasilkan output yang belum tentu konsisten. Dari masalah tersebut terdapat solusi yang dapat membantu manusia untuk pengevaluasian kualitas Biji Jagung Manis yaitu dengan menggunakan Sistem Pengolahan Citra Digital, dimana dirancang memiliki kepekaan terhadap suatu warna dan tekstur. Dalam tugas akhir ini merancang sistem Pengolahan Citra Digital yang dapat membantu untuk mengevaluasi Biji Jagung Manis dari warna dan tekstur. Sehingga dapat menunjang produktifitas dan meningkatkan kualitas daya jual. \n\n', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1qAnWfZwFtAZyK0CIF5WPZ_nAXnNspg1M', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1wRDyTpP4_W1BLUfpNA5yJLcFDF1ZJoDf', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1ZDnRdgXHd0al_Thj5TcLBpTnRGk5WU8h', '', 78),
('1641720096', 'Rancang Bangun Sistem Monitoring dan Controlling pada Budidaya Jamur Tiram Berbasis IoT (Internet Of Things)', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Fuzzy Sugeno', '', '', 15, 'Sistem ini menggunakan inputan dari sensor DHT22. DHT22 adalah sensor yang dapat mengukur kelembapan dan temperatur disekitarnya. Dari beberapa inputan tersebut memiliki parameter yang akan digunakan sistem untuk mengolah data. Parameter dari kelembapan yaitu kering, lembab, dan basah. Parameter dari temperatur yaitu panas, sejuk, dan dingin. Data dari inputan akan diolah oleh ESP32 yang kemudian di deteksi oleh fuzzy sugeno untuk menentukan output yang berupa penyemprotan, penyalaan lampu, atau penyalaan kipas sehingga kelembapan dan temperatur pada kumbung jamur terjaga. Selain itu sistem ini juga bisa monitoring kelembapan dan temperatur pada kumbung jamur melalui browser sehingga petani tidak perlu mengecek kumbung jamur secara langsung. Diharapkan dengan adanya sistem ini dapat membantu petani jamur tiram dalam melakukan monitoring atau controlling kelembapan dan temperatur pada kumbung jamur tiram.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1RTsg4q7jZi95dYHVJWN-EFOt6dLKp_tW', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1f_44jW8QAXQrVNrXqHvCuG9M6STMkIG2', '', '', 79),
('1641720097', 'Aplikasi Chatbot Pada Sistem Informasi Penyewaan Scaffolding Dengan Menggunakan Metode TF-IDF', 'INFORMATION SYSTEM', 'TF-IDF', 'NLP, Cosine Similarity, Recall dan Precission', '', 6, 'Chatbot untuk menggantikan peran admin saat customer menanyakan mengenai penyewaan scaffolding dan sistem akan segera menjawab pertanyaan dari customer.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1j4Vscqau8wj5SEC5_cr-YCAakCwIHAMN', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=19OEP-jDNeNKWBTynJqnB5-EEjWiv5I4f', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1m85iomUzi3PSmlVyGubuUbQ2ZRlNvxLE', '', 80),
('1641720098', 'Peramalan Produksi Kopi di PT Margosuko dengan Metode OPELM', 'INFORMATION SYSTEM', 'Metode OPELM', '', '', 1, 'Skripsi saya adalah tentang peramalan produksi kopi yaitu untuk meramalkan jumlah produksi kopi di tahun berikutnya dengan metode OPELM', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1v1il7YfM2E1F-QYohuC0YU1gp8fPdBNN', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=15MjmRjAd0mrAuBD6IXpY0eKA8OpacwqN', '', '', 81),
('1641720099', 'Implementasi Deep Learning untuk identifikasi batik tradisional menggunakan metode convolutional neural network (CNN)', 'COMPUTER VISION', 'Deep Learning metode CNN', 'Metode Deep Learning CNN', '', 24, 'Pada Skripsi ini akan membahas tentang identifikasi jenis batik tradisional, yang nantinya akan dikembangkan menggunakan salah satu metode Deep Learning yaitu CNN, identifikasi ini mempunyai batasan hanya sampai di batik tradisional saja yang tentunya data-data tersebut akan di training terlebih dahulu kemudian akan dilakukan alur test, sistem tersebut akan bekerja pada mobile dengan cara mengambil objek citra dengan kamera kemudian akan mengidentifikasi dan memberikan informasi jenis batik apa yang telah diambil. selain itu terdapat fitur-fitur untuk pembelajaran tentang batik tradisional.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=11Z9mf7do9KYDfiMVC47UIfwrDnbZ1-NZ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1yx3qUZ80JZkEsUWjhX2k6WXL60UDKVQl', '', '', 82),
('1641720100', 'rekomendasi pembelian handphone menggunakan metode Dinamis Promethee', 'INFORMATION SYSTEM', 'Promethee', '', '', 7, 'membuat rekomendasi handphone jika konsumen kesulitan atau tidak memahami berbagai macam merk handphone dan tipe , saya ingin membantu mereka dalam memilih handphone sesuai yang mereka butuhkan serta spesifikasi handphone tersebut, rekomendasi ini juga akan dibuat secara dinamis, dinamis tersebut kita gunakan di metode promethee dengan merangkingkan kriteria yang dibutuhkan oleh konsumen', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1G1xr_U-yiO1HkX_Xglp_TEahFR1aYy-E', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1a9YLQllDmU3ahrTsVPUAJSNm5U4dooYm', '', '', 83),
('1641720101', 'Penentuan Prioritas Perbaikan Jalan dengan Metode Fuzzy dan ANP (Studi Kasus Kab. Bojonegoro)', 'INFORMATION SYSTEM', 'Metode ANP', 'Metode Fuzzy', '', 21, 'Sistem Informasi Penentuan Prioritas Perbaikan Jalan, diharapkan dapat membantu Dinas Pekerjaan Umum Kab. Bojonegoro menentukan prioritas perbaikan jalan mana yang terlebih dahulu dilakukan, sehingga mengoptimalkan anggaran.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1-lvsX6Otf3jMIIj4f3Y1dglbkI23h-0p', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1cYNzqrOZzzjSkmT7XMy411dieUbmsrgq', '', '', 84),
('1641720102', 'Rancang bangun aplikasi SIAKAD Polinema menggunakan metode User Centered Design berbasis android', 'INFORMATION SYSTEM', 'User Centred Design', 'System Usability Scale', '', 19, 'Membuat sebuah interface aplikasi SIAKAD Polinema berdasarkan pengalaman  dan kenyaman user dengan menerapkan metode User Centred Design.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1_pAwdIvST0fskWUxgV5UKnTjGowE7be2', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1LSXtm3g4PVWJJMKWfbiqUMQNFIeoOWDY', '', '', 85),
('1641720104', 'Penerapan Data Mining untuk Clustering Program Studi dalam Penentuan Tingkatan Kualitas Menggunakan Metode Self Organizing Maps (SOM)', 'INFORMATION SYSTEM', 'Self Organizing Maps', '', 'Kurang tanda tangan pembimbing, dikarenakan pembimbing masih ada tugas ke luar kota.', 23, 'Penerapan Data Mining untuk Clustering Program Studi dalam Penentuan Tingkatan Kualitas Menggunakan Metode Self Organizing Maps (SOM) dimana dari 24 program studi di Politeknik Negeri Malang akan di Cluster berdasarkan tingkatan kualitasnya, dimana diharapkan hasil Cluster dengan metode Self Organizing Maps (SOM) dapat digunakan untuk menentukan jenis penanganan perbaikan/peningkatan program studi.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1LEkfJz0KWgB34Pjb0hMfkECGXo5cm7kZ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1enzAxQvD9GOYVXpfK-itLtH3gyKEGAN1', '', '', 86),
('1641720107', 'PENERAPAN FEATURE BASED PADA PERINGKASAN BERITA DARI PORTAL BERITA ONLINE', 'SISTEM CERDAS', 'Feature Based', 'Cross method Latent Semantic Analysis', 'Mohon maaf ganti judul, namun sudah saya konfirmasi kepada pembimbing', 14, 'Menerapkan metode feature based pada peringkasan berita, fiturnya kurang lebih yaitu kesamaan kalimat, kesamaan judul, panjang kalimat, unsur angka, unsur huruf kapital dan lain-lain yang akan diidentifikasi selanjutnya. peringkasan berita diharapkan dapat mempercepat pembaca dalam mendapatkan informasi. metode tambahan terdapat pada kesamaan kalimat yang menggunakan metode cross method latent semantic analysis', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1zDsJEIgUlyvI-obZZKvVQmGSkUNnp-8O', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1mLb3bcba2idfjFOApM32PMZzIsKWX5kM', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1_m-slBYY-uUk4EdojOCNcEgMbwoDKjgX', '', 87),
('1641720108', 'Sistem Pengambilan Keputusan Kelayakan Kredit dengan Metode SAW studi kasus PT.BAF Sidoarjo,Jawa TImur', 'INFORMATION SYSTEM', 'SAW', '', '', 21, 'PT. Bussan Auto Finance (BAF) merupakan sebuah perusahaan yang bergerak di bidang jasa pembiayaan. Masyarakat dapat mengajukan permohonan berbagai macam jenis pembiayaan lainnya seperti multiproduk, mesin pertanian, mobil dan juga Dana Syariah.Permasalahan yang sering muncul dalam penentuan pemberian pinjaman kredit uang tunai ini adalah sulitnya menentukan anggota calon nasabah yang benar-benar berhak menerima pinjaman kredit uang tunai. Menentukan nasabah yang mengajukan pinjaman kredit uang tunai di PT. BAF yang layak menerima pinjaman berdasarkan kriteria-kriteria yang telah ditentukan sehingga akan mendapatkan hasil yang lebih akurat terhapat pemilihan calon kreditur di PT Bussan Auto Finance.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1fHkC5JgnAXy9xIpRGTC6c7Olb-xQwAt_', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1qIWW1oLa6pTm5-HsXLyTsdcGcUYbXwIE', '', '', 88),
('1641720109', 'KLASTERISASI DAMPAK WILAYAH TANAH LONGSOR KABUPATEN & KOTA DI JAWA TIMUR', 'SISTEM CERDAS', 'K-Mean', 'DBI', '', 19, 'klasterisasi dampak dari bencana tanah longsor,data yang diolah berdasarkan variabel yang disediakan oleh data,bertujuan untuk mengelompokkan daerah yang terkena dampak parah untuk upaya pengurangan dampak lebih lanjut.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1UvoGgMTRnzg1XKW_NRO5qNJzL3RWXmm3', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=136OM6ZaVDTH9kj6tWdvmayU1ML1aS7Dy', '', '', 89),
('1641720110', 'Sistem Pendukung Keputusan Menggunakan Metode MOORA dan BORDA dalam penerimaan Karyawan Gudang dan Administrasi\n( STUDI KASUS Pada PT. Andalan Bisturi )', 'INFORMATION SYSTEM', 'MOORA', 'BORDA', '', 6, 'Pada studi kasus saya di PT. Andalan Bisturi, sistem penerimaan pekerja yang ada pada perusahaan tersebut terutama untuk bagian gudang dan administrasi masihlah sangat tradisional dengan cara admin/HRD mengecek satu persatu nilai dari transkrip dari masing masing pelamar yang dikirim lewat online. Pemeriksaan nilai dari transkirp dan poin poin yang dibutuhkan dalam perekrutan ini dilakukan melewati wawancara langsung dengan pelamar. Sehingga pencarian karyawan pada perusahaan tersebut cenderung lama dikarenakan banyaknya pelamar. Sistem tersebut sangatlah tidak efektif dan efisien dalam penerimaan karyawanya.\nDengan adanya sistem yang saya buat ini, maka admin/HRD dapat dengan mudah melakukan penerimaan karyawan tanpa melakukan pemanggilan semua karyawan atau pengecekan berkas untuk pembandingan masing masing karyawan. Sistem yang saya buat ini untuk penggunaanya, untuk pertama ialah admin melakukan input data untuk masing masing pelamar. Kemudian setelah melakukan input data lalu sistem akan melakukan perangkingan antar pelamar tersebut sehingga dapat diketahui siapa pelamar yang memiliki potensi dan cocok dalam memenuhi poin poin yang dibutuhkan dalam bidang tersebut. Kemudian selanjutnya akan dipanggil beberapa karyawan yang dibutuhkan untuk melaksanakan pemanggilan wawancara interview hingga penerimaan pegawai. Sehingga dengan adanya sistem ini admin/HRD dapat menghemat waktu dan biaya dalam pencarian pelamar dan pelaksanaan wawancara pada perusahaan PT. Andalan Bisturi.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1o7EdJrmQ9ZPBeZ9ZX5-0Zy3YzoHaUUVy', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1cJsk8LlC-MGqDyZXMYSg4acEJInc3_ZJ', '', '', 90),
('1641720111', 'Rancang dan Bangun Internet of Thing (IoT) Sistem Informasi e-Payment Menggunakan RFID Berbasis Website ( Studi Kasus : Kantin JTI Politeknik Negeri Malang )', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Metode Kriptografi', 'Metode enkripsi RSA atau Hash', '', 9, 'Saat ini dibidang pemasaran masih menggunakan pembayaran uang dalam bentuk fisik dan mengakibatkan susahnya pengembalian uang lebih dan panjangnya antrian, konsumen menginginkan metode pembayaran yang praktis dan cepat untuk mempersingkat waktu dalam transaksi.\n\nHadirnya teknologi RFID ini dapat membuat transaksi lebih praktis dan cepat dalam artian pelanggan tidak lagi membawa uang dalam bentuk fisik untuk melakukan transaksi. Transaksi ini juga lebih efesien dan cepat karena hanya perlu menempelkan smart card ke RFID Reader yang terdapat di kasir. Pengunjung juga dapat melihat saldo yang telah disediakan dimeja kasir. E-payment berbasis RFID ini juga membantu kasir, keuntungan dari kasir adalah untuk mendapatkan pemasukan keuangan yang lebih besar dikarenakan adanya sistem TopUp yang jika pelanggan ingin berbelanja maka diharuskan untuk mengisi saldo yang mau tidak mau pelanggan harus membelanjakan isi saldo tersebut, jika pelanggan tidak membelanjakan saldo maka akan adanya pengendapan saldo yang mengakibatkan keuntungan untuk kasir.\n\nSehingga, dengan adanya rancangan sistem pembayaran Â¬menggunakan smart card berbasis RFID ini nantinya pelanggan dapat melakukan transaksi cukup dengan satu kartu saja. Selain itu, catatan melalui web database nantinya juga dapat memudahkan pihak Kantin dalam pencatatan pemasukan penjualan produk yang ada di kantin secara terperinci.\n', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Hk9AvmEHBk2sxgLrqKdWWqGPfvu46q1q', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1UxpF8RPYsK1Hmh0X1ukJo_eNEVuD2OFf', '', '', 91),
('1641720113', 'Text Extraction pada plat nomor kendaraan bermotor berbasis Image Processing', 'COMPUTER VISION', 'Feature Extraction', 'SVM( Support Vector Machine)', '', 20, 'Pada dasarnya skripsi saya ini tentang pengolahan citra digital untuk Text Extraction pada objek plat kendaraan bermotor yang nantinya mengolah image menjadi Text String untuk keperluan projek dosen yaitu smartcard, Pada skripsi saya ini dengan menggunakan metode Feature Extraction dan SVM(Support Vector Machine) diharapkan mendapatkan hasil yang maksimal untuk pengolahan image to text. Terima Kasih', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1jV7kjfbK7oWsm8tw8wIIhjsBulNSMLzU', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1VoYiG3HuLKeU9znik9qEyZIyY4VXtyUW', '', '', 92),
('1641720114', 'Penerapan Metode Gamifikasi pada Aplikasi Mosam(Money Sampah) Berbasis Android', 'INFORMATION SYSTEM', 'Gamifikasi', '', '', 20, 'Dalam skripsi ini saya akan membuat sebuah aplikasi mobile mengenai Money Sampah atau uang dari sampah, yang merupakan salah satu ide fintech yang pernah saya ikutkan lomba hacketon. Sebenarnya aplikasi saya ini butuh IoT namun karena pada IoT tidak ada metode spesifik yang dapat saya terapkan, sehingga saya akan berfokus pada pembuatan aplikasi dari Mosam. Dalam aplikasi ini saya akan menerapkan metode Gamifikasi atau sebuah metode yang telah banyak digunakan pada aplikasi mobile untuk menarik pengguna agar ingin kembali menggunakan, ikut terlibat dan aktif dalam kegiatan dalam aplikasi.\n\nBeberapa hal dari metode Gamifikasi yang dapat diterapkan seperti penawaran poin, voucher, leader board, daily login, pemberian penghargaan jika mencapai misi dan lain sebagainya. Diharapkan setelah aplikasi ini dikembangkan, pada kesempatan berikutnya alat IoT untuk menghitung botol plastik dapat terwujud dan dapat menjadi salah satu terobosan dalam pengurangan sampah botol plastik setidaknya untuk ruang lingkup Jurusan Teknologi Informasi terlebih dahulu.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=19mkiJgY8ppVoKOAzelPGh2KInlKaVKf9', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1gCDjUUAS3XHUTurE7icAeWA_oT_7-awT', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1CBy_UbvuGP_KwKfBMkv3k2u4Kj1elMJS', '', 93),
('1641720115', 'SISTEM PAKAR PERENCANAAN USAHA PETERNAKAN AYAM PETELUR UNTUK MELIHAT KEBUTUHAN MODAL DAN KEUNTUNGAN DENGAN METODE ROUGH SET (STUDI KASUS CV. MITRA MEGASATWA)', 'INFORMATION SYSTEM', 'Rough Set', '', '', 2, 'Hampir semua orang pasti telah mengenal telur ayam ras. Selain karena rasanya yang lezat dan bergizi tinggi , telur ayam ras juga termasuk salah satu sumber protein hewani dengan harga yang relatif terjangkau oleh berbagai kalangan . Tidak heran, jika permintaan terhadap telur ayam ras cenderung meningkat setiap tahunnya. Melihat fenomena tersebut, beternak ayam ras petelur komersial dapat menjadi peluang bisnis yang menguntungkan (Ir. Roni Fadilah, SE, Ir. Fatkhuroji, 2013).\n\nAgar mendapatkan keuntungan secara berkelanjutan, beternak ayam petelur juga perlu kiat-kiat tersendiri. Peningkatan produksi harus menjadi tujuan peternak sepanjang masa jika ingin usahanya tetap berkembang. Di samping itu, tuntutan terhadap inovasi teknologi tidak hanya untuk meningkatkan produksi , tetapi sekaligus mengantisipasi risiko-risiko usaha yang kemungkinan akan terus berkembang dengan semakin kompleknya kehidupan manusia (Dwi Joko Setyono, Maria Ulfah & Sri Suharti, 2013).\n\nPada perusahaan ternak ayam ras petelur CV. MITRA MEGASATWA menerapkan system agribisnis yang dimulai dari penyediaan sarana produksi, subsistem usaha tani (budidaya), subsistem pemasaran dan subsistem jasa layanan pendukung. Sistem agribisnis tersebut memiliki keterkaitan antara satu subsistem dengan subsistem yang lain, sebab apabila salah satu dari subsistem tersebut terganggu maka akan berpengaruh terhadap kegiatan usaha ternak tersebut. Semakin besar jumlah populasi ayam ras petelur tersebut menjadi tantangan tersendiri bagi usaha ternak CV. MITRA MEGASATWA untuk mempersiapkan sarana produksi secara memadai dan tepat agar tidak mengganggu kegiatan usahanya.\n\nBerdasarkan uraian diatas, penulis berniat untuk melakukan observasi skripsi di CV. MITRA MEGASATWA dengan mengangkat judul â€œSistem Pakar Perencanaan Usaha Peternakan Ayam Petelur Untuk Melihat Kebutuhan Modal Dan Keuntungan Dengan Metode Rough Set (Studi Kasus CV. MITRA MEGASATWA)â€ untuk melakukan perencanaan usaha pada peternakan ayam.\n', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=157OhNYZ4H7Yk2vAmj1J7_VvlPJX-gT5u', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1IGU3vXUSISHID9UDG-0tGI7ATtr9RTDf', '', '', 94),
('1641720119', 'Aplikasi Remoting dan Monitoring Smart Room Berbasis Android Menggunakan IoT', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Kriptografi/enkripsi', '', '', 9, 'Pemberian akses pada orang yang dikenal ketika berada jauh dari ruangan, serta melakukan remoting dan monitoring ruangan untuk tindak pencegahan pembobolan ruangan secara paksa', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=13CnrzqSbcMLySYfsWCnsnuhgriXa2wgF', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=15OjzRWso33kgXaVBk3zdsZFzXzY2gQuM', '', '', 95),
('1641720120', 'penentuan pemenang kontes ikan koi berdasarkan penilaian juri dan  juga  penilaian berdasarkan  kriteria dari berbagai pengunjung dengan  menggunakan metode AHP Moora', 'INFORMATION SYSTEM', 'AHP Moora', '', '', 24, 'judul skripsi saya bertujuan ingin membuat  suatu trobosan baru sengam mengaplikasikan nya kapad kegiatan kontes ikan koi, tetapi yang akan menial adalah para pengunjung yang telah memperhatikan setiap ikan yang akan di lombakan, jadi semla penilaian nanti akan digabungkan ole penilaian ole juri yang telah disediakan Oleh panitia kontes nanti nya ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=132b5UZ_fFCsgwOUY-Bd2Dm_H4G4j9_Lc', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=12vDdR5wgBjsu0yAIP13OYg6ph-niwO-m', '', '', 96),
('1641720122', 'ANALISIS PERSEDIAAN GUDANG BUAH APEL DENGAN MENGGUNAKAN METODE TRIPLE EXPONENTIAL SMOOTHING DAN ARIMA ( STUDI KASUS UD. DUA PUTRA)', 'INFORMATION SYSTEM', 'TRIPLE EXPONENTIAL SMOOTHING', 'ARIMA ( Autoregressive Integrated Moving Average ) ', '', 12, 'Sistem peramalan ini di harapkan dapat membantu UD.Dua Putra dalam melakukan pengontrolan buah apel, baik dalam proses pembelian buah apel ke petani maupun pengiriman buah apel ke beberapa pasar. Data sistem peramalan ini diambil berdasarkan data penjualan buah apel ke beberapa pasar. Sistem ini di buat karena pemilik gudang sering kali mengalami kerugian akibat buah apel yang membusuk karena penjualan di pasar yang tidak stabil, sehingga di perlukan suatu sistem peramalan untuk menentukan stok buah apel yang cukup, dengan mengetahui peramalan penjualan di priode yang akan datang pemilik gudang dapat meminimalisir terjadinya kerugian, baik dalam proses pengambilan buah apel dari petani maupun penjualan ke pasar, dan juga mengantisipasi terjadinya kekecewaan pelanggan karena kekurangan stok buah apel di pasar.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1E28Rel90snEN5KYWqJ8AaGQDmeQZBpAJ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Da1OB6m4obhKSvo4EU-dPFxPSwAJ6kzK', '', '', 97),
('1641720123', 'IMPLEMENTASI ENKRIPSI DAN DEKRIPSI DENGAN MEMODIFIKASI ALGORITMA CAESAR CIPHER DAN RAIL FENCE UNTUK TEKS ALFANUMERIK PADA DATA SMART CARD PARKIR', 'SISTEM CERDAS', 'Caesar Cipher', 'Rail Fence', '', 7, 'Pada penelitian Smart Card Parking Politeknik Negeri Malang akan diimplementasikan enkripsi dan dekripsi data pada kartu tersebut menggunakan Caesar Cipher. Dimana enkripsi dilakukan saat memasukkan data ke kartu dari plain text diubah terlebih dahulu menjadi cipher text, dan dekripsi dilakukan saat membaca data pada kartu dari cipher text diubah terlebih dahulu menjadi plain text. Sehingga data pada kartu menjadi aman dikarenakan data hanya bisa diganti dan dibaca menggunakan sistem yang telah diimplementasikan enkripsi dan dekripsi tersebut.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1_SOg2IfOfjc-lYPqwneTBAAUf5KkEF_B', '', '', '', 98),
('1641720125', 'IMPLEMENTASI METODE WASPAS PADA SISTEM PENDUKUNG KEPUTUSAN SELEKSI PENERIMAAN CALON KARYAWAN (STUDI KASUS: PT EPSON BATAM) BERBASIS ONTOLOGI', 'INFORMATION SYSTEM', 'METODE WEIGHTED AGGREGATED SUM PRODUCT ASSESMEN', '', '', 12, 'memberikan kemudahan pada perusahaan dalam melakukan penerimaan karyawan, kami mengusulkan untuk membangun sebuah sistem informasi penerimaan karyawan. dengan dibangunnya sistem ini, pihak perusahaan dapat bekerja lebih maksimal dan akurat dalam menyeleksi calon karyawan yang akan masuk ke tahap selanjutnya dan diterima sebagai karyawan', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1hBczhlN_AZ_4a7wB_jUzg03JyV2JrJWQ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1mtK5sQ3p2wDfD9B4z8jAbaBhZGH8oIJj', '', '', 99),
('1641720126', 'Klasifikasi Jenis Tanaman Mangga berdasarkan bentuk dan tekstur daun menggunakan metode K-Nearest Neighbor', 'COMPUTER VISION', 'K-Nearest Neighbor', 'Local Binary Pattern, Prewitt', '', 16, 'Mengklasifikasikan jenis dari tanaman mangga berdasarkan bentuk dan tekstur tulang daun dengan menggunakan ekstraksi fitur tekstur dan fitur bentuk serta metode K-Nearest Neighbor untuk klasifikasinya', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1OS4YVtgCf_PUIsqObrlz_g6A0E8rNo7h', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1bsyw4UKhKAe06iUH24r9c92dq2qLIVZg', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1msH57TnwWquMlY17yXwvJZnVq8KPp8Sr', '', 100),
('1641720127', 'AUGMENTED REALITY PADA BROSUR UNTUK MEDIA PEMASARAN DI DEALER HONDA SUKUN MALANG MENGGUNAKAN NATURAL FEATURE TRACKING', 'MULTIMEDIA AND GAME', 'Natural Feature Tracking', '', '', 5, 'Menerapkan Augmented Reality pada brosur mobil dengan Platform Android di Honda Sukun Malang. Adapun tujuan yang ingin dicapai dari penelitian ini adalah untuk memudahkan konsumen dalam mendapatkan informasi mobil dengan menampilkan objek 3 Dimensi yang lebih detail', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1zlPJxKXVdJQy_ntGqvahFCxYXz52vrDn', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1rm6blqZAhGzPP_qgYliTwRPGbYht8HRO', '', '', 101),
('1641720129', 'ANALISIS PERAMALAN TERHADAP PELUANG BISNIS TANAH UNTUK PT JNF DI KOTA MALANG MENGGUNAKAN METODE DOUBLE EXPONENTIAL SMOOTHING', 'INFORMATION SYSTEM', 'Metode Double Exponential Smoothing', 'Tidak ada', '', 8, 'Skripsi ini merupakan skripsi yang membahas tentang sistem peramalan peluang bisnis tanah di Kota Malang dalam beberapa kurun waktu kedepan, data input yang digunakan adalah data jumlah penduduk dan harga tanah pada tahun 2000 - 2018. sistem aplikasi peramalan ini ditujukan untuk PT JNF agar dapat membantu perusahaan tersebut meramalkan harga tanah serta jumlah penduduk di kota Malang sehingga perusahaan tersebut dapat memperkirakan peluang bisnis apa yang akan dibangun setelag melihat hasil dari peramalan. sistem peramalan ini menggunakan metode double exponential smoothing agar memiliki hasil peramalan yang akurat berdasarkan data-data yang ada sebelumnya.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1HqzdK_3udFYDYxSUI7-Bc0tsPaYSBhnL', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1CLheuAKr3Hu8bOty8frWZ_nnUHEPSs5_', '', '', 102);
INSERT INTO `v2_proposal` (`nim_pengusul`, `judul_proposal`, `nama_grup_riset`, `literatur_utama`, `literatur_penunjang`, `catatan_khusus`, `id_dosen_pembimbing_1`, `deskripsi`, `form_kesediaan`, `draft`, `revisi_draft_1`, `revisi_draft_2`, `id`) VALUES
('1641720130', 'Pembelajaran Pada Ujian Online Menggunakan Forward Chaining Berdasarkan Tingkat Kesulitan Soal Menggunakan Metode Fuzzy Tsukamoto', 'SISTEM CERDAS', 'Fuzzy Tsukamoto', 'K-Means', '', 2, 'CBT menyajikan soal-soal pilihan ganda dengan urutan soal maupun isi soal sama untuk setiap peserta tes. CBT seperti halnya tes tertulis dalam kertas (paper-based test), hanya saja penyajiannya menggunakan komputer. Sebab urutan dan isi soal yang sama, CBT belum mampu membedakan kemampuan peserta didik secara individu. Dibutuhkan sebuah tes yang mampu menyajikan soal dengan urutan yang berbeda sesuai kemampuan masingmasing peserta didik. Pembelajran personal (adaptive learning) menjadi alternatif bentuk tes yang membantu peserta didik mengerjakan tes sesuai kemampuannya. Peserta didik dengan kemampuan rendah akan diarahkan mengerjakan soal yang mudah, sementara peserta dengan kemampuan tinggi diberian soal yang sulit.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1eOZk-F9J3TQJpJCx5VQeu4_T0VzgUpG_', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1b2b66xCrFiGKuLhPbTSpRgKoDOYEdtrf', '', '', 103),
('1641720132', 'Pendeteksian Copy-move Forgery pada Citra Digital', 'COMPUTER VISION', 'Scale Invariant Feature Transform (SIFT)', 'Discrete Cosine Transform (DCT)', '', 21, 'Judul ini merupakan pengembangan dari pendeteksian copy-move forgery terdahulu yang menggunakan dct dan dct terkuantisasi yang hasilnya akurasinya masih kecil disini saya ingin menggunakan metode sift untuk meningkatkan akurasi dari pendeteksian', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1f7Nq2yYk9AGgiUY-cnAOGAr8TaSb5eIO', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=10ycE1y4d74RVaeYB7_Yk59LtBv7j5NfS', '', '', 104),
('1641720133', 'SISTEM INFORMASI PENDUKUNG KEPUTUSAN JUAL BELI SAHAM PADA KOMPAS100 DENGAN IMPLENTASI METODE FUZZY TIME SERIES\n\n', 'INFORMATION SYSTEM', 'Fuzzy ', '', '', 2, 'memilih saham bagus', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1dzUHELbtUb399k2Qu15ZiWywHn1y2isM', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1bhb1BoU24G6DNPBEYc7Dtee05op6eoUI', '', '', 105),
('1641720134', 'PENENTUAN SKALA PRIORITAS PERENCANAAN PEMBANGUNAN DI KELURAHAN MELALUI MUSRENBANGKEL.', 'INFORMATION SYSTEM', 'MOORA', '', '', 25, 'Sistem Informasi penentuan prioritas ini ditujukan kepada permasalahan yang masih terjadi di MUSRENBANGKEL (Musrenbang tingkat Kelurahan). Musrenbang merupakan proker atau kegiatan pemerintah skala nasional yang ditujukan untuk pemerataan pembangunan daerah. Tingkat Kelurahan merupakan tingkat yang pertama kali menjalani proses atau rangkaian pencapaian usulan pembangunan daerah. Namun sering kali saat Pra-Musren yang dilaksanakan tingkat RT-RW mengamalami tumpang tindih, karena tidak adanya kriteria pasti (kriteria ini berdasarkan pada kepala RW tiap daerah) sehingga pembangunan yang terlaksana kurang maksimal atau kurang tepat sasaran. Maka dari itu aplikasi ini direncanakan dengan tujuan pemerataan kriteria disetiap daerah agar memperoleh skala prioritas yang akan membantu stakeholder (delegasi/petugas musryawarah pembangunan) untuk menentukan hasil musyawarah usulan pembangunan di Kelurahan.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1ZgdtsiPc27fZZPeZmLBmp7mz6zY_Dix4', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1jlAPthvg7ffql7sE8-mF2xca8pRC8Q2q', '', '', 106),
('1641720135', 'Rancang Bangun Sistem Cerdas Thematic Apperception Test Menggunakan Metode Vector Space Model', 'SISTEM CERDAS', 'Vector Space Model', 'TF-IDF', '', 25, 'Penelitian ini diharapkan dapat membatu kinerja psikolog dalam melakukan Thematic Apperception Test (TAT). Thematic Apperception Test merupakan salah satu tes projektif yang terdiri dari berbagai tema yang tersaji dalam bentuk gambar guna untuk mengetahui pribadi seseorang dari berbagai dorongan, sentimen, kompleks, serta bermacam konflik. Penilaian interpretasi / scoring Thematic Apperception Test dilakukan oleh psikolog secara manual dengan mengacu pada buku Thematic Apperception Test. Waktu yang dibutuhkan oleh psikolog pun cukup lama untuk memetakan setiap kalimat / kata masuk kedalam kategori yang mana, sehingga diperlukan suatu sistem cerdas Thematic Apperception dimana sistem juga dapat melakukan scoring dengan metode Vector Space Model (VSM). Pada penerapannya, Sistem Cerdas Thematic Apperception Test dimulai dengan testi mengisi identitas lalu psikolog melakukan anamnesa yang nantinya akan digunakan sebagai kelengkapan melakukan interpretasi. Kemudian psikolog menuliskan gambaran umum tentang testi pada saat tes berlangsung. Saat tes berlangsung, testi akan bercerita tentang kartu satu per satu. Kartu ditampilkan oleh sistem sesuai dengan gender dan juga usia testi. Sistem akan mencatat waktu respon testi saat melihat kartu dan waktu testi bercerita. Observasi per kartu dilakukan oleh psikolog kemudian sistem akan melukan interpretasi atau scoring menggunakan metode Vector Space Model (VSM). Kategori interpretasi yang dimaksud yaitu hero, theme, need, press, inner state pada Thematic Apperception Test menurut Murray. Vector Space Model (VSM) diharap dapat mengetahui tingkat kemiripan kalimat dari cerita yang dibuat oleh testi dengan kategori yang ada di dalam Thematic Apperception Test.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1KdRcGLPVSwjQM1gBIgVrK-EClsroZuUx', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1NAJoTwYKQiGkKGj5T1dzUDrzGmpsvZ4b', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1wkP9l3Z0Jllp0FF821fMP4Fwej1kxnYo', '', 107),
('1641720138', 'SISTEM MONITORING TANAMAN SAYURAN PADA LADANG MINI BERBASIS ESP32 DAN ANDROID DENGAN METODE FUZZY ', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Fuzzy', '', '', 26, 'Skripsi yang saya buat bekerja sama dengan anak elektronika yaitu sebuah alat berupa robot cartesian yang bernama "Bottani" yang memiliki fungsi sebagai robot penanam tanaman sayuran yang mengusung sistem IoT dalam me monitoring pertumbuhan tanaman dengan metode fuzzy sebagai Intellegent Control nya.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1R4UJqgGXtCsAiDW3-a22dWm2OQXqVncy', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=10j5ZsgkrKxGuFF4oLFhTDc0w-SQdHHQc', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=12A8gtLn7fiMAb8JPqqvTa5NfDJHCcq4a', '', 108),
('1641720139', 'Perencanaan Kebutuhan Kertas Blangko Sertifikat Tanah menggunakan Metode Holt Winters Additive (studi kasus: Badan Pertanahan Nasional Kota Madiun)', 'INFORMATION SYSTEM', 'Holt Winters Additive', '', '', 8, 'Sertifikat tanah adalah mempunyai nilai lebih yaitu akan memberikan kepastian hukum dan perlindungan hukum sebab dibandingkan dengan alat bukti tertulis lainnya. Permasalahan tersebut misalnya kewajiban pembaharuan blangko sertifikat model lama yang dikeluarkan oleh Departemen Dalam Negeri Direktorat Jenderal Agraria yang harus diganti dengan blangko sertifikat model baru yang dikeluarkan oleh Badan Pertahanan Nasional (ATR/BPN) dan harus dilakukan proses ukur ulang luas bidang tanahnya sehingga baru dapat dilakukan peralihan haknya. Dengan adanya permintaan masyarakat tentang sertifikat tanah di Badan Pertanahan Nasional Kota Madiun sangat minim untuk persediaan kertas blangko sertifikat tanah dalam waktu yang akan datang. Terdapat sejumlah perubahan pada blangko sertifikat yang dilakukan demi menjaga legalitas kepemilikan aset tanah. Misalnya pembuatan sertifikat hilang, sertifikat lama / rusak, proses konversi, proses pemecahan bidang, proses hak tanggungan dan wakaf itu membutuhkan kertas blangko yang sesuai dengan bentuk sertifikat. Berdasarkan uraian di atas, penelitian ini di lakukan sistem peramalan perencanaan kebutuhan kertas blangko sertifikat tanah menggunakan metode Holt Winters Additive dengan harapan hasil penelitian ini dapat dijadikan tolak ukur proses kebutuhan terhadap kantor Badan Pertanahan Nasional di Kota Madiun. ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1PqXIGlhO-YVK14_Zs5DS3Q941P7hSXRt', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1YLSvRBtIgjZxgCahzQrSQ6lBkRd7SBFo', '', '', 109),
('1641720140', 'Penentuan Rekomendasi Calon Kapolsek Dengan Menggunakan Metode Moora (Studi Kasus : Polres Kutim)', 'INFORMATION SYSTEM', 'Metode Moora', '', '', 4, 'Menentukan calon kapolsek dengan metode moora. Karena penentuan calon kapolsek saat ini hanya sebatas melihat pangkat tanpa melihat faktor lain.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1SjjGoa44beCe6cyS8q-dMIzVvv62Xsgr', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1W3jDctXYpBDzD1lLQ9lsJfAGcnGXiGXr', '', '', 110),
('1641720141', 'Implementasi aplikasi psikologi eksperimen untuk menentukan kondisi ketahanan jiwa', 'INFORMATION SYSTEM', 'fuzzy mamdani ', 'template matching', '', 25, 'penelitian ini digunakan untuk mengimplementasikan aplikasi psikologi eksperimen yaitu mirror tracer untuk menentukan ketahanan jiwa seseorang pada psikologi industri untuk menentukan posisi kerja berdasarkan ketahanan jiwa, dalam penentuan ditentukan dengans skor yang ber variabel waktu, titik kesalahan, ke akurasian. ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1STvZ0LfKdjINAKcycdTePHX9imixlZbr', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1VNIGsnLdJzjwGlpx9Ex-hSchgwM9sv2A', '', '', 111),
('1641720142', 'Implementasi Intrusion Detection System Pada Cloud Computing Dalam Mendeteksi Serangan Menggunakan Metode Clustering', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'metode clustering ', 'K-means', '', 26, 'sistem ini diharapkan dapat menerapkan sebuah keamanan jarigan berupa Intruison Detection System (IDS) yang dapat mengidentifikasi traffic aman atau tidaknya sebuah jaringan cloud computing, di sistem ini akan menggunakan aplikasi snort yang berfungsi untuk menganalisa packet berdasarkan rule yang ada untuk mengenali adanya upaya serangan,untuk penyeleksian notifikasi serangan pada jaringan komputer berbasis IDS snort menggunakan metode clustering yang mendeteksi serangan jaringan berdasarkan data log pada snort dengan cara mengelompokkan data log tersebut menjadi 2 jenis serangan, bahaya dan tidak bahaya.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1irLIcPw7sybedgXLoygEvmM12VeHDV32', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1pJXllG78q1bSSpSerIINBtKEpXlS76fW', '', '', 112),
('1641720143', 'Manajemen Produksi Cup Menggunakan Kombinasi Metode Regresi Linier Dan Agregat Planning Method Optimasi', 'INFORMATION SYSTEM', 'Regresi Linier', 'Aggregat Planning Method Optimasi', '', 25, 'Skripsi saya mengangkat tentang peramalan produksi cup PT. Tirta Investama (AQUA) Pandaan. Aplikasi ini nantinya menggunakan metode regresi linier. Dan hasil dari peramalan akan digunakan sebagai rencana produksi bulanan. Untuk mengoptimalkan stock dalam gudang menggunakan agregat palnning method optimasi. Data yang digunakan mulai awal tahun 2019 sampai Bulan Juni 2019. Data diambil perhari setiap 8 jam sekali.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1D2POm_vPZuv7aQ9OdaizjuWpMAeniZUe', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1MgRWL0PtdCHkAjDT5IDZCC6F2vyH7ad_', '', '', 113),
('1641720144', 'ANALISIS DATA TRACER STUDY MENGGUNAKAN ALGORITMA C45 UNTUK MENGIDENTIFIKASI FAKTOR PENENTU BESARAN PENGHASILAN ALUMNI', 'SISTEM CERDAS', 'Algoritma C4.5', '', '', 17, 'Meneliti tentang tracer study, yang dimaksud disini adalah data - data alumni Jurusan Teknologi Informasi Polinema yang sudah lulus dengan rentang minimal 2tahun yang didapat lalu menentukan faktor penentu paling besar (gain) pada studi kasus besaran penghasilan', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Ztzyxk10TIrx0dtHNO3AIEoCTqS8ahBm', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1mY1dOHeEnoKr2-e-nC0jvq54CkZNNndm', '', '', 114),
('1641720146', 'Prediksi Kelembaban tanah suatu daerah berdasarkan data citra satelit', 'INFORMATION SYSTEM', 'DBSCAN', '', '', 22, 'berisi tentang bagaimana cara kita mengetahui kelembaban tanah dengan menggunakan data citra satelit', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1UxmnbV8iDu5KcbwnV3VyjdslBFm9c-g3', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Rqb3sE5dT3WAn5AG3qrWamdRHWAmbx6h', '', '', 115),
('1641720148', 'PREDIKSI KEPADATAN LALU LINTAS MENGGUNAKAN YOLO OBJECT DETECTION DAN DI IMPLEMENTASIKAN PADA RASPBERY PI 3B+ DAN INTEL NCS 2', 'COMPUTER VISION', 'Doube Exponential Smoothing', '', '', 22, 'penelitian yang saya lakukan adalah untuk memprediksi kepadatan lalu lintas menggunakan camera yang dihubungkan pada raspberry pi, lalu rapsberry pi akan mendeteksi object object yang tertangkap pada camera lalu menghitung jumlah object tersebut, mobil maupun motor. jumlah kendaraan yang dihitung akan dikirim ke server secara berkala. hasil yang diterima akan dihitung dengan menggunakan metode double exponential smoothing.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1kfng-YvsCJGvkGAln53BkQMJK79fMEeK', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1kVF7hfdmYdvCpsP4Kj3Gs_inqe5-XcUf', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1bPFihaGB8_aAW8KdEqgYAy1u-XpdWIcE', 116),
('1641720149', 'Identifikasi Kualitas Mutu Cabai Yang Layak Dipasarkan Berdasarkan Warna Dan Tekstur', 'SISTEM CERDAS', 'KNN ( K-Nearest Neighbor )', 'Metode HSV (ekstraksi warna)', '', 5, 'Citra digital adalah citra yang dapat diolah oleh komputer. \nYang disimpan dalam memori komputer hanyalah angka-angka yang menunjukkan besar intensitas pada masing-masing piksel. \nDisini saya mengambil studi kasus berupa identifikasi kualitas mutu Cabai berdasarkan warna dan tekstur. Masih banyak ditemui kualitas mutu Cabai yang ada di perkebunan, distributor, maupun pasar yang tidak dipasarkan, tetapi tetap dijual demi meraup keuntungan, yang berakibat kerugian pada konsumen. Dengan adanya sistem ini memudahkan konsumen dan distributor Cabai yang mengatahui mana kualitas mutu Cabai yang siap dipasarkan atau tidak. Cara membedakan mutu umbi porang berdasarkan warna dan tekstur. Untuk Cabai yang memiliki kualitas baik memiliki kriteria seperti berikut yaitu mempunyai warna merah segar belum berubah warna, bentuk berukuran besar berbentuk lurus serta tidak melengkung, ketika dipegang terasa empuk, mempunyai aroma khas pedas, memiliki batang cabai yang keras dan kokoh dan warna dari batang cabai kualitas baik cenderung kehijauan. Dengan adanya sistem pengolahan citra digital ini meminimalisir kecurangan petani Cabai dalam menjual cabai mereka ke distributor cabai.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=13i-syJQlgPHuSw_SHivBrjoyeJWVt0KF', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1NcXynRzC61y8pswpclecpCHf7UNKjSXr', '', '', 117),
('1641720150', 'Implementasi metode least square dalam peramalan penjualan pada PT Semen Indonesia', 'INFORMATION SYSTEM', 'Least square', '', '', 4, 'Untuk meramalkan penjualan PT semen indonesia agar mengetahui perencanaan penjualan yang akan datang dan mengetahui targer kedepannya menggunakan metode least square', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=15fC4B-Ud6eJypUb6PUCeQSFOZ-js4wxE', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1QFNyvoyDSKMctei5hTrjFh1GcfIZPfpq', '', '', 118),
('1641720151', 'IDENTIFIKASI KARAKTER PLAT NOMOR KENDARAAN DENGAN LEARNING VECTOR QUANTIZATION', 'COMPUTER VISION', 'Learning vector Quantization', '', '', 16, 'Membuat pengolahan citra untuk mendeteksi angka dan huruf pada plat nomor', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=18ta7dcJsre787nZBm2yrvMvkmBJeCQog', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1KulfselCs5IMdk2shnxS1Ro7iQHpdOFn', '', '', 119),
('1641720152', 'Sistem Pakar Diagnosa Penyakit Kelamin Menular pada Laki-laki dengan Metode Demster Shafer.', 'SISTEM CERDAS', 'Dempster Shafer', '', '', 10, 'Membantu pengguna awam sebagai alat pendeteksi penyakit pada kelamin laki-laki yang terindikasi menular dan memberikan saran pengobatan yang mungkin dapat dilakukan, tetapi aplikasi ini bukan sebagai kemutlakan pengganti dokter spesialis kulit dan kelamin, karena sangat dianjurkan tetap meminta saran langsung pada pakarnya.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1OvtDMHClSOB4sQJztYsoRzz9e1ZeQr2Q', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1yCcpqj3H_A8-ntnc2IYr1IEmur09Ivfe', '', '', 120),
('1641720153', 'PENERAPAN KONSEP Collaborative, Planning, Forecasting and Replenishment ( CPFR ) MENGGUNAKAN METODE Autoregressive Integrated Moving Average ( ARIMA )\n(STUDI KASUS PABRIK KOPI SENJA MATARAM MALANG)', 'INFORMATION SYSTEM', 'Autoregressive Integrated Moving Average', '', '', 7, 'Berdasarkan hasil observasi dan wawancara dengan pihak Pabrik Kopi Senja Mataram Malang , Dalam memproduksi kopi Pabrik Kopi Senja Mataram Malang sering mendapat kendala menentukan persediaan kopi untuk memenuhi kebutuhan distribusi. Pabrik Kopi Senja Mataram Malang sulit dalam menentukan persediaan produk kopi untuk memenuhi kebutuhan distribusi karena permintaan pelanggan yang tidak pasti. Akibatnya sering terjadi Over Stock ataupun Under Stock sehingga mengakibatkan harga kopi menjadi tidak stabil. \nBerdasarkan permasalahan di atas untuk mengatasi permasalahan tersebut di butuhkan sebuah sistem peramalan yang tepat. Tujuannya adalah untuk menjaga agar harga kopi tetap stabil. Untuk meningkatkan nilai tambah pada rantai pasok terutama untuk optimasi dalam menekan inventory, harga logistik dan efisiensi pada seluruh rantai pasokan yang berhubungan dengan semua peserta maka dipergunakan konsep Collaborative, Planning, Forecasting and Replenishment (CPFR). Konsep CPFR digunakan untuk mengurangi perbedaan antara ramalan yang dibuat oleh beberapa pelaku supply chain yang kemudian secara bersama menentukan kebijakan replenishment. Penelitian ini menggunakan konsep CPFR untuk pemenuhan konsumsi produk kopi pada Pabrik Kopi Senja Mataram Malang.\nBerdasarkan pada data konsumsi yang di miliki oleh pihak Pabrik Kopi Senja Mataram jenis peramalan yang digunakan yaitu time series dengan metode Autoregressive Integreted Moving Average (ARIMA). ARIMA sering juga disebut metode runtun waktu Box-Jenkins. ARIMA sangat baik ketepatannya untuk peramalan jangka pendek dimana metode ini sangat tepat di gunakan mengingat data yang akan di ramalkan yaitu data konsumsi kopi yang di rekap setiap 1 bulan sekali untuk menentukan inventory di bulan berikutnya, sedangkan untuk peramalan jangka panjang ketepatan peramalannya kurang baik.\n', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Xl2BptCUNkH4Oh1RbKzBDjmRiOTqUdsI', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1YLg_tYISBikVGnil-w_nhybps6d2jsO1', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1gaMVZCi1FdoRDwV9jyXMcaH6uWixg494', '', 121),
('1641720154', 'IMPLEMENTASI METODE RAPID CENTROID ESTIMATION DAN K-MEANS UNTUK KLASTERISASI SEKOLAH BERDASARKAN FASILITAS\n( STUDI KASUS KAB. MALANG)', 'SISTEM CERDAS', 'K-Means', 'Rapid Centroid Estimation', '', 4, 'Klasterisasi Sekolah berdasarkan fasilitas, fasilitas yang dimaksud adalah guru, ruang kelas, lab. dan perpustakaan. Sekolah mana saja yang secara kualitas sudah bagus baik sekolah negeri atau swasta, dengan begitu dapat dievaluasi sekolah mana saja yang kurang baik dalam hal fasilitas, nantinya bisa dilakukan pemerataan.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1SCOBXM_rRwkov2uSh0igq2C8I-9Q-JB1', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1FU3GgW0se-iaChmYWf3VQarFohcm3iq7', '', '', 122),
('1641720155', 'Media edukasi pembelahan sel hewan dan tumbuhan pada SMA berbasis virtual reality dan Leap motion', 'MULTIMEDIA AND GAME', 'Fuzzy Tsukamoto', '', '', 13, 'Aplikasi ini bertujuan untuk meningkatkan pemahaman dan hasil belajar siswa SMA kelas 11 pada mata pelajaran biologi materi bab sel hewan dan tumbuhan dengan cara yang interaktif. \n\nUntuk menciptakan aplikasi yang interaktif ini, penulis menggunakan teknologi gabungan yaitu virtual reality  dan juga Leap motion untuk membuat dengan tujuan dapat memvisualisasikan lebih baik menggunakan model 3d.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1aCavua2xtsSu0bdyUSWKPAB7WL8yiVch', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1-50Wwagu7SAyWeZDwSMqigTJHJXsS1xV', '', '', 123),
('1641720158', 'SISTEM INFORMASI PERAMALAN KETERSEDIAAN STOK SUKU CADANG SEPEDA MOTOR DENGAN METODE TREND MOMENT di YAMAHA SIP PAHLAWAN', 'INFORMATION SYSTEM', 'Trend Moment', 'Time Series', '', 4, 'Yamaha SIP Pahlawan merupakan sebuah Unit dagang yang bergerak di bidang penjualan sepeda motor suku cadang dan melayani jasa service motor. Dimana Unit dagang ini setiap harinya harus memenuhi kebutuhan konsumen, sehingga penjualan dan pembelian merupakan hal yang utama dalam perusahaan tersebut. Seiring dengan perkembangan teknologi informasi, Yamaha SIP Pahlawan perlu memanfaatkan teknologi informasi untuk meningkatkan kinerja dan produktivitas agar dapat bertahan dan bersaing dalam usahanya.\nYamaha SIP Pahlawan dalam menangani penjualan suku cadang dan pembelian masih menggunakan sistem konvensional yaitu pencatatan setiap transaksi dengan menggunakan buku besar, sehingga pembuatan laporan membutuhkan waktu yang tidak sedikit. Hal ini diakibatkan karena setiap saat terjadi perubahan pada stok yang dikarenakan oleh pembelian dan penjualan barang. Dari permasalahan tersebut dirancang dan dibangun sistem informasi penjualan barang yang berisikan data-data pembelian barang, stok barang, data-data penjualan barang serta laporan-laporan penjualan barang yang terjadi setiap harinya. Dari sistem ini diharapakan data membantu dalam menyelesaikan masalah laporan data penjualan barang dengan cepat dan kapan saja jika dibutuhkan dan hasil dari proses pengolahan data ini pun lebih akurat dibanding jika dilakukan proses pengolahan data dengan sistem konvensional.\nPada Yamaha SIP Pahlawan proses penjualan, pembelian suku cadang sepeda motor dan pembuatan laporan masih menggunakan metode konvensional sehingga pembuatan laporan membutuhkan waktu yang tidak sedikit. \nTujuannya membantu pihak manajemen dalam memprediksi penjualan suku cadang pada periode berikutnya.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1-m7y8fmNctD3nMzjkQrkYHFsyad2kKC_', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1-nqPYvcdDs4kJcVqx3Tpv40lMypYfnIE', '', '', 124),
('1641720159', 'Sistem pakar diagnosa hama dan penyakit tanaman kopi robusta menggunakan metode case-based reasoning', 'SISTEM CERDAS', 'Case-based Reasoning', '', '', 1, 'Terkait permasalahan produktivitas kopi Robusta yang ada di Ngantang, terhadap gejala yang timbul pada tanaman kopi di lahan. Dan, minimnya ahli pakar kopi di daerah Ngantang. Dibutuhkan suatu sarana yang dapat diakses oleh para petani dan petugas di lapangan, sehingga dengan segera dapat diambil tindakan sesuai target penanggulangannya. Dengan mengunakan sistem yang berkembang pada saat ini yaitu sistem pakar. Mampu membantu untuk mendiagnosa hama dan penyakit tanaman kopi robusta, dan menggunakan metode case-based reasoning.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1f1oQUr0FUzruySf5rd7rrsOGaAXKfKNn', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1YNAsA9aZpzX4IEm_tmrgz9axDJtiLoNf', '', '', 125),
('1641720161', 'Analisa Performa Penerapan Algoritma Spesifikasi Server Raspberry Untuk Aksesbilitas Ujian Online (Studi Kasus SMK Negeri 4 Malang)', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Round Robin', 'Least Connection, Static RR', '', 17, 'Skripsi ini menganalisa perbedaan penggunaan web server mini (server yang menggunakan desktop) dan web server yang menggunakan Raspberry pi 3 yang diberi load balancing menggunakan HaProxy', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1uq3Z4ndy2s853ekrKMQUJ3_OUqCjHkRl', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1YxBIon9VrcY3BAlQrfe56HjYrLVShqxW', '', '', 126),
('1641720162', 'pengembangan sistem peramalan produksi kopi menggunakan exponential smoothing', 'INFORMATION SYSTEM', 'exponential smoothing', '', '', 2, 'Kopi telah menjadi suatu pilihan menarik dalam hal minuman yang \nbisa dinikmati di hampir segala kalangan, situasi kondisi, tempat, dan berbagai \nevent-event yang ada. Di Indonesia, ada banyak sekali jenis kopi yang \nberanekaragam dengan berbagai varian citarasa pahit yang khas mewakili daerah \nasal kopi tersebut. Di kawasan Politeknik Negeri Malang, banyak dijumpai \nkedai kopi yang menyajikan berbagai macam kopi beserta aneka kudapan.  \nTeknologi Informasi (TI) berkembang sangat cepat. Dampak dari \nperkembangan TI tersebut memberi kemudahan bagi masyarakat \nuntuk memenuhi segala kebutuhannya. Tuntutan masyarakat yang menginginkan \nkemudahan dalam setiap aktivitas dan kebutuhannya, merupakan tantangan bagi \npara pelaku bisnis untuk memberikan pelayanan secara maksimal bagi para \nkonsumennya dengan cara menyediakan berbagai fasilitas yang memadai guna \nmemenuhi kebutuhan mereka. Banyak fasilitas dari dunia digital yang dapat \ndimanfaatkan dalam berbagai bidang usaha.\n', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1fCKwlQJI0EJJAGukmRHpGYtNt8FAug03', '', '', '', 127),
('1641720163', 'sistem peramalan modal kegiatan pembelian tebu pada UD juara agro perkasa di kecamatan bantur. \n', 'INFORMATION SYSTEM', 'autoregressive integrated moving average (ARIMA)', '', '', 2, 'jadi skripsi saya ingin meramalkan sebuah modal untuk kegiatan pembelian tebu selama satu musim tebang. termasuk ongkos biaya dan lain supaya diketahui agar modal di bulan berikutnya. ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1obSnnRqgsuahrMqGhcgQrMOFoon4tOiJ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=13uQFGoRzFNqt_D8ltl5YHT0dB19tL8KA', '', '', 128),
('1641720165', 'Penentuan Jumlah Peserta Minimal Kapitasi FKTP Pada Dokter Praktek Menggunakan Metode Naive Bayes Classifier (Studi Kasus Dokter Praktek Di Kab.Madiun)', 'SISTEM CERDAS', 'Naive Bayes Classifier', '', 'Kurang tanda tangan pembimbing, karena pembimbing masih tugas ke luar kota', 23, 'Sistem ini adalah tentang penentuan jumlah peserta minimum di dokter praktek yang layak untuk diberlakukan sistem pembayaran secara kapitasi di wilayah kab.madiun. Berdasarkan penentuan yang didapat maka dokter praktek dapat mengetahui, apabila peserta yang terdaftar pada dokter praktek masih kurang dari minimal dapat dipastikan terjadi ketidakseimbangan antara besaran kapitasi yang diterima dokter praktek dengan biaya yang dikeluarkan tidak sesuai. Kemudian untuk mengetahui berapa jumlah peserta minimum yang harus ada pada dokter praktek dilakukan pengelompokan data dari dokter praktek yang bekerja sama dengan bpjs di kab.madiun bertujuan untuk mengetahui akurasi ketercapaian dokter praktek mana saja dari perhitungan metode naive bayes  dengan data jumlah peserta yang tertanggung, jumlah kunjungan, biaya obat, biaya laboratorium, dan biaya tenaga. Dan hasil yang diperoleh adalah analisis ketercapaian yang menjadi acuan untuk penentuan nilai minimum kapitasi.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1VHf4Y9iKFZRXHvKKZo20qxfKmk_JnT1D', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=12vLSZGguJBd_9vAeo2vL4CQkubu8S8UE', '', '', 129),
('1641720166', 'Rancang Bangun Automasi Kincir Air pada Tambak Udang Vannamei dengan Metode Fuzzy', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Fuzzy Logic Control', '', '', 26, 'Kualitas air merupakan hal yang sangat penting pada budidaya udang vannamei dikarenakan ekosistem air menjadi salah satu penyebab keberhasilan panen menjadi lebih optimal dan meminimalisir kerugian ataupun kematian dari benih vannamei, oleh sebab itu saya ingin membuat sistem monitoring kualitas air tambak(pH, suhu) yang secara realtime bisa diakses dari smartphone. Nantinya yang diharapkan dari input nilai pH dan suhu air akan menyalakan kincir air otomatis sesuai kebutuhan dan kondisi pada tambak udang vannamei yang bisa memberikan output menurunkan suhu dan kadar nilai dari pH.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1kBscLYDwcUdJ7gNe_pWqsIXoft0PXQd0', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1-1sUeADix1FUvx8CcPMJCP-e4QRIM20X', '', '', 130),
('1641720167', 'tingkat kemasaman buah apel dari warna kulit dan tekstur', 'COMPUTER VISION', 'KNN', 'HSV', '', 3, 'saya menggunakan judul skripsi ini untuk membantu para petani apel yang ingin memetik buah apel,karena pada dasarnya apel berwarna kulit sama tapi ada yang asam banget dan ada yang kurang asam(manis)', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1mTNije3Y_hO_z9d9IR55ZmGJFlRaZB2A', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1JWSa6fNMT166zOKkCnXiDBbjuToivWl1', '', '', 131),
('1641720168', 'Proyeksi Instabilitas Harga Telur Puyuh untuk Memutuskan Penambahan DOQ Baru dengan Metode Fuzzy Time Series Markov Chain ', 'INFORMATION SYSTEM', 'Fuzzy Time Series Markov Chain', '', '', 4, 'Sistem ini akan berisi tentang catatan produksi setiap peternak dari anggota NS Quail Farm dan data transaksi pengambilan telur dari peternak ke pengepul. Berdasarkan data transaksi dapat diramalkan harga telur untuk 2 bulan kedepan, sehingga dapat diketahui bahwa harga akan stabil atau menurun. jika harga satbil dan cenderung meningkat maka dapat memberikan pertimbangan peternak untuk menambah DOQ (Day Old Quail) karena dapat dipastikan jika harga satbil dan meningkat maka dalam 2 bulan kedepan saat puyuh mulai panen maka peternak akan mendapatkan keuntungan. sedangkan jika harga menurun maka peternak harus berhati-hati dalam menambah DOQ baru karena terdapat kemungkinan akan mengalami kerugian dikarenakan harga turun saat puyuh panen.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1xqMTtueQOGhrSlgtYUw_Ck-M73ROEDzj', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1mlsfN6QboCEX-WYP7XLfeJ8-OUB97M5d', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1b5nk0KdTpJ-jhFEiaR7pk5rQeI0VEIll', '', 132),
('1641720169', 'Sistem Pendukung Keputusan Pemilihan Lokasi Objek Wisata Di Kabupaten Paser Menggunakan Metode Profile Matching', 'INFORMATION SYSTEM', 'Profile Matching', '', '', 6, 'Judul Skripsi yang saya ambil yaitu tentang pemilihan lokasi objek wisata di kabupaten paser yang nantinya akan di pilih yang terbaik salah satu dari beberapa wisata di kabupaten paser dan juga saya ingin mengenalkan wisatawan yang ingin berlibur ke kalimantan timur tepatnya di kabupaten paser , Kabupaten Paser merupakan kabupaten yang letaknya strategis karena dekat dengan ibu kota baru yaitu Penjama Paser Utara , Selain memiliki letak yang strategis, juga memiliki aneka ragam objek wisata. Di samping wisata danau yang indah, Kabupaten Paser juga memiliki wisata alam berupa Air Terjun dan gunung. Dalam memilih tempat wisata tidaklah mudah. Terdapat faktor-faktor yang perlu di pertimbangkan untuk melakukan pemilihan lokasi wisata yang dikunjungi. Faktor-faktor tersebut antara lain biaya yang dikeluarkan untuk wisata, jarak suatu tempat wisata, cuaca saat itu, sarana dan fasilitas di tempat wisata dan tingkat keramaian di tempat wisata.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1EmULvh7gVE8mtSjcu7WeO-FHMRJ3tNhn', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1SeiR7K3v_bCd-PLYsInJHWlp4VQFV2OW', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1PSrPG4Tkh5YGYgUEMiVAmgQQMFqOYdb4', '', 133),
('1641720170', 'Sistem Pakar Identifikasi Pola Asuh Orang Tua Menggunakan Metode Naive Bayes dengan Laplace Smoothing', 'INFORMATION SYSTEM', 'Naive Bayes', 'Laplace Smoothing', '', 17, 'Aplikasi Sistem pakar berbasis android yang akan membantu para orang tua mengidentifikasi pola asuh mereka terhadap anak-anaknya. Alasan saya membuat skripsi ini karena kebanyak orang tua masih belum mengerti pola asuh yang benar dan baik untuk anak-anak mereka . Pola asuh yang salah dapat mengakibatkan kontroversi antara anak dan orang tua . Pola asuh orang tua yang benar harus ditanamkan sejak dini agar masa depan anak lebih berkualitas', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1wYSbUIJm6gVANeAqhkSgBLB5Tj6Y2wth', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Gfvt-_2Ov_iELmhabINv4rSm24lWMYkR', '', '', 134),
('1641720171', 'Implementasi Metode Triple Exponential Smoothing Untuk Peramalan Jumlah Penumpang Kereta Api di Daerah Operasi 7 Madiun', 'INFORMATION SYSTEM', 'Triple Exponential Smoothing', '', '', 8, 'Sistem informasi yang digunakan untuk meramalkan jumlah penumpang kereta api di Daerah Operasi 7 Madiun dimasa mendatang dengan menggunakan data dari masa lalu', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1snZvqZ0MWe79B-lf6kCoZYgT6_dU-FNH', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1F7pEQLoyLPHMJVwr6JlNUb7VZFIKStA9', '', '', 135),
('1641720174', 'Sistem Pendukung Keputusan Penerima Kredit UKM Menggunakan Metode Weighted Aggregated Sum Product Assessment (Studi Kasus Bank BPR Jatim Cabang Magetan)', 'INFORMATION SYSTEM', 'Metode Weighted Aggregated Sum Product Assessment', 'Weighted Aggregated Sum Product Assessment', '', 17, 'skripsi ini saya buat untuk memudahkan pimpinan bank dalam menentukan penerima kredit berdasarkan kriteria tetap yang ditentukan dari bank yaitu 5C, setelah mendapatkan alternatif dengan nilai akhir tertinggi selanjutnya ukm akan di survey dan diwawancarai. ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1yoW71YoYET9LOrPoEdcvoJUFmtWr_YD0', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1kzIlV_irzvdBNbFB1bHPZ9D7LFuO1RlE', '', '', 136),
('1641720175', 'SISTEM PAKAR IDENTIFIKASI KECANDUAN GADGET MENGGUNAKAN TEORI ELIZABETH HURLOCK DENGAN METODE NAÃVE BAYES CLASSIFIER\nUNTUK ANAK SEKOLAH DASAR', 'SISTEM CERDAS', 'Naive Bayes Classifier', '', '', 17, 'membuat sistem aplikasi pakar yang menampung pengetahuan dari pakar psikolog dalam hal mencegah dan mendiagnosa kecanduan gadget, aplikasi ini bertujuan untuk pencegahan dini bagi anak Sekolah Dasar agar waspada dalam menggunakan gadget. selain itu juga, aplikasi ini memberikan saran berupa motivasi agar anak bisa waspada tingkat kecanduan menggunakan gadget.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1JbwcqaUMWSGCtXGGXvjiqlLIOcMseXNJ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1kuwFV9NHrKo7lcTLlDyAA7xDXtY92Sko', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1V2DhQZgVD6EXHxiieYWFxTZnMDobo-1c', '', 137),
('1641720176', 'OPTIMASI E-COMMERCE MEMANFAATKAN WEB USAGE MINING MENGGUNAKAN METODE ASSOSIATIVE RULE MINING UNTUK MENGETAHUI POLA REKOMENDASI PRODUK', 'SISTEM CERDAS', 'Associative Rule Mining Algoritma Apriori', '', '', 15, 'Mengetahui pola kunjungan website e-commerce dengan menganalisa data hit / klik pada suatu website yang terdapat pada web log file untuk menentukan rekomendasi produk yang sesuai dengan keinginan customer dengan melakukan optimasi pada layout yang terdapat dalam website sehingga akan membantu meningkatkan penjualan produk website e-commerce.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1vxTMK-HWweMqpkolPjYY6bVdO82ZXbJS', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1rzRq8Kp94LOVtF_saOE7tJ9i6dKKjT6s', '', '', 138),
('1641720177', 'Implementasi Pendekatan Brute Force pada Penyusun Jadwal Perjalanan Wisata Otomatis dengan Kombinasi Knapsack-Traveling Salesman Problem', 'SISTEM CERDAS', 'Brute Force', 'Knapsack Problem , Traveling Salesman Problem', '', 11, 'Sistem yang dibuat bertujuan untuk melakukan penjadwalan untuk orang yang akan wisata didaerah Malang dan Batu . dengan adanya sistem ini mempermudah untuk wisawatan yang memiliki waktu sempit untuk memilih wisata mana yang cocok dengan waktu yang dimiliki . selain itu dengan adanya sistem penjadwalan ini di maksudkan untuk mempermudah wisatawan mengetahui lokasi , jarak dan waktu tempuh , serta efisiensi waktu yang dapat digunakan untuk menghabiskan arena didalam wisata. ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1HeJz_7YWZILMCvLzTSmzhgD5LYI995Gv', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1MmXz2o1T4tOvAA5vaskRIDbRmCgNhsWZ', '', '', 139),
('1641720178', 'Pengembangan Media Pembelajaran Bagian Tubuh Pribadi bagi Anak Down Syndrome', 'MULTIMEDIA AND GAME', 'Fuzzy Tsukamoto', '', '', 13, 'Pengembangan media pembelajaran bagian tubuh pribadi bagi anak down syndrome adalah media pembelajaran yang berbasis multimedia. Media pembelajaran tersebut berisi tentang pendidikan seksual dengan mengenalkan perbedaan antara laki-laki dan perempuan, perubahan fisik saat memasuki masa pubertas, yaitu pada saat memasuki usia 10-12 tahun, serta hubungan dengan orang lain. Masa pubertas juga dialami oleh anak down syndrome, yaitu anak dengan gangguan genetik yang terjadi pada kromosom atau disebut juga trisomi 21, di mana terjadi kelebihan salinan pada kromosom ke-21. Down syndrome menyebabkan pengidapnya memiliki ciri tampilan fisik yang khas, serta keterbelakangan intelektual yang menyebabkan kecacatan belajar, hambatan dalam berkomunikasi, interaksi sosial dan perilaku. Seks dan seksualitas bagi penderita down syndrome masih dianggap tabu, menyeramkan, menakutkan, dan masih diabaikan oleh banyak orang. Media pembelajaran dibuat untuk menghindarkan anak berkebutuhan khusus down syndrome menjadi korban pelecehan seksual maupun menjadi pelaku pelecehan seksual dikarenakan tidak mengetahui sebagaimana mereka bertindak. Media pembelajaran ini menggunakan animasi 3D yang dibuat menggunakan blender dan diolah menggunakan unity, serta menggunakan audio. Animasi dan audio tersebut digunakan untuk memudahkan anak down syndrome menangkap materi yang ada. Selain itu terdapat evaluasi belajar yang berisi pertanyaan mengenai materi bagian tubuh pribadi. Dalam evaluasi tersebut, dilakukan analisis menggunakan metode fuzzy tsukamoto pada dua kelompok siswa yang masing-masing terdiri dari laki-laki dan perempuan mengenai jumlah jawaban benar terhadap waktu tertentu. Sehingga dapat diperoleh hasil media pembelajaran tersebut efektif atau tidak digunakan untuk anak berkebutuhan khusus down syndrome. ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1xaL5uQP-fO_pMzYURN0KoSf6jeUFMybF', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1rB5dPf70_2JcFt7_XmhtfI2rPcDIEwyZ', '', 140),
('1641720179', 'Sistem Pengambilan Keputusan pemilihan dosen pembimbing menggunakan metode SMARTER studi kasus D4 Keperawatan Poltekkes Malang', 'INFORMATION SYSTEM', 'Metode SMARTER', '', '', 1, 'Untuk menentukan pemilihan dosen pembimbing program studi D4 Keperawatan Politeknik Kesehatan Kemenkes Malang', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1vmiiR9ECy2oJfakM0fC51irQWBcuJePy', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=12Eksmt5dVmTL1CJ0kxga8RnBsoZiG51L', '', '', 141),
('1641720180', 'SISTEM PENDUKUNG KEPUTUSAN PENERIMA BANTUAN SISWA MISKIN (BSM) PADA SEKOLAH DASAR STUDI KASUS KABUPATEN TULUNGAGUNG DENGAN METODE AHP DAN MOORA', 'INFORMATION SYSTEM', 'Analytical Hierarchy Process (AHP)', 'Multi-Objective Optimization by Ratio Analysis (MOORA)', '', 15, 'Dalam pengolahan data siswa yang layak menerima dana BSM di sekolah dasar pada kabupaten Tulungagung saat ini masih dilakukan secara manual atau belum adanya sebuah metode yang dapat membantu dalam menentukan siswa/siswi yang benar-benar berhak mendapatkan dana BSM, penentuan penerima dana BSM dengan cara manual ini dapat menyebabkan kesalahan pada saat menyeleksi,  sehingga kriteria penilaian siswa miskin yang telah di tetapkan sering terjadi  kesalahan.\nHal ini terjadi karna sulitnya pengolahan data dengan cara manual tersebut, maka dari itu saya ingin menciptakan sebuah aplikasi yang mana dapat membantu dalam pengolahan data siswa/siswi tersebut supaya lebih mudah, cepat dan akurat.\nDalam pembuatan aplikasi ini saya akan menggunakan dua metode yaitu AHP dan MOORA, dimana pada metode AHP ini saya akan menghitung berapa nila bobot untuk setiap atribut dan pada metode MOORA saya akan melakukan proses perangkingan yang akan menentukan alternatif yang optimal, yaitu siswa terbaik. Pembagian BSM  dilakukan untuk membantu seseorang yang tidak mampu selama menempuh studinya.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1OtwCzeUwx3Vtp1YF4w5yfzYt581Ow8kG', '', '', '', 142),
('1641720181', 'Identifikasi Bibit Lele Unggul Berdasarkan Geraknya Menggunakan Metode Phase Only Correlation', 'COMPUTER VISION', 'Phase Only Correlation', '', '', 24, 'Berdasarkan jurnal tentang sistem pendukung keputusan pemilihan bibit unggul ikan lele, pergerakan ikan lele merupakan kriteria yang memiliki bobot terbesar dalam pemilihan bibit lele.\nMaka dari itu dibuatlah sistem berupa pengolahan citra digital dengan menggunakan metode phase only   correlation yang dapat menentukan ikan lele mana yang bergerak dengan cepat dan lamban. Sistem ini dibuat untuk memudahkan pembudidaya ikan lele untuk memilih bibit ikan lele yang bagus, dengan melihat pergerakan ikan lele, jika ikan lele bergerak cepat dan gesit maka ikan lele dianggap bagus', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1vcYfseDy1pmB1EgfoTgBUBMnm6ZibqbN', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1qcRCatpsf-aSQV184Q5RVbjXU1E6XByI', '', '', 143),
('1641720182', 'Pengembangan Sistem Pre-Assessment Sertifikasi Label Halal  (Studi Kasus PLUT-KUMKM Kota Batu) ', 'SISTEM CERDAS', 'Fuzzy Logic System', 'Genetic Algorithm', '', 11, 'Sistem pakar tentang pre-assessment sertifikasi label halal untuk produk UMKM agar pelaku usaha/UMKM dapat melakukan simulasi audit internal sebagai syarat sertifikasi label halal sehingga tercapai tujuan dari pembuatan aplikasi ini menganalisa dan mengevaluasi kapasitas suatu produk dari Pelaku Usaha atau UMKM untuk dapat lolos uji Sertifikasi Label Halal.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1lufUfHZK8rjw01otvm55QAgIQLrw1Uk2', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1WA2l-UhtqlI4AvqAI2yG-c6HlMSrBvsc', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1TPp43QynsUStN6DAJhdLRJdutTO3HflY', '', 144),
('1641720183', 'Penerapan Metode Trend Moment Untuk Peramalan Penjualan Obat Ternak Berbasis Web (Studi Kasus PT Otasindo Prima Satwa Cabang Surabaya)', 'INFORMATION SYSTEM', 'Trend Moment', '', '', 4, 'Pemenuhan permintaan merupakan salah satu kendala yang sering terjadi di perusahaan supplier kebutuhan peternakan seperti obat ternak. Sebagian pesanan yang tidak terprediksi karena masalah ketersediaan stok obat ternak dapat menimbulkan kerugian bagi perusahaan. Hal ini merupakan suatu hal yang menarik untuk di cermati sehingga pemenuhan pesanan dapat dilakukan secara lebih baik. sehingga PT Otasindo Prima Satwa Cabang Surabaya perlu adanya aplikasi untuk menentukan peramalan penjualan obat ternak agar tidak kehabisan produk yang akan dijual.\nBerdasarkan permasalahan diatas Penulis bertujuan untuk merancang sebuah sistem informasi peramalan untuk membantu perusahaan dalam memperkirakan kebutuhan stok pada bulan-bulan berikutnya berdasarkan data historis sebelumnya, untuk mengatasi masalah ketersediaan stok barang. Berdasarkan uraian diatas metode trend moment dipilih karena  merupakan metode yang cocok dengan kesesuaian data yang digunakan dalam peramalan penjualan obat ternak di PT Otasindo Prima Satwa Cabang Surabaya karena trend setiap tahunnya berulang di setiap bulannya, diharapkan dengan adanya sistem ini nantinya dapat membantu dalam perencanaan penjualan yang akan dilakukan oleh pihak PT Otasindo Prima Satwa Cabang Surabaya, dan juga membantu dalam mengatasi masalah ketersediaan stok barang pada bulan-bulan berikutnya.\n\n', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1O8zcrpw-AWH_h6esKhoBJV1K_2xOUusk', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1pGaVp6nAR1qzt78yVLiIK0XYmVj3s7QN', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=17NZJA3RYX4P1r64kptwzePJ_S3Q-oJS1', '', 145),
('1641720184', 'Line E-Commerce Chatbot Menggunakan Finite State Machine', 'SISTEM CERDAS', 'Finite State Machine', '', '', 20, 'Line chatbot untuk membantu penjual dalam merespon pelanggan yang seringkali menayakan hal yang sama dan berulang tanpa batasan waktu dan jam kerja, sehingga dapat meningkatkan kepuasan pelanggan', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1fLh7pEeU1vbtWpDkpB7kixe2Xj2uCrkm', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1xLaNkFUjLL8pUCHvwX4MZIV7Il-E02PD', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1atEuDT2-soitFIl1bFDwPZU6Z6SZ4Mp4', '', 146),
('1641720185', 'IMPLEMENTASI METODE TRIPLE EXPONENTIAL SMOOTHING UNTUK PREDIKSI PERMINTAAN PRODUK FURNITURE PADA CV. KYKY MEBEL', 'INFORMATION SYSTEM', 'TRIPLE EXPONENTIAL SMOOTHING', '', '', 4, 'untuk memprediksi jumlah permintaan barang pada bulan atau tahun yang mendatang, agar dapat membantu perusahaan dalam perencanaan pengadaan bahan baku', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1msdQy1uvDupVt2Ky6Z5wb_e2sHilDW6U', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1aQFPLo55Rc-Z9d1PdgqL6QCxxm-NuzES', '', '', 147),
('1641720187', 'Deteksi Kerusakan dan Kelayakan Ban Mobil Berdasarkan Ekstraksi Teksturnya Menggunakan Gray Level Co-Occurance Matrix dengan Metode Jaringan Syaraf Tiruan', 'COMPUTER VISION', 'Gray Level Co-Occurance Matrix', 'Jaringan Syaraf Tiruan Backpropagation', '', 3, 'Sistem berbasis Dekstop untuk mendeteksi jenis kerusakan pada ban mobil serta mengklasifikasikan jenis kerusakan untuk kelayakan pemakaian ban mobil tersebut. \nJenis kerusakan ban ini dapat diambil dari citra ban mobil yang diakuisisi dari tapak lebar / diameter ban. Kemudian citra tersebut diproses untuk pengambilan teksturnya dengan menggunakan Gray Level Co-Occurance Matrix sehingga dapat mendeteksi jenis kerusakan apa yang terjadi pada ban mobil. Setelah itu masing masing jenis kerusakan ban mobil diklasifikan dengan metode Jaringan Syaraf Tiruan Backpropagation untuk menghasilkan kelayakan ban. Kelayakan ini terbagi menjadi 3 kelas yaitu : 1. Layak, 2. Setengah Layak, 3. Tidak Layak.\nDari klasifikasi tersebut user dapat melihat jenis kerusakan dan bagaimana kelayakan ban mobil tersebut untuk pertimbangan ganti ban.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1-BXO7U58QcbukzKj-K5qykYYeh67g9P6', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1s3yPyc-3MynOa_-o_a-d5ANAi5rKB3wT', '', '', 148),
('1641720188', 'sistem rekomendasi pencarian lahan baru usaha penanaman porang untuk mencari lahan terbaik', 'INFORMATION SYSTEM', 'MOORA', 'fuzzy', '', 5, 'Pada studi kasus kali ini saya telah mengembangkan bisnis penanaman porang di daerah kediri, akan tetapi terdapat sebuah permasalahan untuk pemilihan lahan sebagai media penanaman porang yang baik seperti apa, maka dengan itu untuk penelitian yang saya lakukan ,yaitu membuat sebuah sistem rekomendasi pemilihan lahan untuk penanaman porang di wilayah kediri, sehingga permasalahan di atas mendapatkan solusi.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1H0yqLGu2ZrttsTKhnlM-_vE4sxu1amiF', '', '', '', 149),
('1641720189', 'Pengendalian Persediaan Bahan Baku Biobriket Dengan Menggunakan Metode POQ (Period Order Quantity) dan ARIMA (Autoregressive Integrated Moving Average) di CV. Bintang Yasa Abadi', 'INFORMATION SYSTEM', 'POQ (Period Order Quantity)', 'ARIMA (Autoregressive Integrated Moving Average)', '', 12, 'jadi saya akan membuat sistem peramalan stok bahan baku biobriket, yaitu dimana nanti pada aplikasi ini dapat meramalkan persediaan stok biobriket supaya tidak kelebihan dan kekurangan stok, dengan menghitung dari data pembelian bahan baku dan penjualan yang sudah diberikan oleh CV. Bintang Yasa Abadi dengan menggunakan metode POQ (Period Order Quantity) dan ARIMA (Autoregressive Integrated Moving Average)', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1c4NsbEJm80eiX4XwUlSjlgz0Uu86X1s9', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=170Fq_AsK_SeiFQ8qxDec2Wlmj-XRK7br', '', '', 150);
INSERT INTO `v2_proposal` (`nim_pengusul`, `judul_proposal`, `nama_grup_riset`, `literatur_utama`, `literatur_penunjang`, `catatan_khusus`, `id_dosen_pembimbing_1`, `deskripsi`, `form_kesediaan`, `draft`, `revisi_draft_1`, `revisi_draft_2`, `id`) VALUES
('1641720190', 'PENCARIAN RUTE TERDEKAT PELAKU USAHA MIKRO, KECIL DAN MENENGAH DI KABUPATEN MALANG PADA ANDROID DENGAN MENGGUNAKAN METODE  FLOYD WARSHALL ( STUDI KASUS KOMINFO KAB. MALANG)', 'INFORMATION SYSTEM', 'Metode Floyd-Warshall', '', '', 18, 'Skripsi saya adlah tentang pencarian rute terdekat pelaku usaha mikro, kecil dan menengah di kabupaten malang. Data yang digunakan adalah data UMKM yang di dapatkan dari kominfo kabupaten malang. Nantinya selain pada aplikasi android, data UMKM juga ditampilkan dalam bentuk crud yang diakses oleh admin lewat browser. Aplikasi ini berbasis android, sehingga pengguna dapat menggunakan aplikasi ini dimanapun. Aplikasi ini memerlukan internet dan gps untuk mengetahui lokasi dari pengguna. Pada tampilan awal aplikasi, pengguna akan dihadapkan oleh dua menu yaitu menu untuk melihat data umkm dan menu untuk mencari rute terdekat. Pada menu data umkm, pengguna dapat melihat data informasi dari pengusaha yang ada di kabupaten malang. Lalu untuk menu kedua, pengguna dapat mencari rute terdekat menuju tempat usaha yang dicari. Dalam mencarian rute terdekat, terdapat fitur filter yang digunakan untuk merinci usaha yang ingin dicari. Setelah menentukan usaha yang ingin dicari, selanjutnya aplikasi akan membaca lokasi dari pengguna, lalu dengan metode Floyd-Warshall aplikasi akan menampilkan rute terdekat untuk menuju tempat usaha yang dicari. Setelah proses pencarian rute terdekat selesai pengguna dapat melihat informasi data dari pengusaha yang dicari. Di sisi lain, admin melakukan perubahan data UMKM melalui browser', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1YEeiCw3NGRZbUkLH0sKXndvT2THI8Myl', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1jlTb-6cD-v0DKCZKRvbu9iSfyXut0Nm9', '', '', 151),
('1641720191', 'KLASIFIKASI TOPIK DAN MOOD LAGU BERDASARKAN LIRIK DAN CHORD MENGGUNAKAN METODE K-NEAREST NEIGHBOR', 'SISTEM CERDAS', 'K-Nearest Neighbor', 'TF-IDF', '', 19, 'Seiring berkembangnya zaman, jumlah lagu yang tersedia di dunia semakin banyak. Salah satu stimulus luar untuk emosi pun semakin banyak, yaitu lagu itu sendiri. \nDengan bertambahnya jumlah lagu digital maka diperlukannya suatu sistem yang dapat mengklasifikasikan lagu-lagu tersebut. Pengklasifikasian lagu berdasarkan emosi juga belum banyak digunakan. Padahal emosi  cenderung berperan besar dalam komunikasi antar manusia di kehidupan sehari-hari. Terdapat beberapa metode machine learning yang dapat digunakan untuk klasifikasi. Pada tugas akhir ini penulis menggunakan metode k- Nearest Neighbor (k-NN). Pada penelitian k-NN sebelumnya yang digunakan untuk klasifikasi emosi untuk teks berbahasa Indonesia mencapai akurasi dengan tingkat 60% [5]. Selain itu, pengklasifikasian topik lagu berdasarkan chord atau akor juga sangat menarik untuk dibahas pada masalah ini. Dengan nilai keakurasian yang sudah cukup, maka bisa dikatakan pada metode ini sangat cocok untuk mengkalsifikasi lirik lagu berdasarkan topik dan mood.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1WWbXS6K23kE2f7maXHlHq9maF1DNhBGy', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1OzWteFD1_akKI-NTZpCTRfJRjB3gTMdo', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1vXZvBPzb_i9yyPLvkSBqv-5ky4agEWmw', '', 152),
('1641720192', 'Klasifikasi jenis buah apel berdasarkan tulang daun menggunakan metode Ant\nColony Optimization dan K-Nearest Neighbor', 'COMPUTER VISION', 'Ant Colony Optimization', 'K-Neareast Neighbor', '', 22, 'Penelitian ini bertujuan untuk mengklasifikasikan jenis buah apel\nberdasarkan bentuk tulang daun menggunakan metode  K-Neareast Neighbor untuk menentukan jenis buah apel. Pola citra yang akan diolah adalah bentuk tulang daun, dengan dilakukan deteksi tepi ciri tulang daun menggunakan metode Ant Colony Optimization', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1_E7yHJLur5uJR5xWHsjtUNWmgUiZlV9H', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Se3CHpXlYJmecmT4Aq8-83pZ5nLYBvKt', '', '', 153),
('1641720194', 'SISTEM INFORMASI PERAMALAN PERSEDIAAN BIBIT BENIH IKAN KOI DI BATU KOI CENTER SIDOMULYO ', 'INFORMATION SYSTEM', 'Metode Least Square', '', '', 4, 'Masalah persediaan barang merupakan masalah yang sangat penting bagi sebuah perusahaan, terutama jika perusahaan tersebut bergerak dalam bidang distribusi barang. Tanpa adanya persediaan, perusahaan akan dihadapkan pada suatu resiko dimana perusahaan mengalami kendala karena tidak dapat memenuhi keinginan pelanggan yang membutuhkan barang maupun jasa yang dihasilkan oleh perusahaan tersebut. Masalah yang sering dihadapi adalah keterbatasan persediaan barang dalam memenuhi pesanan. Namun, persediaan barang yang terlalu berlebihan juga dapat menimbulkan kerugian berupa biaya penyimpanan dan tidak terjadi perputaran uang dalam perusahaan. Penyelesaian untuk masalah ini sangat penting untuk diperhatikan. Oleh karena itu diperlukan suatu metode yang dapat diaplikasikan dalam pengendalian persediaan barang.\nsaya ingin membuat sistem tersebut membantu pihak koi center sidomulyo mengambil keputusan persediaan ikan hias yang akan disiapkan untuk periode selanjutnya.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1-ZQUwCKxQPjy6KEpzGg3XjuapGO_5NiT', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1HMz2iAGxLUgIe5bNSESGt_4jaLBXTCmu', '', 154),
('1641720196', 'Evaluasi Dan Perancangan User Interface Dan User Experience Menggunakan Metode Human Centered Design dan Heuristic Evaluation Pada Website Kabupaten Jembrana ', 'INFORMATION SYSTEM', 'human centered design', 'heuristic evaluation', '', 18, 'Skripsi saya bertujuan untuk menemukan masalah tentang usability dengan metode Human Centered Design dan kemudian mengevaluasinya, usability yang dimaksud yaitu tentang sejauh mana suatu produk atau sistem dapat digunakan oleh pengguna untuk mencapai tujuan tertentu dengan efektifitas, efisiensi dan kepuasan, salah satu metode evaluasi usability adalah Heuristic Evaluation, diharapkan dibuat nya tema ini untuk  dapat meningkatkan jumlah pengguna yang mengunduh, menggunakan dan meningkatkan kenyamanan pengguna saat menggunakan website jembrana', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1iYPl4O4lpCo3X2nnh0Z0SvNollAiRPs_', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1s2vnm2T8GvyFVpwPNZCkEA5A0xjNlr5l', '', '', 155),
('1641720197', 'Implementasi Analisa Kemiripan Teks pada Disposisi Keluhan Warga pada Pemerintahan Daerah', 'SISTEM CERDAS', 'Cosine Similarity', '', '', 3, 'Pengaduan adalah penyampaian keluhan yang disampaikan pengadu kepada pengelola pengaduan pelayanan publik atas pelayanan pelaksana yang tidak sesuai dengan standar pelayanan. Dalam penyampaian pengaduan ini banyak kota yang memakai website sebagai media penerima pengaduan masyarakat.Contoh adalah kota malang yang memiliki website pengaduan https://sambat.malangkota.go.id/ website ini menerima 570 keluhan tiap harinya. Tiap keluhan ini akan di disposisi ke dinas-dinas yang terkait dengan keluhan yang ada. Agar proses disposisi ini lebih efisien maka saya ingin mengimplementesi text mining terhadap keluhan yang ada sehingga dapat melakukan rekomendasi kemana disposisi tersebut akan diarahkan.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1eDZszEhiv4yKYjPegDsZmp1-dVasxi0U', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1t6DetoJWji1uIPVrYWiuHH0zwlyfnZKX', '', '', 156),
('1641720201', 'Penerapan IOT pada UMKM kerupuk untuk menghindari resiko penghambat waktu pengeringan menggunakan sensor kelembaban', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Fuzzy Tsukamoto', '', '', 26, 'Inti dari Penerapan IOT pada UMKM kerupuk untuk menghindari resiko penghambat waktu pengeringan menggunakan sensor kelembaban yaitu membuat sebuah prtotype pada UMKM kerupuk yang dimana apabila disaat proses pengeringan kerupuk terjadi hujan maka sistem akan menganalysis data dari hujan yang ada menggunakan sensor-sensor yang ada seperti sensor suhu dan kelembaban DHT11, sensor ldr, sensor hujan, sensor suara, dan apabila cuaca menunjukan kalau akan terjadi hujan sesuai data yang diterima oleh sensor maka produsen kerupuk tersebut akan menerima peringatan melewati aplikasi android yang dapat diakses dimana saja kemudian produsen kerupuk tersebut dapat melakukan aksi penutupan tempat pengeringan melalui aplikasi andorid yang tersedia atau apabila produsen tidak sempat melakukan aksi tersebut dan cuaca menunjukan terjadi hujan maka sistem akan otomatis melukukan penutupan pada tempat pengeringan. semua ini bertujuan apabila produsen kerupuk lalai terhadap pengeringan kerupuk maka dapat terbantu oleh sistem untuk mengatasi masalah resiko waktu pengeringan yang berkepanjangan gara-gara terkena hujan.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1UKo_z5c4ZMea6C91owXxS2FehWOlcNwt', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=14k7R5iK-s4wOrtmkeZXTG3MBK65kUwux', '', '', 157),
('1641720208', 'ANALISIS SENTIMEN KUALITAS LAYANAN ONLINE MARKETPLACE DI INDONESIA MENGGUNAKAN METODE SUPPORT VECTOR MACHINE', 'SISTEM CERDAS', 'support vector machine', 'TF-IDF', '', 15, 'melakukan sentimen analisis mengenai beberapa marketplace besar di indonesia dengan cara mengklasifikasikan komentar tweet menjadi negatif, positif, dan netral kemudian membandingkan nilai akhir hasil sentimen analisis tersebut untuk mengetahui marketplace mana yang memiliki tingkat pelayanan terbaik sehingga dapat direkomendasikan kepada masyarakat', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1FdZAY6M1Y5akdng6YdvnQo6H_tM8qN8p', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1IdLuiE643zPYLrXLI-LJJ-dWy5Jem7Jm', '', '', 158),
('1641720209', 'Identifikasi Penyakit Pada Tanaman Tebu Melalui Citra Daun Menggunakan Metode ACO dan Color Moments', 'COMPUTER VISION', 'ACO (Ant Colony Optimazion) ', 'Color Moments', '', 22, 'Skripsi yang akan saya buat mengeneai pengolahan citra digital yaitu meng identifikasi penyakit pada tanaman tebu melalui citra daun berbasis android. Pada aplikasi yang saya buat out put yang dihasil adalah penyakit pada tebu, dengan cara meng inputkan foto daun tebu yang terkena penyakit', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1jmZNzY2Rse4b8oM4Ukg8clE2ogEnqfbF', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Mp_8i2UYTpL06UWVlfjpP0EtlzJXlRJj', '', 159),
('1641720210', 'Sistem Pendukung Keputusan Pemilihan Asrama Santriwan / Santriwati Menggunakan Metode Multi Criteria Decision Making', 'INFORMATION SYSTEM', 'AHP', '', '', 12, 'Menentukan pemilihan asrama untuk santriwan/santriwati', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1ElB7_NDM1GIL5R337UgoFj07v-QAZxgQ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1hzIlw0g1M5xA52RDPAT6U00fo1gYv8zM', '', '', 160),
('17411723006', 'Sistem pakar rekomendasi menu makanan untuk mencegah stunting pada anak usia dini dengan metode Z-Score', 'INFORMATION SYSTEM', 'z-score', '', '', 17, 'Di skripsi ini saya membuat sistem pakar tentang rekomendasi menu makanan yang dapat mencegah stunting pada anak di usia dini, dengan cara memenuhi jumlah asupan gizi yang di perlukan saat anak masih dalam masa kandungan hingga masa usia 0-24 bulan yang dimana di masa tersebut anak akan mudah terkena penyakit stuning.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1uJx-T7ROTGNvGOs5EQhdM0CSSudnMfgH', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1l3TuF0bfiTHJBrErbwiWeZmkkmWxopDG', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1XyImPk4a9mKgmrTehrbvuVBR0Rwnj41v', '', 161),
('1741723001', 'Rancang dan Bangun  Sistem Lecturer Room Automation menggunakan RFID berbasis website (Studi Kasus : Jurusan Teknologi Informasi Politeknik Negeri Malang)', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'Metode Kriptografi', 'Metode enkripsi RSA atau Hash functions', '', 9, 'Politeknik Negeri Malang adalah salah satu institusi pendidikan tinggi dan teknik lanjutan serta penelitian ilmiah atau pendidikan vokasi profesional, yang memiliki spesialisasi dalam bidang ilmu pengetahuan, teknik dan teknologi atau jurusan teknis yang berbeda. Pengembangan IoT di Politeknik Negeri Malang sering dilakukan dalam penggunaan daya listrik gedung atau sebagai pembelajaran perkuliahan jurusan. Untuk pengembangan IoT dilingkungan Politeknik Negeri Malang, perlu dilakukan riset terhadap suatu masalah. Problematika yang  dijumpai adalah mahasiswa saat ini ketika ingin bertemu dengan dosen maka mahasiswa harus mengecek langsung keruang dosen dan menanyakan dosen yang bersangkutan ada ditempat atau tidak . Tentunya hal tersebut menimbulkan rasa canggung terhadap mahasiswa karena ditakutkan mengganggu aktifitas dosen yang lain didalam ruangan. Dampak dari hal itu, maka sering kita jumpai mahasiswa berkumpul didepan ruang dosen dan menunggu demi bertemu dosen yang bersangkutan. Kondisi seperti itu mengakibatkan lobby di depang ruang dosen kurang enak dipandang oleh visitor dari instansi, kampus ataupun sekolah. Dengan melihat kondisi yang demikian penulis memberikan saran untuk membuat perancangan sistem informasi berbasis website yang didukung dengan perangkat IoT guna mengatasi problematika yang dialami oleh Politeknik Negeri Malang tepatnya di jurusan Teknik Informatika. Dengan adanya perancangan sistem informasi yang terintergrasi diharapkan menjadi manfaat dan terobosan baru dalam mendapatkan informasi dosen dengan mudah yang dapat digunakan oleh visitor, mahasiswa ataupun dosen.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1BYpDNMtNdqjlhdw43PUHmbHvm9BVC2dZ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1rNxVKvRZwv1ovqYWuCDlB67MnI4DHClb', '', '', 162),
('1741723004', 'Kendali Navigasi Slideshow Powerpoint Dengan Gerakan Tangan Menggunakan Metode Hidden Markov Model', 'COMPUTER VISION', 'Hidden Markov Model', 'HSV, Mean Shift', '', 3, 'menggeser slide powerpoint dengan gerakan tangan ke kanan dan ke kiri', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1tVfNTZVMzp5wjX2Exd6fE2ZO3p1b3Y8G', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1-4PCsMYsE56VXBHruElYDQfHgsJZXMLF', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1oaRG6JUQOtfNrv9URt4v6wLwl5YsKL-W', '', 163),
('1741723005', 'Desain dan Implementasi remote server linux dengan menggunakan metode return oriented programming', 'COMPUTER NETWORK, ARCHITECTURE AND DATA SECURITY', 'return oriented programming', 'Buffer Over Flow', '', 26, 'skripsi saya adalah remote binary exploit dengan menggunakan metode Return oriented programming yang dimana binary dari bahasa C yang sudah di complie saya run ke server linux dengan menggunakan Socat kemudian saya remote server dengan protokol socat TCP dengan menggunakan menggunakan Python. alasan menggunakan metode ini karena bisa bypass ASLR pada linux yang dimana ASLR berfungsi untuk random address setiap program dijalankan. jadi dengan menggunakan metode ini bisa membypass ASLR dalam posisi aktif.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1k5_2iJfcVJGYfHebVVGCJTyoAoHuR8TF', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1RoL7JR1JSU5jVOtA5fMsxwcFZ_Si8ai9', '', '', 164),
('1741723007', 'Prediksi Banjir Lahar Dingin pada Lereng Merapi menggunakan Data Satelit dan Sensor Geofon', 'INFORMATION SYSTEM', 'ANN Backpropagation', '', '', 22, 'Menentukan pada kawasan lereng merapi khususnya pada kali putih dan gendol apakah kawasan tersebut aman dan rawan terhadap banjir lahar dingin', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1ptoiXzvkzf4lHwsJ9rmCwKVPD475RLna', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Kt6tFTgzYQ3WQtjd_VPe3cY43cfexcxg', '', '', 165),
('1741723009', 'KLASTERISASI SEMINAR PADA SISTEM INFORMASI SEMINAR POLINEMA MENGGUNAKAN METODE K-MEANS', 'SISTEM CERDAS', 'K-means', 'Fuzzy C-Means', '', 10, 'Mengklasterisasikan atau mengelompokkan data seminar yang ada di polinema dari semua jurusan yang ada menjadi predikat Sangat Bagus, Bagus, Cukup, Kurang, dan Sangat Kurang. selain itu akan dibuat sistem informasi untuk mendata seminar yang akan dan telah dilakukan di polinema.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1-LUXu0eyXtnCIFiZesLWJlcJM6NROJ6X', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1NdEpOhn0UxSUdsdSGve5KOmbC98L24dV', '', '', 166),
('1741723010', 'PENERAPAN METODE SELF ORGANIZING MAPS UNTUK CLUSTERING ZONASI DAN JURUSAN PADA PPDB TINGKAT SMA DI BOJONEGORO', 'INFORMATION SYSTEM', 'Self Organizing Maps', '', 'Kurang tanda tangan pembimbing, karena pembimbing masih tugas ke luar kota.\n', 23, 'Membuat sebuah aplikasi penerapan zonasi dan jurusan agar sekolah tidak bingung menentukan calon siswa smp ke sma yang masuk zonasi dan jurusan apa', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1vDLFkkNXEOktmow0Hw21CMokzfTS_ffa', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=16jxzVXq4RamEu_MDZsMBciKD3qNKy6fp', '', '', 167),
('1741723011', 'Identifikasi Uang Asli dan Uang Palsu Menggunakan Metode K Nearest Neighbor', 'COMPUTER VISION', 'K Nearest Neighbor', '', '', 3, 'Skripsi ini digunakan untuk mendeteksi uang asli berdasarkan pembandingan dengan uang palsu dan juga melakukan deteksi terhadap ciri ciri uang asli melalui media kamera hp sehingga dapat mengetahui keaslian uang tersebut', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1RQi5WXtTUWp-7FDIlAzugYEm-Q4svnYs', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1PLN1J_Dfxk0bFAZ3aeUb55umMtBBQ7Jc', '', '', 168),
('1741723012', 'Normalisasi Teks Pada Teks Twitter Berbahasa Indonesia Menggunakan Recurrent Neural Network dan Levenshtein Distance', 'SISTEM CERDAS', 'Levenshtein Distance', 'Markov Chain', '', 14, 'Twitter merupakan salah satu media sosial dan microblog di internet yang digunakan untuk keperluan analisis atau penelitian, karena kemudahan pengambilan data dengan sebuah service yaitu API (Application Programming Interface) yang sudah disediakan oleh twitter untuk memungkinkan pengembang dapat memanfaatkan data-data tersebut, salah satunya adalah data tentang sebuah posting atau tweet. Namun, seringkali pada sebuah tweet terdapat sebuah teks singkatan atau kesalahan pengetikan yang dapat menjadikan teks tersebut menjadi tidak normal, hal itu dikarenakan pada sebuah data posting atau tweet hanya dibatasi 280 karakter, dari permasalahan teks singkatan, teks tidak baku dan kesalahan pengetikan seringkali dapat menghambat proses sebuah analisis atau penelitian menjadi kurang maksimal, dikarenakan dalam sebuah analisis atau penelitian menggunakan media komputer untuk proses pengolahan data teks tersebut, dimana sebuah komputer tidak dapat mengenali data jika data teks masukan yang di berikan tidak normal, oleh sebab itu pada komputer tersebut harus diberikan sebuah data latih terlebih dahulu untuk mengenali dan mengubah data teks masukan yang tidak normal menjadi sebuah data teks normal. Terdapat model Markov Chain yang dapat digunakan untuk memberikan propabilitas transisi dari kata satu ke kata yang lainnya dengan menggunkan data latih terlebih dahulu, dan perhitungan jarak kemiripan antara kata satu dan kata lainnya menggunakan Levenshtein Distance. Maka dari itu judul penelitian ini adalah "Normalisasi Teks Pada Teks Twitter Berbahasa Indonesia Menggunakan Markov Chain dan Levenshtein Distance". diharapkan dengan adanya penelitian ini dapat menghasilkan teks normal yang dapat digunakan untuk memaksimalkan proses pengolahan teks pada suatu analisis dan penelitian.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1zRgUUTbZ-5ym37K8wJ9yGLM38AUATnrQ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1SpHCriJUrzEQHaOvatV2KAr933IIonzW', '', '', 169),
('1741723014', 'SISTEM INFORMASI PEMILIHAN SISWA BARU DARI KELUARGA TIDAK MAMPU (STUDI KASUS SMA NEGERI 1 SUMBERREJO)', 'INFORMATION SYSTEM', 'Multi-Objective Optimization On The Basis Of Ratio Analysis (MOORA)', '', '', 10, 'Sebagai salah satu sekolah menegah atas yang berada di bawah naungan Dinas Pendidikan Provinsi Jawa Timur, Sekolah Menengah Atas Negeri (SMAN) 1 Sumberrejo, dalam penerimaan siswa baru menggunakan sistem zonasi, salah satunya dengan jalur keluarga tidak mampu. SMA N 1 Sumberrejo masih menggunakan cara offline (manual) yaitu dengan menyeleksi satu persatu siswa baru dari keluarga tidak mampu. Hal tersebut menyebabkan proses pemilihan memakan banyak waktu. Penelitian ini bertujuan untuk membangun sebuah sistem pendukung keputusan/ sitem informasi untuk membantu pihak sekolah dalam menyeleksi siswa yang layak diterima berdasarkan kriteria yang berlaku di SMA N 1 Sumberrejo. Metode yang diterapkan pada sistem adalah metode Multi-Objective Optimization On The Basis Of Ratio Analysis (MOORA). Sedangkan bahasa pemrograman yang dipakai adalah PHP, SQL, dan Codeigniter.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=17pB64JVwAgERn7wnUckXzNJ3tAtTzr8G', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1UD4VTip9cRiemsoX9ePzpXoFMG9vMJzm', '', '', 170),
('1741723015', 'Perencanaan Kebutuhan Penjualan Kayu Pada Tpk Rejosari KPH Malang Mengunakan Metode Triple Exponential Smooting', 'INFORMATION SYSTEM', 'Triple Exponential Smooting', '', '', 5, 'KPH Malang adalah wilayah pengelolaan hutan sesuai fungsi pokok dan peruntukannya, yang dapat dikelola secara efisien dan lestari. KPH terdiri dari Kesatuan Pengelolaan Hutan Konservasi (KPHK), Kesatuan Pengelolaan Hutan Lindung (KPHL) dan Kesatuan Pengelolaan Hutan Produksi (KPHP).KPH Malang mengalami permasalahan dalam memprediksi jumlah penjualan kayu. Terkadang penjualan kayu mengalami lonjakan pembeli atau sebaliknya mengalami penurunan. Volume penjualan kayu yaitu kondisi ketika kapasitas penjualan kayu melebihi kapasitas sebelumnya. Sepertihalnya ketika banyak proyek pembangunan, penjualan kayu mengalami volume sangat tinggi sehingga mengakibatkan banyak pembeli yang tidak mendapatkan kayu karena stok di TPK habis hal ini sangat merugikan pembeli .kemudian ketika proyek pembangunan sepi maka volume penjualan kayu mengalami penurunan sehingga banyak kayu yang tidak terjual dan rusak .\nUntuk membantu menyelesaikan permasalahan tersebut maka diperlukan suatu sistem peramalan untuk meramalkan jumlah penjualan kayu  untuk periode selanjutnya, sehingga didapatkan hasil yang optimal pada setiap peramalan dan dapat menjadi acuan yang lebih baik ke depannya. Oleh karena itu, hal ini perlu dievaluasi dalam penyedian informasi penjualan  karena nantinya akan membantu dalam pengantisipasian yang berkaitan dengan persiapan fasilitas maupun jumlah kayu yang harus dipersiapkan. Berdasarkan permasalahan di atas maka penulis menggunakan metode triple exponential smoothing. Sehingga sistem ini bisa meramalkan jumlah stok setiap bulannya agar tidak kurang dan tidak berlebih, serta dapat membantu dalam proses transaksi penjualan agar kebutuhan pelanggan tidak terganggu.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1G0TXpwh23_bGzvDXMmU5VZix8djXSzek', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1X5baTrRgarGG2t0aRbtOk0NQW2BIoU-L', '', '', 171),
('1741723016', 'KLASIFIKASI ANJURAN DAN LARANGAN PADA KITAB HADITS BULUGHUL MARAM', 'SISTEM CERDAS', 'naive bayes', '', '', 14, 'Sistem aplikasi ini untuk mengklasifikasikan anjuran dan larangan pada Kitab hadits Bulugul Maram untuk memudahkan para pemula atau masih awam dalam mengenai makna hadits, dengan data yang diinputkan secara manual dari kitab Bulughul maram', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1tMmOCOMV_lBGK_qRFTVN3Q7ViYVkK9ML', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1d8u8Ig-sGtKE9qNvwvjk146q-bl5scUu', '', '', 172),
('1941727001', 'Aplikasi Pelayanan Jasa Service Elektronik di Kota Malang Berbasis Android', 'INFORMATION SYSTEM', 'Haversine Formula', '', '', 6, 'Aplikasi ini melayani jasa pelayanan servis barang elektronik yang ditujukan kepada penyedia layanan jasa elektronik dan kepada konsumen yang membutuhkan pelayanan jasa elektronik. Aplikasi ini ditujukan kepada umum yang ingin mencari pekerjaan yang sesuai dengan bidang mereka, seperti pada bidang pelayanan servis komputer, servis printer, servis televisi, servis AC dll. Sasaran Utama nya adalah untuk mengurangi angka pengangguran di Kota Malang. Untuk mempermudah pembeli jasa saya mengangkat metode haversine dimana fungsinya yaitu mengetahui letak tempat service yang terdekat dengan lokasi pembeli saat itu. ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Of876Fvmlh2sphPFowVkBPrrblAhi-eu', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1FFQIyvqTI2ikrjR9NO9Kb4RZm035Qiai', '', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Uz5DlBuKFOyDYDo3VAdqSuQ7x63SrWjC', 173),
('1941727002', 'PENERAPAN METODE PEMBELAJARAN ROLE PLAYING UNTUK MENGUKUR MINAT BELAJAR PADA APLIKASI SENAO BERBASIS ANDROID', 'INFORMATION SYSTEM', 'METODE ROLE PLAYING', '', '', 6, 'Skripsi yang saya ambil terkait penerapan metode role playing untuk mengukur minat belajar mahasiswa pada aplikasi senao berbasis android. Jadi aplikasi senao ini adalah aplikasi pembelajaran online dimana semua mahasiswa dapat belajar tentang materi yang mereka inginkan. Materi tersebut ada yang berbayar maupun yang bebas. Di aplikasi ini saya ingin menganalisa, seberapa besar minat belajar mahasiswa terhadap aplikasi ini ?. Output yang diharapkan, mahasiswa dapat melihat minat belajar nya masing-masing berdasarkan kursus yang mereka berlangganan dari segi membaca dan memahami terhadap suatu materi.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1B9Hk6P8cSYamhX3F6g_b_HKsSiEkaU1G', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1O7tFZXeGMXlBlBnEpTtWGwRH4rwhO5Tc', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1_aKzBNnF-_q0rsG7RZfKZHd-J-cjsO7y', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1ATNxoTk6weJU0rLq0R1hRVb_Iop1R6US', 174),
('1941727003', 'IMPLEMENTASI DOCUMENT TAGGING MENGGUNAKAN OCR DAN TEXT PROCESSING', 'SISTEM CERDAS', 'Rule based method', 'OCR, Text preprocessing', '', 20, 'Masalah ada pada kumpulan surat dan dokumen yang tidak memiliki keterangan dan pengelompokan yang jelas, sistem yang saya buat membantu pengelompokan surat dan dokumen dengan memberi tag pada setiap dokumen agar lebih jelas pengelompokannya. Cara yang digunakan dengan "membaca" isi surat dengan bantuan ocr, memproses teks surat, serta menghasilkan informasi seperti, judul surat, pengirim & penerima, isi, tempat/tanggal, acara, dan informasi lainnya yang dapat disimpulkan dari sebuah surat.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1yCzdW-7msbvl7xsLLsmPpRiV8NxmsukJ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1hSghv7cED0qC0X1jHLQAf3065k0_a8EX', '', '', 175),
('1941727004', 'Aplikasi Chatbot untuk Reservasi Pijat Bayi dengan Metode Cosine Similarity', 'SISTEM CERDAS', 'Cosine Similarity', '', '', 7, 'Membuat chatbot yang bisa melayani pemesanan pijat bayi berdasarkan jadwal yang tersedia, karena saat ini hanya ada 1 admin yg melayani, studi kasus pada Maminaa Mom and Baby Treatment (https://www.instagram.com/maminaa_/)', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1T66SMuoxgpcw3D8ArmbuO_ryQddhiG2s', '', '', '', 176),
('1941727005', 'ANALISIS SENTIMENT  TENTANG OPINI TERHADAP PERFORMA TIMNAS SEPAK BOLA INDONESIA PADA TWITTER', 'SISTEM CERDAS', 'Naive Bayes Classifier', '', '', 18, 'Tentang analisis sentiment Twitter untuk mengklasifikasikan tweet opini dan komentar pada performa Timnas Indonesia. Data tersebut akan diolah menggunakan algortima Naive Bayes Classifer (NBC) dan menghasilkan tweet yang telah diklasifikasikan menjadi positif, negatif, atau netral. Pengujian akan dilakukan berdasarkan hasil klasifikasi. Pengujian bertujuan untuk mengetahui tingkat akurasi dari klasifikasi. Hasil klasifikasi akan memberikan kemudahan bagi pengguna untuk melihat dalam melihat tweet yang bernilai positif, negatif, atau netral.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=12tSUjV6KITPXWGeGnE-ZHFe60hUSLyEN', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1LqjVlH-jpVAr0NZrtv1EAFImBjxr9LJH', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1tmbDUoRf7kznfAAfmmKW_kPtK-4gXClB', '', 177),
('1941727009', 'IMPLEMENTASI ANALISIS SENTIMEN TWITTER MENGENAI OPINI MASYARAKAT TERHADAP RANCANGAN KITAB UNDANG-UNDANG HUKUM PIDANA (RKUHP) TAHUN 2019 ', 'COMPUTER VISION', 'Support Vector Machine (SVM)', '', '', 18, 'Skripsi ini bertujuan untuk membuat analisis dari hasil klasifikasi tweet opini dari masyarakat terhadap rancangan kitab undang-undang hukum pidana tahun 2019 sehingga menghasilkan tweet yang telah diklasifikasikan menjadi positif, negative atau netral. Selain itu juga untuk mengetahui tingkat akurasi dari hasil klasifikasi menggunakan algortima Support Vector Machine dan untuk menghasilkan dataset baru yang bisa berguna untuk penelitian selanjutnya. Dari hasil skripsi ini juga diharapkan akan memberi kemudahan bagi masyarakat untuk melihat/membedakan tweet positif, negative atau netral maupun untuk pemerintah dalam menilai bagaimana tanggapan mengenai RKUHP sehingga bisa menjadi tolak ukur bagaimana hasil atau respon dari masyarakat. ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1_VBYqdAfaYlaSNajJCDT0ykA8rbUS8N7', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1NF6_8yLG1arbRcrsEULCBHkKFggZFTv_', '', '', 178),
('1941727010', 'SISTEM PENDUKUNG KEPUTUSAN UNTUK MENENTUKAN GIZI BALITA DI KOTA KEDIRI MENGGUNAKAN METODE FUZZY MAMDANI', 'INFORMATION SYSTEM', 'Metode Fuzzy Mamdani', '', '', 19, 'Sistem Pendukung Keputusan untuk Menentukan Gizi Balita di Kota Kediri Menggunakan Metode Fuzzy Mamdani merupakan sistem pendukung keputusan untuk menentukan apakah balita tersebut termasuk kategori gizi baik, gizi buruk, gizi kurang, ataupun gizi lebih. Jika bayi tersebut belum berkategori gizi baik, maka di dalam aplikasi nantinya ada informasi solusi program dinkes kediri untuk mengatasi balita yang belum berkategori gizi baik. Data yang digunakan adalah data balita yang diukur dengan Antropometri yaitu data Berat Badan menurut Umur (BB/U), Tinggi Badan menurut Umur (TB/U), dan Berat Badan menurut Tinggi Badan (BB/TB). Pada halaman KMS , dapat dilihat grafik perkembangan dari balita yang nantinya dapat difilter datanya menurut bulan dan tahun sehingga dapat terpantau tumbuh kembang balita dan dapat dilihat juga informasi data KMS dari balita. Selain itu nantinya juga terdapat informasi dimana saja keseluruhan puskesmas yang ada di kota kediri. Pada halaman dashboard terdapat grafik tentang gizi balita , yang nantinya bisa difilter ditampilkan secara keseluruhan, menurut puskesmas, bulan, dan tahun. Terdapat 3 pengguna yaitu admin, user, dan user tidak login. Admin dapat mengelola data balita, data status gizi balita, mengecek status gizi balita, mengelola data puskesmas, mengelola informasi data program pemerintahan, mengelola data KMS, melihat grafik. User dapat melihat grafik, melihat data puskesmas, melihat status gizi balita, melihat informasi penanganan balita, dan mencetak history balita. sedangkan user tidak login hanya dapat melihat grafik balita dan melihat data puskesmas. Pada penelitian ini metode yang digunakan yaitu metode fuzzy mamdani. Logika fuzzy mamdani merupakan salah satu metode yang  tepat digunakan untuk menentukan keputusan tersebut. Dengan menggunakan metode ini diharapkan dapat menghasilkan status gizi balita dengan hasil yang akurat.  ', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1F9tMsBVC_6jYvjX-nX1essoMosb_jt5p', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1s6YOXq_ysM66eniHzSqtoeip6zmX0cbp', '', '', 179),
('1941727012', 'Implementasi Teknik Peramalan Pada Tahap-Tahap Supply Chain Management Bengkel Marmer Adiswara Kudus', 'INFORMATION SYSTEM', 'Regresi', '', '', 11, 'Sistem peramalan ini adalah pengembangan dari sistem manajemen yang sebelumnya telah ada. peramalan dilakukan pada tahapan rantai pasok yang berkaitan, seperti peramalan stok barang,peramalan pendapatan dan pengeluaran,dan peramalan jumlah pesanan per Minggu berdasarkan jenisnya. pengembangan menjadi sistem peramalan ini bertujuan untuk membantu pemilik usaha dalam meningkatkan pendapatan dan meminimalisir kerugian dengan menggunakan metode pengujian MAPE(Mean Absolute Percentage Error) dan EOQ (Economic Order Quantity).', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1u8V_2rdllL8uQ8GJZF_xgpdxwsCK-A_0', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=13V6gXGq1cWmFsmBYzfJW2D1s7o9BwOp7', '', '', 180),
('1941727014', 'Sistem Pakar Diagnosa Tingkat Kecanduan Game Online Mahasiswa Teknik Informatika Politeknik Negeri Malang dengan Metode Certainty Factor', 'INFORMATION SYSTEM', 'Certainty Factor', '-', '', 21, 'Berdasarkan data survey dari APJIII tahun 2018, alasan seseorang dalm menggunakan internet adalah untuk bermain game online sebesar 7,8% dengan rentang usia 20 â€“ 24 tahun 88,5% di Indonesia. Hal ini mengakibatkan perlu di waspadainya kecanduan game online di kalang usia remaja atau mahasiswa yang berdampak pada karakter mereka. Sementara itu, untuk mendeteksi jenis perilaku kecanduan game online belum dapat dilakukan dengan sistem komputer. Jenis perilaku kecanduan game online selama ini masih diidentifikasi dengan melihat gejala-gejala yang ada secara manual. Hal tersebut masih memungkinkan terjadi kesalahan dalam proses identifikasi akibat human error karena penilaian setiap orangpun berbeda-beda. Oleh karena itu, diharapkan dengan sistem ini, orang awam dapat menyelesaikan masalah tertentu baik sedikit rumit sekalipun tanpa bantuan para ahli dalam bidang tersebut. Sedangkan bagi para ahli, sistem ini dapat digunakan sebagai asisten yang berpengalaman. Aplikasi yang dikembangkan ini bertujuan untuk memprediksi tingkat kecanduan game online dengan hanya menganalisa data tersebut.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1oBOhk0HjvtrgJYthfm6kuretkuCithFr', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1y8R7LNw8SRzDwAIgIwUvsZo2FJZiOd_q', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1Q07LX9e39eCJrb2Ir1xOB1I2Drdfg5ig', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1dNeofnsX6f_tPzveKPh3NSbZj6C19QY_', 181),
('1941727019', 'Perancangan Sistem Rekomendasi Artikel Berita dengan Metode Content Based Filtering', 'INFORMATION SYSTEM', 'Dice similiarity', 'TF-IDF, levenshtein distance', '', 23, 'saya akan membuat sebuah sistem rekomendasi artikel pada website berita online,  artikel yang akan direkomendasikan juga berasal dari website tersebut, dan metodenya menggunakan  kesamaan antara dokumen(artikel) yang sedang di akses dengan dokumen(artikel) yang sudah ada sebelumnya.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1bP_Ko3lVxPU6iVy3XoY0aZT11T-jvH7x', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1VvgCWhSRRMB0Eppe01Kvj46T660zooxE', '', '', 182),
('1941727021', 'Sistem Pakar Diagnosa Preeklampsia Dini Pada Ibu Hamil Menggunakan Certainty Factor.', 'INFORMATION SYSTEM', 'Certainty Factor', '', '', 21, 'Preeclampsia merupakan hipertensi yang dapat dialami iu hamil, preeclampsia ini merupakan penyebab ke 2 kematian ibu hamil di Indonesia. Menurut data Departemen Kesehatan tahun 2012, di Indonesia, preeklampsia merupakan penyebab kematian ibu yang tinggi disamping pendarahan dan infeksi, yaitu perdarahan mencapai 28%, preeklampsia sebesar 24%, infeksi sebesar 11%, komplikasi peuperium sebesar 8%, partus lama sebesar 5%, dan abortus sebanyak 5%. Solusi yang diambil penulis dalam menanggulangi mengenai kondisi preeclampsia yang terjadi pada ibu hamil adalah dengan cara membuat sistem pakar untuk mengenali tanda bahaya pada preeclampsia. Sistem pakar ini juga nantinya dapat membantu mengenali ibu hamil mengalami preeclampsia selama masa kehamilan atau tidak yang didasari oleh gejala â€“ gejala yang dialami selama masa kehamilan.', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1UGc-o4KaS56jT96OVQx81XGsrYgWq5y5', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1yzXqozooe2imtFwIRHzA-Mb0K0wI3lVY', 'https://drive.google.com/open?authuser=0&usp=forms_web&id=1iyNRdUdXAq7AHQbq1ay5hOC5CBAVQJ3S', '', 183),
('1641720173', 'IMPLEMENTASI CASE BASED REASONING PADA SISTEM PAKAR DETEKSI KETEPATAN ESTRUS SAPI PERAH MENGGUNAKAN SORENSEN COEFFICIENT', 'SISTEM CERDAS', 'Metode Case Base Reasoning', 'Algoritma Sorensen Coefficient', 'Tidak ada', 15, 'Permasalahan muncul ketika para peternak sapi ingin melakukan perkawinan terhadap sapi guna menambah populasi dan produksi sapi, para peternak sering mengalami ketidaktepatan dalam mendeteksi estrus sehingga mengalami kegagalan bunting. Rendahnya efisiensi reproduksi pada sapi perah mengindikasikan terjadinya gangguan reproduksi yaitu kawin berulang. Ketidaktepatan deteksi estrus dan waktu yang tepat untuk melaksanakan inseminasi buatan pada sapi betina dapat menyebabkan kerugian finansial bagi peternak, karena mereka harus menunggu waktu estrus pada sapi datang lagi. Kerugian tersebut disebabkan oleh lebih sedikitnya keturunan yang dihasilkan dan tidak tereksploitasinya potensi produksi susu. Kegagalan dalam mendeteksi estrus merupakan salah satu faktor yang yang dapat menyebabkan problem reproduksi dan rendahnya angka kebuntingan pada kelompok ternak sapi perah. Dengan menggunakan sistem pakar maka dapat mempermudah dalam melakukan deteksi ketepatan estrus pada sapi sehingga dapat dengan mudah diketahui tanpa harus ragu dan melakukan pengamatan secara berulang â€“ ulang secara manual. Dalam hal ini, sistem pakar dapat bermanfaat untuk membantu peningkatan kinerja dalam bidang peternakan khususnya. Dengan menggunakan metode Case Based Reasoning ini dapat menyelesaikan masalah baru dengan menggunakan solusi lama adapun kelebihan aplikasi ini yaitu memudahkan para peternak untuk mendeteksi fase estrus secara tepat. Oleh karena itu aplikasi sistem pakar ini diharapkan dapat memberikan informasi penting bagi peternak untuk mengetahui kemungkinan adanya ciri â€“ ciri tingkah laku pada hewan ternak sapi, cara penanganan dan saran tindakan sendiri yang dilakukan untuk penanggulangannya. Dengan demikian ketidaktepatan estrus dapat diatasi jauh sebelum sapi menderita gangguan reproduksi yaitu kawin berulang.', 'd9998af8f5a3871e3c14dd4c9e177d2c.jpeg', '24515a4e3e32a3b0899cbdb52d29c260.pdf', '', '', 258),
('1941727018', 'Perancangan Alat Pemantau Ketersediaan Situs Web Menggunakan Metode Web Scraping Multi Service', 'SISTEM CERDAS', 'Penerapan Teknik Web Scraping Pada Mesin Pencari Artikel Ilmiah', 'Web Scraping: Data Extraction from websites', '', 20, 'Alat ini digunakan untuk melakukan pemantauan ketersediaan situs web di Politeknik Negeri Malang dengan pengecekan beberapa jaringan berbeda secara periodik.', '0dfdef8903d83ebd6c647fa0d36f6adf.jpg', 'a6bf3a271df1ac354aa82b3207cb0e4b.pdf', '', '', 259),
('1641720160', 'SISTEM PAKAR PERENCANAAN BANGUNAN RUMAH MINIMALIS BERDASARKAN TIPE DENGAN METODE CERTAINTY FACTOR', 'MULTIMEDIA DAN GAME', 'Certainty Factor', '', '', 2, 'Sistem pakar perencanaan bangunan minimalis adalah suatu sistem yang akan mempermudah calon pemilik rumah untuk mengetahui tipe rumah minimalis yang sesuai dengan keinginan calon pemilik rumah dan sedikit pengetahuan tentang rancangan anggaran biaya yang meliputi bahan-bahan yang akan digunakan untuk membangun rumah, beberapa lama waktu pengerjaan untuk membangun rumah, dan jumlah sumber daya manusia untuk membangun rumah sesuai dengan tipe rumah.sistem pakar ini akan dibangun berbasis web dengan analisis perhitungan certainty factor, pada sistem pakar ini Terdapat dua tahapan kerja. Pertama, sistem meminta user untuk menginputkan berapa kuesioner yang sudah ditentukan (konsultasi). Kedua, sistem akan secara otomatis menampilkan hasil konsultasi serta sedikit rancangan anggaran biaya berdasarkan perhitungan Certainty Factor. Untuk output dari aplikasi ini berupa tipe rumah minimalis yang sesuai dengan calon pemilik rumah (owner) dan sedikit pengetahuan tentang rancangan anggaran biaya. Adapun data yang digunakan dari hasil wawancara dan studi literatur kepada pakar yang ahli dalam bidang bangunan (sipil).', '044d70f098f1785ef01476ab88a103a0.jpg', 'ec3ab310c51ec5128b571ac6a8eb2950.pdf', '', '', 260),
('1941727006', 'Sistem Informasi dan Peramalan Penjualan Sparepart Bengkel Motor Lancar Jaya Dengan Menggunakan Metode Triple Exponential Smoothing', 'SISTEM INFORMASI', '', '', '', 1, '', '0b1b374ac8326e74899febcd1eb61788.jpg', 'fb429983d3fe03b98aefdbf8a98a8f85.pdf', '', '', 261),
('1941727011', 'KLASIFIKASI KALIMAT PERUNDUNGAN BENTUK TUBUH (BODY SHAMING) PADA MICROBLOGGING MENGGUNAKAN METODE SUPPORT VECTOR MACHINE ', 'SISTEM CERDAS', 'ANALISIS SENTIMEN CYBERBULLYING PADA KOMENTAR INSTAGRAM DENGAN METODE KLASIFIKASI SUPPORT VECTOR MACHINE', 'PENDEKATAN DETEKSI BODY SHAMING DI MEDIA SOSIAL TWITTER MENGGUNAKAN ALGORITMA NAIVE BAYES', '', 27, '', '4dbe98a4e718575a654e4737e2f8776a.jpeg', '1a1829a5d364c2fc5788964fa84d1322.pdf', '', '', 262),
('1641720066', 'Implementasi Metode Clustering K-Means Kinerja Dosen Berdasarkan SKP (Sasaran Kinerja Pegawai) Studi Kasus Politeknik Negeri Malang', 'SISTEM INFORMASI', '', '', '', 8, 'Pelaksanaan penilaian prestasi kerja berdasarkan SKP di Polinema dapat dikatakan masih belum optimal dikarenakan ada masalah dalam implementasinya, dari permasalahan di atas, maka penulis ingin mengimplementasikan tentang penilaian prestasi kerja dosen PNS dan CPNS berdasarkan SKP di Polinema, dalam sebuah judul Implementasi metode clustering K-Means kinerja dosen berdasarkan SKP (Sasaran Kinerj Pegawai)', '01d49f50cb57f2d7bcd95e7dafdb3fe3.JPG', '37c6e6e4f91214514ca77abca9a6924f.pdf', '', '', 263),
('1641720063', 'SISTEM INFORMASI PENDUKUNG KEPUTUSAN PERENCANAAN KEGIATAN UNTUK REKOMENDASI PENGGUNAAN ALOKASI DANA DESA (STUDI KASUS DESA GAMBIRAN KECAMATAN PRIGEN KABUPATEN PASURUAN)', 'SISTEM INFORMASI', 'MOORA (Multi-Objective Optimization on the basis of Ratio Analysis)', '', '', 2, 'Alokasi dana desa adalah anggaran keuangan yang diberikan pemerintah kepada desa, yang mana sumbernya berasal dari Bagi Hasil Pajak Daerah serta Dana Perimbangan Keuangan Pusat dan Daerah yang diterima oleh kabupaten. Setiap kegiatan yang pendanaannya diambil dari Alokasi Dana Desa (ADD) harus melalui perencanaan, pelaksanaan dan evaluasi secara terbuka dengan prinsip: dari, oleh dan untuk masyarakat. Namun dalam pelaksanaan kegiatan yang sehubungan dengan penggunaan anggaran desa saat ini, masih banyak kegiatan ataupun hal yang belum dapat terpantau dan tertuju secara tepat sasaran dengan apa yang menjadi tujuan anggaran dana desa tersebut. Seperti halnya contoh: Alokasi dana desa yang seharusnya ditujukan untuk bantuan masyarakat miskin masih belum bisa berdampak langsung karena pemerintah desa juga tidak bisa memantau secara langsung dan berkelanjutan tentang bantuan tersebut sudah digunakan sebagaimana mestinya atau tidak, juga terjadi kemacetan dana desa yang diakibatkan dari kurang adanya informasi atau sistem yang bekerja untuk dapat menentukan kegiatan apa atau pekerjaan apa yang bisa dilakukan oleh pemerintah desa dalam pemanfaatan dana desa tersebut sehingga pengalokasian dana tersebut dapat tertuju dengan tepat sasaran, berdampak dan dapat dirasakan oleh seluruh masyarakat desa.Sistem Informasi Pendukung Keputusan ini dibuat bertujuan untuk mengatasi masalah-masalah seperti contoh diatas yang kerap terjadi di pemerintah desa. Sistem ini digunakan sebagai acuan pegawai ataupun pihak yang berwenang dalam pemerintah desa untuk mengambil keputusan secara tepat dalam pemanfaatan alokasi dana desa, sehingga diharapkan alokasi dana desa ini secara terperinci bisa menampilkan kebutuhan dan pekerjaan apa yang diprioritaskan untuk dijalankan dengan perpaduan masukan dari seberapa besar dana yang dianggarkan dan seberapa besar pemanfaatan sumber daya manusia (SDM) yang dibutuhkan. Sistem ini diharapkan mampu menjadi salah satu pendukung pemerintah dalam mengambil keputusan.', '47588fc5d2bb295ff8edeefd7f6c9b69.jpg', '0a59b40580ccee83ad9c98b28574b83c.pdf', '', '', 264),
('1641720072', 'SISTEM PENDUKUNG KEPUTUSAN PADA SOLUSI KELAYAKAN PENERIMA BANTUAN BEDAH RUMAH MENGGUNAKAN METODE PROFILE MATCHING (STUDI KASUS BAZNAS KOTA MALANG', 'SISTEM INFORMASI', 'SOP BAZNAS, Jurnal Pemilihan Penerima Beasiswa Menggunakan Metode Profile Matching, oleh : Agus Junaidi dan Vany Visella', 'JURNAL POLITEKNIK NEGERI MALANG, OLEH BPK. AHMAD SYARIFUDIN DAN BPK. AHMADI YULI ANANTA, JUDUL : RANCANG BANGUN SISTEM PENDUKUNG KEPUTUSAN  KELAYAKAN PEMBERIAN KREDIT MENGGUNAKAN METODE PROFILE MATCHING, dan beberapa jurnal lainnya.', '', 28, 'Penelitian kali ini akan dibangun sebuah sistem informasi berupa sistem pendukung keputusan pada salah satu program di lembaga sosial BAZNAS yaitu bedah rumah. nantinya akan ada solusi rekomendasi siapa yang paling berhak menerima bantuan tersebut dengan menentukan kriteri-kriteria dari BAZNAS itu sendiri dan akan diproses menggunakan metode profile matching. sistem ini hanya untuk mendukung dan merekomendasikan mustahiq(calon penerima bantuan yang berhak), keputusan utama untuk menentukan hanya dari pihak yang bersangkutan. Dari BAZNAS sendiri juga sangat membutuhkan untuk dibuatkan sistem informasinya dari program-program yang ada.', '165367c356865e5030930a181e31a9ee.jpg', 'b4910d1caccab9456ba421720308932c.pdf', '', '', 265),
('1641720186', 'M-MLIJO DENGAN PENENTUAN RUTE PENGANTARAN TERDEKAT BERBASIS ANDROID DENGAN METODE HAVERSINE FORMULA', 'SISTEM INFORMASI', 'Haversine Formula', '', '', 4, 'Mlijo adalah penjual sayuran keliling, yang selama ini selalu menjual sayur dan bahan makanan dengan jualan dan pelanggan yang acak tanpa perencanaan, sehingga sering terjadi barang yang tak terjual yang cukup banyak atau barang yang dicari tidak tersedia. M-Mlijo sendiri adalah aplikasi berbasis android yang diharapkan mampu mengatasi permasalahan secara online, serta sistem pengantaran yang lebih efektif karena pada aplikasi tersebut tersedia metode untuk menentukan rute terpendeknya.', '30cbbc9e009a708ca8735767db5e056e.jpg', '1333ac3e404dbbefd7474ee0f43ccc3c.pdf', '', '', 266),
