('1641720103', 'PERINGKASAN TEKS OTOMATIS PADA PORTAL BERITA OLAHRAGA MENGGUNAKAN METODE MAXIMUM MARGINAL RELEVANCE ', 'SISTEM CERDAS', 'Setiadi, F., Djamal, E. c., & Ilsyas, R. (2018). PERINGKASAN KUMPULAN BERITA SECARA OTOMATIS MENGGUNAKAN METODE MAXIMUM MARGINAL RELEVANCE .', 'Penerapan Algoritma Cosine Similarity dan Pembobotan TF-IDF pada Sistem Klasifikasi Dokumen Skripsi Jurnal Teknik Elektro Vol. 9 No. 1 Januari - Juni 2017', '', 14, 'penelitian kali ini yaitu meringkas teks khususnya berita olahraga dapat digunakan untuk mengambil isi yang paling penting dati sumber informasi yang kemudian menyajikan kembali dalam bentuk yang lebih ringkas dari sebuah berita tanpa harus membaca keseluruhan dari berita', '6751301a3a3ec65f13b5bea3ffbfdefd.jpg', '1083c191592b3b21a89956380259ebad.pdf', '', '', 269),
