('1941727007', 'IMPLEMENTASI METODE SERVQUAL UNTUK MENGUKUR TINGKAT KEPUASAN PELANGGAN PADA SISTEM INFORMASI RESERVASI TOUR AND TRAVEL\r\n(Studi Kasus CV. TRIEM TOUR)\r\n', 'SISTEM INFORMASI', 'Metode Service Quality ( Servqual )', '', '', 28, 'Tujuan dari penelitian ini yaitu \r\n1. membuat sistem informasi reservasi tour and travel berbasis website yang diambil dari studi kasus di biro perjalanan Cv. Triem Tour dengan tujuan mempermudah proses pemesanan paket wisata. \r\n2. Mengetahui kualitas layanan yang diberikan terhadap pelanggan', '6c9c643e4019019135fb53e012782de1.jpg', 'a6084e6e462607cd92f70debb9caa855.pdf', '', '', 273);
