('1641720010', 'Implementasi Algoritma Menggunakan Metode Fisher-Yates Shuffle dan Fuzzy Tsukamoto Dalam Game Kuis Tebak Nada Jawa Berbasis Android', 'MULTIMEDIA DAN GAME', 'Fisher-Yates Shuffle', 'Fuzzy Tsukamoto', '', 28, 'Tujuan analisa dari pembuatan aplikasi Game Kuis Tebak Nada Jawa ini adalah sebagai berikut : \r\n1. Dapat menerapkan algoritma Algoritma FisherYates Shuffle untuk sistem pengacakan. \r\n\r\n2. Dapat menerapkan Fuzzy Tsukamoto untuk penentuan skor pada Game Kuis Tebak Nada Jawa.', 'f81149f2033629f1373c1d48cb053cee.jpg', 'a773c50100e83261857fcafa806a87f2.pdf', '', '', 274),
