('1641720068', 'Rancang Bangun Sistem Identifikasi Kelayakan Pakai Oli Transformator Berdasarkan Parameter Warna', 'SISTEM INFORMASI', 'Implementasi Metode RGB To HSV pada Aplikasi Pengenalan Mata Uang Kertas Berbasis Android untuk Tuna Netra', 'Penerapan Metode Kâ€“Nearest Neighbor (KNN) dan Metode Weighted Product (WP) Dalam Penerimaan Calon Guru Dan Karyawan Tata Usaha Baru Berwawasan Teknologi (Studi Kasus : Sekolah Menengah Kejuruan Muhammadiyah 2 Kediri)', '', 9, 'Melakukan perawatan pada oli transformator bertujuan untuk meningkatkan tahanan isolasinya, membersihkan kotoran misalnya partikel-partikel yang tidak perlu dan gram-gram yang terkelupas dari kumparan transformator, mengurangi kadar air, serta untuk mengurangi biaya sebab kalau dilakukan penggantian setiap tahun biayanya jauh lebih besar dibandingkan dengan biaya perawatan. Maka dari itu diperlukan pengecekan secara berkala untuk memastikan kualitas oli dalam transformator apakah masih dalam keadaan baik/layak pakai.Namun dari beberapa cara dalam melakukan perawatan oli transformator tersebut  masih belum bisa dilakukan hanya dengan melihat warna dari oli transformator karena dianggap kurang akurat jika hanya dilihat hanya dengan kasat mata. Salah satu teknologi yang dapat membantu dalam meng-identifikasi sebuah warna dengan akurat adalah pengolahan citra digital atau yang biasa disebut dengan digital image processing. Sehingga dengan adanya rancangan sistem identifikasi kalayakan pakai oli transformator ini diharapkan dapat membantu pekerja dalam melakukan perawatan pada transformator dan dapat menentukan kapan saat oli transformator harus diganti yang tentunya akan memperpanjang umur pemakaian dari transformator itu sendiri', '59e1c1f00adf5156586e1f5b992def1a.jpg', '056b696fb64879f0d0efe04437cc2cec.pdf', '', '', 278),
('1641720095', 'Sistem Pakar Bimbingan Dan Konseling Mahasiswa Dengan Metode Dempster Shafer Berbasis Web ', 'SISTEM INFORMASI', 'Metode Dempster Shafer', '', '', 23, 'Dengan dibangunnya sistem pakar ini diharapkan dapat memberikan kemudahan dalam aktivitas-aktivitas akademik khususnya bimbingan dan konseling yang dibutuhkan oleh mahasiswa terutama mahasiswa semester awal yang harus beradaptasi dengan lingkungan barunya agar tidak mudah terpengaruh oleh pergaulan sehingga dapat menjadi pribadi yang lebih baik.', '8afff770d937782a8767822e0f666570.jpg', 'c3090165aeb341ec23824aff18f81a32.pdf', '', '', 279),
