('1741723008', 'IDENTIFIKASI KUALITAS STRAWBERRY BERDASARKAN WARNA DAN TEKSTUR DENGAN GRAY LEVEL CO-OCCURRENCE MATRIX DAN NAIVE BAYES\r\n(Studi Kasus Kedai Strawberry Batu)\r\n', 'VISI KOMPUTER', 'KUALITAS BUAH STROBERI  (Fragaria sp cv HOLIBERT) SEGAR DAN PENYIMPANANNYA DALAM LINGKUNGAN TROPIS DARI KEBUN KETEP MAGELANG JAWA TENGAH', 'ANALISIS TEKSTUR CITRA MIKROSKOPIS KANKER PARU MENGGUNAKAN METODE GRAY LEVEL CO-OCCURANCE MATRIX (GLCM) DAN TRANFORMASI WAVELET DENGAN KLASIFIKASI NAIVE BAYES ', '', 3, 'Pada saat ini untuk mengetahui kualitas strawberry masih menggunakan cara manual yaitu dengan mengandalkan pengamatan mata yang masih memiliki kekurangan yang disebabkan keterbatasan dan kelemahan indera manusia. Dengan banyaknya masalah mengenai kualitas mutu strawberry terdapat solusi yang dapat membantu distributor strawberry dalam mengidentifikasi kualitas strawberry yang layak dijual dengan menggunakan Sistem Pengolahan Citra. Dalam tugas akhir ini merancang sistem Pengolahan Citra Digital yang dapat membantu untuk mengidentifikasi kualitas strawberry yang layak dipasarkan dari warna dan tekstur. Data yang akan diambil yaitu strawberry menggunakan kamera smartphone. Metode yang digunakan adalah metode Gray Level Co- Occurrence dimana dalam perhitungan statistiknya menggunakan distribusi derajat keabuan dengan mengukur tingkat kekontrasan, granularitas, dan kekasaran suatu daerah dari hubungan ketetanggaan antar piksel di dalam citra dan metode Naive Bayes  untuk klasifikasi terhadap objek berdasarkan data pembelajaran yang jaraknya paling dekat dengan objek. ', '6848056c6e019b82b45bef8094367101.jpeg', '03307b581c7fc4e483c1a5316c1fee95.pdf', '', '', 294),
('1641720033', 'Sistem Pendukung Keputusan Untuk Menentukan Lokasi Peternakan Ayam Petelur Menggunakan Metode Weighted Aggregated Sum Product Assessment', 'SISTEM INFORMASI', 'Sistem Pendukung Keputusan Penentuan Lokasi Pembangungan Peternakan Ayam Menggunakan metode MOORA.', 'Sistem Pendukung Keputusan Penentuan Kebijakan Strategi Promosi Kampus dengan Metode  Weighted Aggregated Sum Product Assesment(WASPAS)', '', 8, 'Aplikasi ini digunakan untuk mendukung keputusan pemilik peternakan untuk menentukan lokasi peternakan ayam petelur sesuai kriteria dan bobot yang ditentukan menggunakan metode Weighted Aggregated Sum Product Assessment', 'cc70cce0fe61ce55a16ed605ae7d62dc.jpeg', '5deabbb91d508d13ddaa35093613e30d.pdf', '', '', 295),
